INSERT INTO checkpoint_commands VALUES(2,'cphaprob','Herramienta principal de monitoreo y diagnóstico de ClusterXL en CheckPoint. Permite verificar el estado completo del cluster incluyendo miembros activos/standby, critical devices (pnotes), interfaces monitoreadas, sincronización entre nodos, estadísticas de load balancing, historial de failovers, configuración de bonds, latencia entre miembros y estado de encriptación CCP. Es el comando más utilizado para troubleshooting de clusters.','[{"args":"state","description":"Muestra el estado general del cluster incluyendo modo (HA/Load Sharing), ID de cada miembro, dirección única, carga asignada, estado (ACTIVE/STANDBY/DOWN), nombre del miembro, critical devices activos con problemas, último evento de cambio de estado con código y razón, historial de failover y contador de failovers desde el último reinicio"},{"args":"-l list","description":"Lista detallada de todos los critical devices (pnotes) registrados en el cluster mostrando: nombre del dispositivo, número de registro, timeout configurado en segundos, estado actual (OK/problem/init), tiempo desde el último reporte y estado del proceso. Útil para identificar qué componente está causando que un miembro esté DOWN"},{"args":"list","description":"Muestra lista de critical devices con opciones: -l para formato largo con detalles completos, -i para información adicional, -e para formato extendido, -ia para mostrar toda la información disponible"},{"args":"if","description":"Muestra interfaces del cluster con opciones: -a para mostrar todas las interfaces (secured y virtuales), -m para mostrar solo interfaces monitoreadas, -vs <VSID> para especificar un Virtual System, -vs all para todos los VS. Incluye estado de cada interfaz, dirección IP y si está participando activamente en el cluster"},{"args":"syncstat","description":"Muestra estadísticas detalladas de sincronización de conexiones entre miembros del cluster incluyendo: número de paquetes sync enviados/recibidos, bytes transferidos, conexiones sincronizadas, errores de sincronización y estado del canal sync. Usar -reset para reiniciar los contadores. Útil para diagnosticar problemas de sincronización"},{"args":"ldstat","description":"Muestra estadísticas de load balancing en modo Load Sharing (Multicast/Unicast) incluyendo distribución de carga entre miembros, paquetes procesados por cada miembro y balance de conexiones. Usar -reset para reiniciar contadores"},{"args":"show_failover","description":"Muestra historial completo de eventos de failover con: fecha/hora de cada failover, miembro que pasó a ACTIVE, miembro que bajó, razón del failover (ejemplo: ADMIN_DOWN, interface down, pnote problem), código de evento CLUS-XXXXXX. Opciones: -reset para limpiar historial, -c para resetear contador, -h para resetear historial, -l <count> para limitar cantidad de eventos mostrados"},{"args":"names","description":"Muestra cómo se presentan los miembros del cluster en los logs locales: por ID numérico (modo por defecto) o por nombre configurado. Afecta a logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg"},{"args":"tablestat","description":"Muestra tabla de direcciones IP únicas de todos los miembros del cluster con su estado de monitoreo. Usar -m para mostrar solo direcciones IP monitoreadas. Útil para verificar qué IPs están siendo rastreadas por el mecanismo de cluster"},{"args":"show_bond","description":"Muestra estado detallado de interfaces bond (agregación de enlaces) incluyendo: interfaces subordinadas activas, modo del bond (active-backup, 802.3ad, etc.), interface activa actual, estado de cada subordinada. Si se especifica bond_name muestra solo ese bond, sin argumentos muestra todos"},{"args":"show_bond_groups","description":"Muestra grupos de interfaces bond configurados en el cluster con información sobre qué bonds pertenecen a cada grupo y su configuración de alta disponibilidad"},{"args":"igmp","description":"Muestra configuración de IGMP (Internet Group Management Protocol) utilizada en clusters Load Sharing con modo Multicast, incluyendo grupos multicast suscritos y estado de membresía"},{"args":"routedifcs","description":"Muestra interfaces que el daemon RouteD está monitoreando en el cluster para protocolos de enrutamiento dinámico (OSPF, BGP, RIP). Usar detailed para información extendida incluyendo métricas y estado de cada protocolo"},{"args":"roles","description":"Muestra roles del daemon RouteD en cada miembro del cluster: cuál es el miembro activo para enrutamiento dinámico y cuál está en standby. Importante en clusters HA con protocolos de enrutamiento"},{"args":"release","description":"Muestra la versión exacta de ClusterXL instalada en el miembro actual, incluyendo número de release, build y hotfixes aplicados"},{"args":"ccp_encrypt","description":"Muestra si la encriptación del Cluster Control Protocol (CCP) está activada o desactivada. CCP es el protocolo que usan los miembros para comunicarse sobre estado y sincronización"},{"args":"corr","description":"Muestra estadísticas de corrección del cluster (paquetes que debieron ser reenviados o corregidos). Opciones: -d para deferred packets (paquetes diferidos), -f para forwarded packets (paquetes reenviados a otro miembro), -s para resumen general. Útil para detectar problemas de distribución de tráfico"},{"args":"fcustat","description":"Muestra estadísticas del mecanismo Full Connectivity Upgrade, que permite actualizar clusters sin pérdida de conectividad. Incluye: estado de la actualización, conexiones migradas, paquetes procesados durante upgrade"},{"args":"latency","description":"Muestra latencia de comunicación entre los miembros del cluster en milisegundos. Importante para diagnosticar problemas de red entre nodos que pueden causar split-brain o failovers falsos"}]','clusterxl','R81+','cluster, estado, monitoreo, diagnóstico, high availability, failover, pnotes, critical devices, sincronización, interfaces, bond, estadísticas, load sharing, latencia, troubleshooting, standby, active','expert','query','firewall',1,'low','[]',0,'2025-12-28 21:26:25','2025-12-28 21:26:25');
INSERT INTO checkpoint_commands VALUES(3,'cphaconf','Comando de configuración interna avanzada de ClusterXL en CheckPoint. Permite configurar critical devices (pnotes) personalizados, encriptación del protocolo CCP, modos de operación del cluster, configuración de interfaces bond para load sharing, forwarding layer entre miembros y parámetros del kernel del cluster. ADVERTENCIA: Es un comando de bajo nivel que debe usarse con precaución, preferiblemente solo bajo instrucciones de CheckPoint Support, ya que configuraciones incorrectas pueden afectar la estabilidad del cluster.','[{"args":"set_pnote -d <device> -t <timeout> -s {ok|init|problem} [-p] [-g] register","description":"Registra un critical device (pnote) personalizado en el cluster. El device debe reportar su estado periódicamente dentro del timeout (en segundos) o el miembro será marcado como DOWN. Estado inicial: ok (device funcionando), init (inicializando, miembro DOWN hasta que cambie), problem (falla inmediata, causa failover). Opciones: -p hace el cambio permanente (sobrevive reinicio), -g aplica a todos los Virtual Systems. Límite: 16 pnotes por miembro, nombres máximo 15 caracteres sin espacios"},{"args":"set_pnote -d <device> [-p] [-g] unregister","description":"Des-registra un critical device específico del cluster eliminándolo de la lista de componentes monitoreados. El miembro ya no verificará el estado de este device. Usar -p para cambio permanente, -g para aplicar a todos los Virtual Systems"},{"args":"set_pnote -a [-g] unregister","description":"Des-registra TODOS los critical devices personalizados del cluster de una sola vez. No afecta a los pnotes built-in del sistema. Usar -g para aplicar a todos los Virtual Systems configurados"},{"args":"set_pnote -d <device> -s {ok|init|problem} [-g] report","description":"Reporta o cambia el estado actual de un critical device ya registrado. Estados: ok (device funcionando correctamente), init (device inicializando, cluster no puede ser ACTIVE), problem (device falló, causa DOWN inmediato del miembro y failover). Usar -g para aplicar a todos los Virtual Systems"},{"args":"set_pnote -f <file> [-g] register","description":"Registra múltiples critical devices desde un archivo de configuración. El archivo debe tener formato: cada línea con <nombre> <timeout> <estado>. Útil para configurar varios pnotes simultáneamente. Usar -g para aplicar a todos los Virtual Systems"},{"args":"mem_id_mode {id|name}","description":"Configura cómo se muestran los miembros del cluster en logs locales: id (número de miembro, modo por defecto) o name (nombre configurado en SmartConsole). Afecta logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg. Debe configurarse igual en todos los miembros del cluster"},{"args":"ccp_encrypt {on|off}","description":"Activa o desactiva la encriptación del Cluster Control Protocol (CCP). CCP es el protocolo de comunicación entre miembros para intercambiar información de estado, sincronización y heartbeats. La encriptación protege esta comunicación sensible. Debe configurarse igual en todos los miembros"},{"args":"ccp_encrypt_key <key_string>","description":"Configura la clave de encriptación compartida para el Cluster Control Protocol (CCP). Todos los miembros del cluster deben usar la misma clave para poder comunicarse. Solo funciona si ccp_encrypt está en on"},{"args":"forward {on|off}","description":"Configura el Cluster Forwarding Layer que controla el reenvío de tráfico entre miembros del cluster. NOTA: Esta es una función interna de CheckPoint y solo debe modificarse bajo instrucción directa del soporte técnico. Configuración incorrecta puede causar pérdida de tráfico"},{"args":"bond_ls set <bond> <value>","description":"Configura el número mínimo de interfaces subordinadas requeridas activas en un bond para Load Sharing. Por defecto es n-1 (si hay 4 subordinadas, requiere mínimo 3). Si caen más interfaces de las permitidas, el bond se considera DOWN. Calcular según: (tráfico_máximo_esperado / velocidad_subordinada) redondeado arriba. Se guarda en $FWDIR/conf/cpha_bond_ls_config.conf"},{"args":"bond_ls remove <bond>","description":"Elimina la configuración personalizada de número mínimo de interfaces subordinadas para un bond específico, volviendo al comportamiento por defecto (n-1 interfaces requeridas)"},{"args":"debug_data","description":"Imprime la configuración completa actual del cluster tal como está cargada en el kernel del firewall. Útil para debugging avanzado y verificación de configuración a nivel de kernel. Muestra parámetros internos, interfaces, pnotes y estado del cluster"},{"args":"failover_bond <bond_name>","description":"Inicia manualmente un failover interno entre las interfaces subordinadas de un bond específico. Solo aplicable en modo Bond High Availability. Fuerza el cambio de la interface subordinada activa a otra disponible. Útil para testing o mantenimiento de interfaces"},{"args":"mvc {on|off}","description":"Activa o desactiva el mecanismo Multi-Version Cluster (MVC) que permite ejecutar un cluster con miembros en diferentes versiones de CheckPoint durante actualizaciones. Cuando está off, los miembros con versión más nueva quedan en estado READY hasta que todos tengan la misma versión. Debe configurarse igual en todos los miembros"}]','clusterxl','R81+','configuración, cluster, critical device, pnote, encriptación, ccp, bond, load sharing, administración avanzada, kernel, forwarding, multi-version cluster','expert','config','firewall',0,'high','[]',0,'2025-12-28 21:27:21','2025-12-28 21:27:21');
INSERT INTO checkpoint_commands VALUES(4,'clusterXL_admin','Comando para iniciar manualmente failover del cluster poniendo un miembro en modo administrativo DOWN o UP. Permite realizar mantenimiento programado sin afectar el servicio, ejecutar testing de failover controlado o troubleshooting de problemas de cluster. El comando manipula el critical device especial admin_down que tiene prioridad sobre otros pnotes. En clusters HA causa transición inmediata de ACTIVE a STANDBY forzando al otro miembro a tomar control. En Load Sharing redistribuye el tráfico a los demás miembros activos.','[{"args":"down","description":"Pone el miembro local del cluster en estado DOWN administrativamente de forma temporal (no sobrevive reinicio). Esto activa el critical device admin_down, fuerza un failover inmediato al miembro standby en HA o redistribuye tráfico en Load Sharing. El miembro deja de procesar tráfico pero mantiene sincronización. Útil para mantenimiento programado, testing de failover o troubleshooting. Para hacer permanente usar -p o en Clish: set cluster member admin down permanent"},{"args":"down -p","description":"Pone el miembro local en estado DOWN administrativamente de forma permanente (sobrevive reinicio). El miembro permanecerá DOWN incluso después de reiniciar hasta que se ejecute clusterXL_admin up. Ideal para mantenimiento prolongado donde se requieren múltiples reinicios del servidor"},{"args":"up","description":"Restaura el miembro local a operación normal desde estado DOWN administrativo de forma temporal. Desactiva el critical device admin_down permitiendo que el miembro vuelva a participar en el cluster. En HA pasará a STANDBY si ya hay otro ACTIVE. En Load Sharing volverá a recibir tráfico. Si hay otro miembro ACTIVE, no fuerza failover"},{"args":"up -p","description":"Restaura el miembro a operación normal de forma permanente (sobrevive reinicio). Elimina el estado DOWN administrativo persistente configurado previamente con down -p. El miembro volverá a participar activamente en el cluster y mantendrá este estado tras reinicios"}]','clusterxl','R81+','failover manual, mantenimiento, down, up, cluster administration, high availability, standby, active, testing, troubleshooting, admin_down','expert','config','firewall',1,'critical','[]',0,'2025-12-28 21:28:01','2025-12-28 21:28:01');
INSERT INTO checkpoint_commands VALUES(5,'set cluster member','Comandos de configuración de ClusterXL desde Gaia Clish (interfaz de línea de comandos de Gaia). Permite configurar aspectos fundamentales del cluster sin necesidad de entrar a Expert mode, incluyendo: iniciar failover manual, configurar encriptación de comunicaciones CCP, establecer modo de visualización de miembros en logs, activar Multi-Version Cluster y controlar el forwarding layer. Estos comandos son equivalentes a los comandos cphaconf y clusterXL_admin de Expert mode pero diseñados para uso en el shell seguro de Gaia. Los cambios deben aplicarse consistentemente en todos los miembros del cluster.','[{"args":"admin {down|up} [permanent]","description":"Inicia failover manual del cluster desde Gaia Clish poniendo el miembro en DOWN (causa failover inmediato al standby) o UP (restaura operación normal). Equivalente a clusterXL_admin en Expert mode. Usar permanent para que el cambio sobreviva reinicios. En HA fuerza transición ACTIVE/STANDBY, en Load Sharing redistribuye tráfico. Útil para mantenimiento programado sin afectar servicio"},{"args":"ccpenc {off|on}","description":"Activa (on) o desactiva (off) la encriptación del Cluster Control Protocol (CCP) desde Gaia Clish. CCP es el protocolo de comunicación interna entre miembros del cluster para heartbeats, sincronización de estado y coordinación de failover. Encriptar CCP protege información sensible del cluster. Debe configurarse idénticamente en todos los miembros para mantener comunicación. Equivalente a cphaconf ccp_encrypt en Expert mode"},{"args":"forwarding {off|on}","description":"Activa (on) o desactiva (off) el Cluster Forwarding Layer que controla cómo se reenvía tráfico entre miembros. ADVERTENCIA: Función interna de CheckPoint que solo debe modificarse bajo instrucción del soporte técnico. Configuración incorrecta puede causar pérdida total de tráfico o loops. Equivalente a cphaconf forward en Expert mode"},{"args":"idmode {id|name}","description":"Configura cómo se muestran los miembros del cluster en logs locales: id muestra el número de miembro (1, 2, 3..., modo por defecto), name muestra el nombre configurado en SmartConsole (Member1, Member2...). Afecta logs en /var/log/messages, dmesg y $FWDIR/log/fwd.elg. Facilita identificación en troubleshooting. Debe configurarse igual en todos los miembros. Equivalente a cphaconf mem_id_mode en Expert mode"},{"args":"mvc {off|on}","description":"Activa (on) o desactiva (off) el mecanismo Multi-Version Cluster que permite ejecutar cluster con miembros en diferentes versiones de CheckPoint durante actualizaciones. Con mvc off, miembros con versión superior quedan en estado READY hasta que todos estén en la misma versión. Con mvc on, versiones mixtas pueden coexistir permitiendo upgrades sin downtime. Debe configurarse igual en todos los miembros. Equivalente a cphaconf mvc en Expert mode"}]','clusterxl','R81+','clish, gaia, configuración cluster, failover, encriptación ccp, multi-version, logs, administración, set cluster','clish','config','firewall',0,'high','[]',0,'2025-12-28 21:28:49','2025-12-28 21:28:49');
INSERT INTO checkpoint_commands VALUES(6,'show cluster','Comandos de monitoreo y visualización de ClusterXL desde Gaia Clish (interfaz de línea de comandos de Gaia). Proporciona visibilidad completa del estado y operación del cluster sin necesidad de entrar a Expert mode. Permite verificar: estado de miembros (ACTIVE/STANDBY/DOWN), critical devices y causas de fallas, interfaces monitoreadas y su estado, estadísticas de sincronización y failover, configuración de bonds, versiones instaladas, encriptación CCP, roles de enrutamiento y historial de eventos. Son equivalentes a los comandos cphaprob de Expert mode pero diseñados para uso en el shell seguro de Gaia. Herramienta principal para troubleshooting y monitoreo operacional del cluster.','[{"args":"state","description":"Muestra el estado general del cluster desde Gaia Clish: modo de operación (HA/Load Sharing), lista de todos los miembros con su ID, dirección IP única, carga asignada, estado actual (ACTIVE/STANDBY/DOWN/READY), nombre, critical devices con problemas, último evento de cambio de estado, historial de failover y contadores. Equivalente a cphaprob state en Expert mode. Comando principal para verificar salud del cluster"},{"args":"members pnotes","description":"Lista todos los critical devices (pnotes) registrados en el cluster mostrando: nombre del device, número de registro, timeout configurado, estado actual (OK/problem/init), tiempo desde último reporte. Incluye pnotes built-in (fwd, cphad, Policy, Fullsync, etc.) y personalizados. Equivalente a cphaprob -l list en Expert mode. Esencial para diagnosticar por qué un miembro está DOWN"},{"args":"members interfaces","description":"Muestra todas las interfaces del cluster con su estado, dirección IP, tipo (secured/virtual), y si están siendo monitoreadas por ClusterXL. Incluye interfaces físicas, VLANs y bonds. Indica cuáles participan activamente en detección de fallas. Equivalente a cphaprob if en Expert mode"},{"args":"members ips","description":"Muestra tabla de direcciones IP únicas de todos los miembros del cluster con su estado de monitoreo. Útil para verificar qué direcciones IP están siendo rastreadas por el mecanismo de high availability. Equivalente a cphaprob tablestat en Expert mode"},{"args":"members sync","description":"Muestra estadísticas detalladas de sincronización de conexiones entre miembros: paquetes sync enviados/recibidos, bytes transferidos, conexiones sincronizadas, errores, estado del canal de sincronización. Usar ''reset'' para reiniciar contadores. Equivalente a cphaprob syncstat. Crítico para diagnosticar problemas de pérdida de conexiones durante failover"},{"args":"members failover","description":"Muestra historial completo de eventos de failover del cluster: fecha/hora exacta, transición entre miembros (quién pasó a ACTIVE), razón del failover (ADMIN_DOWN, interface down, pnote problem, etc.), código de evento CLUS-XXXXXX. Equivalente a cphaprob show_failover. Esencial para auditoría y análisis de estabilidad"},{"args":"members statistics","description":"Muestra estadísticas generales de operación del cluster incluyendo: contadores de paquetes procesados, distribución de carga, eventos de failover, tiempo de actividad de cada miembro, performance del cluster. Vista consolidada de métricas operacionales"},{"args":"members idmode","description":"Muestra el modo actual de presentación de miembros en logs locales: ID (números 1,2,3...) o NAME (nombres configurados). Afecta /var/log/messages, dmesg y logs de firewall. Equivalente a cphaprob names en Expert mode"},{"args":"members ccpenc","description":"Muestra el estado de encriptación del Cluster Control Protocol (CCP): ON si las comunicaciones entre miembros están encriptadas, OFF si van en claro. CCP transporta heartbeats, estado y sincronización. Equivalente a cphaprob ccp_encrypt en Expert mode"},{"args":"members mvc","description":"Muestra el estado del mecanismo Multi-Version Cluster (MVC): ON si está permitido ejecutar cluster con versiones mixtas de CheckPoint durante upgrades, OFF si requiere misma versión en todos los miembros. Incluye versiones actuales de cada miembro"},{"args":"members release","description":"Muestra la versión exacta de ClusterXL instalada en cada miembro del cluster incluyendo: número de release (R81, R81.10, R81.20), build number, hotfixes aplicados. Útil para verificar consistencia de versiones. Equivalente a cphaprob release"},{"args":"members igmp","description":"Muestra configuración IGMP (Internet Group Management Protocol) del cluster para modo Load Sharing Multicast: grupos multicast suscritos, direcciones multicast en uso, estado de membresía IGMP. Solo relevante en clusters Load Sharing con multicast. Equivalente a cphaprob igmp"},{"args":"members roles","description":"Muestra roles del daemon RouteD (enrutamiento dinámico) en cada miembro: cuál está activo procesando OSPF/BGP/RIP y cuál en standby. Importante en clusters HA con protocolos de enrutamiento dinámico. Equivalente a cphaprob roles"},{"args":"bond all","description":"Muestra estado completo de todas las interfaces bond (agregación de enlaces) configuradas en el cluster: interfaces subordinadas, cuáles están activas, modo del bond (active-backup, LACP 802.3ad, balance-rr, etc.), interface primaria actual, estado de cada subordinada (up/down). Equivalente a cphaprob show_bond"},{"args":"bond name <bond_name>","description":"Muestra información detallada de una interface bond específica: todas sus interfaces subordinadas, cuál está actualmente activa/primaria, modo de operación del bond, estado individual de cada subordinada, estadísticas de tráfico por subordinada si aplica"},{"args":"members monitored","description":"Muestra solo las interfaces que están siendo activamente monitoreadas por ClusterXL para detección de fallas. Excluye interfaces no-monitored configuradas. Útil para verificar qué interfaces pueden causar failover si fallan"}]','clusterxl','R81+','clish, gaia, monitoreo cluster, show cluster, estado, pnotes, interfaces, failover, sincronización, estadísticas, bond, troubleshooting, high availability','clish','query','firewall',1,'low','[]',0,'2025-12-28 21:30:03','2025-12-28 21:30:03');
INSERT INTO checkpoint_commands VALUES(7,'vsx','Comando principal para gestión y administración de VSX (Virtual System Extension) en CheckPoint. Permite obtener y aplicar configuración desde el Security Management Server, gestionar políticas de seguridad de Virtual Systems y Virtual Routers, controlar recursos de memoria y CPU, mostrar estadísticas y estado del VSX Gateway, resetear SIC, descargar políticas y limpiar entradas no utilizadas. Es la herramienta fundamental para operación y troubleshooting de entornos VSX que soportan múltiples virtual firewalls en un único hardware físico.','[{"args":"fetch","description":"Obtiene la configuración más reciente desde el Security Management Server o Multi-Domain Server y la aplica al VSX Gateway. Lee el archivo local.vsall con los Network Configuration Scripts (NCS) y los ejecuta. Opciones: -v verbose (información detallada), -q quiet (solo resumen), -s concurrent fetch para multi-procesador, -c indica VSX Cluster, -n no aplicar si configuración ya está actualizada, -f <archivo> usar archivo específico en lugar de local.vsall, -C ejecutar comando NCS específico, [<Management Server>] obtener desde servidor específico por hostname o IP"},{"args":"fetch_all_cluster_policies","description":"Obtiene las políticas de seguridad de todos los Virtual Systems y Virtual Routers desde los peers del cluster VSX. Útil para sincronizar políticas entre miembros del cluster después de cambios o para recuperación. Opción: -v para modo verbose con información detallada del proceso de fetch"},{"args":"fetchvs","description":"Obtiene el archivo de configuración para un Virtual Device específico basándose en información almacenada localmente en el VSX Gateway. Permite especificar el VS por VSID (ID numérico) o por nombre del Virtual Device. Opciones: -v verbose para información detallada, -q quiet para solo información resumida. Más rápido que fetch completo cuando solo se necesita actualizar un VS específico"},{"args":"get","description":"Muestra información sobre el contexto VSX actual incluyendo: nombre del VSX Gateway, ID del contexto actual, y si está en contexto de VS0 (gateway principal) o de un Virtual System específico. Útil para confirmar en qué contexto se están ejecutando comandos antes de hacer cambios"},{"args":"mstat","description":"Muestra y configura Memory Resource Control para Virtual Systems. Sin opciones muestra consumo total de memoria por cada VS. Opciones: -vs <VSID> para VSs específicos (uno o varios separados por espacios), unit <MB|GB|%> para unidad de medida, sort <número|all> para ordenar por consumo, enable/disable para activar/desactivar control, status para ver si está activo, swap <minutos> para configurar monitoreo de swap, debug para modo debug. Muestra: Memory Total, Memory Free, Swap Total, Swap Free, Swap-in rate"},{"args":"resctrl","description":"CPU Resource Control - Desde R80.40 está integrado en la utilidad CPView. Para acceder: 1) Cambiar a contexto VS0 con vsenv, 2) Ejecutar cpview, 3) Navegar a Advanced > VSX > VSs > Physical-Resources. Muestra consumo de CPU por Virtual System y Virtual Router. La columna CPU% muestra porcentaje de CPU usado por todos los procesos de cada VS (porcentaje de single CPU como en comando top). Para obtener uso total del VSX Gateway dividir el valor entre número de CPU cores"},{"args":"showncs","description":"Muestra el Network Configuration Script (NCS) para un Virtual Device. El NCS contiene los comandos de configuración de red que se ejecutan cuando se aplica la configuración VSX. Útil para troubleshooting de problemas de configuración de interfaces, VLANs, routing y otros aspectos de red del Virtual Device. Permite ver exactamente qué comandos se ejecutarán sin aplicarlos"},{"args":"sicreset","description":"Resetea Secure Internal Communication (SIC) para el Virtual System o Virtual Router en el contexto VSX actual. SIC es el canal de comunicación cifrada entre el VS/VR y el Security Management Server. Usar cuando hay problemas de comunicación, después de cambios de certificados, o cuando el SMS no puede conectar con el VS. Requiere re-establecer trust en SmartConsole después del reset"},{"args":"stat","description":"Muestra información detallada de estado del VSX Gateway incluyendo: lista de todos los Virtual Systems y Virtual Routers configurados con sus IDs, nombres, tipo (VS/VR), estado (up/down), políticas instaladas, versión de software, interfaces asignadas, uso de recursos, y estado de conectividad con Management Server. Opciones disponibles para filtrar y formatear la salida. Comando principal para overview rápido del estado del VSX"},{"args":"unloadall","description":"Descarga (unload) las políticas de seguridad de todos los Virtual Systems y Virtual Routers del VSX Gateway. Esto detiene el enforcement de políticas en todos los VS/VR pero no los elimina del sistema. ADVERTENCIA: Comando de alto impacto - todo el tráfico será permitido (o bloqueado según configuración por defecto) hasta que se reinstalen las políticas. Útil para troubleshooting o antes de mantenimiento mayor"},{"args":"vspurge","description":"Limpia entradas no utilizadas de Virtual Devices y obtiene archivos de configuración actualizados. Elimina configuraciones de VSs que fueron borrados del Management Server pero cuyas entradas permanecen en local.vskeep del gateway. Ejecuta operación de purge y luego fetch para sincronizar. Útil después de eliminar Virtual Systems para liberar recursos y mantener configuración limpia. Operación segura que solo afecta VSs ya eliminados"}]','vsx','R81+','vsx, virtual system, virtual router, configuración, fetch, policy, memoria, cpu, sic, gateway, multi-tenant, virtualización','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:44:08','2025-12-31 11:44:08');
INSERT INTO checkpoint_commands VALUES(8,'vsenv','Cambia el contexto del shell actual a un Virtual System o Virtual Device específico en un VSX Gateway. Una vez ejecutado, todos los comandos subsecuentes se ejecutarán en el contexto del Virtual System seleccionado, permitiendo administrar, configurar y troubleshoot ese VS de forma aislada. El prompt del shell cambia para indicar el VSID actual. Es fundamental usar vsenv antes de ejecutar comandos específicos de un VS para evitar hacer cambios en el VS equivocado. Para ver la lista de Virtual Devices disponibles, usar el comando ''vsx stat -v''. En plataformas escalables (Maestro y Chassis) debe ejecutarse en el Security Group apropiado.','[{"args":"(sin argumentos)","description":"Cambia el contexto del shell al Virtual Device 0 (VS0), que es el Virtual System por defecto y representa el VSX Gateway principal. VS0 tiene acceso administrativo completo al VSX Gateway y es el contexto desde donde se gestionan todos los demás Virtual Systems"},{"args":"<VSID>","description":"Cambia el contexto del shell a un Virtual System específico identificado por su ID numérico (VSID). Por ejemplo: vsenv 1, vsenv 2, vsenv 3. Una vez en el contexto de un VS específico, todos los comandos subsecuentes se ejecutarán en ese Virtual System, incluyendo comandos de red, firewall, routing, etc. El prompt cambiará para mostrar el VSID actual"},{"args":"<Nombre Virtual Device>","description":"Cambia el contexto del shell a un Virtual System específico identificado por su nombre configurado en SmartConsole. Por ejemplo: vsenv VS-DMZ, vsenv VS-Internet. Más intuitivo que usar VSID cuando se trabaja con muchos Virtual Systems. El nombre debe coincidir exactamente con el configurado en el Management Server"}]','vsx','R81+','vsx, vsenv, virtual system, contexto, cambiar contexto, vsid, virtual device, administración, multi-tenant','expert','utility','firewall',1,'low','[]',0,'2025-12-31 11:44:31','2025-12-31 11:44:31');
INSERT INTO checkpoint_commands VALUES(9,'vsx_util','Utilidad de mantenimiento y configuración avanzada para VSX ejecutada desde el Management Server (Security Management Server o Multi-Domain Server). Permite realizar tareas de administración del VSX Gateway y VSX Cluster que no están disponibles en SmartConsole, incluyendo: añadir/remover miembros del cluster, cambiar IPs de gestión y redes internas, reemplazar interfaces, convertir entre modos HA y VSLS, actualizar/downgrade versiones en la base de datos, restaurar configuración, y gestionar distribución de Virtual Systems. CRÍTICO: Siempre hacer backup antes de ejecutar (sk100395) y cerrar todos los SmartConsole para evitar database lock errors. Comandos son interactivos y requieren autenticación del Management Server.','[{"args":"add_member","description":"Añade un nuevo miembro a un VSX Cluster existente y envía (push) la configuración completa del cluster al nuevo miembro. Solicita: nombre del VSX Cluster, nombre del nuevo miembro, IP de gestión, IP de sincronización y Activation Key (SIC). Después de añadir el miembro a la base de datos del Management Server, ofrece reconfigurarlo automáticamente. IMPORTANTE: Hacer backup antes de ejecutar y cerrar todos los SmartConsole abiertos para evitar database lock"},{"args":"remove_member","description":"Elimina un miembro de un VSX Cluster. Remueve el miembro de la base de datos del Management Server pero no desinstala el software del hardware físico. Útil para reemplazar hardware dañado o reducir tamaño del cluster. IMPORTANTE: Hacer backup antes de ejecutar y cerrar SmartConsole para evitar database lock"},{"args":"change_interfaces","description":"Reemplaza automáticamente interfaces existentes con nuevas interfaces en todos los Virtual Devices que usan esas interfaces. Solicita qué interfaces reemplazar y con cuáles. Actualiza configuración en todos los VSs/VRs afectados. Útil cuando se cambia hardware de red o se reorganizan interfaces físicas. Requiere nombre del VSX Gateway/Cluster"},{"args":"show_interfaces","description":"Muestra configuración de interfaces seleccionadas incluyendo: tipos de interface, conexiones a Virtual Devices, direcciones IP asignadas, VLANs configuradas. Vista consolidada de cómo están distribuidas las interfaces entre los Virtual Systems. Útil para documentación y troubleshooting de configuración de red"},{"args":"change_mgmt_ip","description":"Cambia la dirección IP de gestión de un VSX Gateway o miembro de VSX Cluster DENTRO DE LA MISMA SUBNET. Solo modifica la IP manteniendo la subnet actual. Actualiza configuración en Management Server y en el gateway. Para cambiar a diferente subnet usar change_mgmt_subnet. Requiere nombre del VSX object y opcionalmente nombre del miembro si es cluster"},{"args":"change_mgmt_subnet","description":"Cambia la dirección IP de gestión de un VSX Gateway o miembro de VSX Cluster a una SUBNET DIFERENTE. Permite cambiar tanto IP como subnet/máscara. Más completo que change_mgmt_ip. Actualiza toda la configuración de red de gestión. También puede añadir IP de gestión si no existía previamente"},{"args":"change_private_net","description":"Cambia la dirección IP de la red de comunicación interna (Internal Communication Network) en un VSX Cluster. Esta red se usa para comunicación entre miembros del cluster. Actualiza IPs de sincronización en todos los miembros del cluster. Requiere nombre del VSX Cluster. Operación crítica que puede afectar comunicación del cluster"},{"args":"convert_cluster","description":"Convierte el modo de operación de un VSX Cluster entre High Availability (HA, modo por defecto) y Virtual System Load Sharing (VSLS). HA: solo un miembro activo a la vez. VSLS: múltiples miembros activos simultáneamente con Virtual Systems distribuidos. ADVERTENCIA: Operación mayor que requiere planificación, puede requerir reinstalación de políticas"},{"args":"upgrade","description":"Actualiza la versión de un VSX Gateway o VSX Cluster en la base de datos del Management Server. NO realiza la actualización de software en el hardware, solo actualiza la metadata en la base de datos para reflejar que el gateway fue actualizado. Ejecutar DESPUÉS de actualizar el software en el gateway físico. Permite al Management Server comunicarse correctamente con la nueva versión"},{"args":"downgrade","description":"Regresa la versión de un VSX Gateway o VSX Cluster a una versión anterior en la base de datos del Management Server. NO realiza el downgrade de software en el hardware, solo actualiza la metadata en la base de datos. Ejecutar DESPUÉS de hacer downgrade del software en el gateway físico. Útil si una actualización falló y fue necesario regresar a versión anterior"},{"args":"reconfigure","description":"Restaura la configuración VSX en un VSX Gateway o miembro de VSX Cluster reenviando toda la configuración desde el Management Server al gateway. Útil cuando: configuración local está corrupta, después de reinstalar OS, cuando fetch no funciona correctamente, o para forzar resincronización completa. Operación que puede tomar tiempo según cantidad de Virtual Systems"},{"args":"view_vs_conf","description":"Muestra y compara la configuración de un Virtual Device entre el Management Server y el VSX Gateway/Cluster. Permite identificar discrepancias entre la configuración teórica (en SMS) y la real (en gateway). Útil para troubleshooting cuando fetch no sincroniza correctamente o para auditoría de configuración. Requiere nombre del VSX object y nombre del Virtual Device"},{"args":"vsls","description":"Muestra menú de configuración interactivo para Virtual System Load Sharing (VSLS). Opciones del menú: ver status de VSLS, redistribuir Virtual Systems entre miembros del cluster, exportar configuración VSLS a archivo, importar configuración VSLS desde archivo. Solo aplicable a VSX Clusters en modo VSLS. Herramienta para balance y migración de VSs entre miembros"}]','vsx','R81+','vsx_util, vsx, management server, cluster, configuración, mantenimiento, vsls, high availability, miembros, interfaces, upgrade, backup','expert','config','management',0,'critical','[]',0,'2025-12-31 11:45:37','2025-12-31 11:45:37');
INSERT INTO checkpoint_commands VALUES(10,'cpconfig','Herramienta interactiva de configuración de CheckPoint que presenta un menú con opciones para configurar aspectos fundamentales del sistema. Permite gestionar licencias, configurar Secure Internal Communication (SIC) con el Management Server, habilitar/deshabilitar membresía en cluster, activar Virtual System Load Sharing (VSLS) en VSX, configurar ClusterXL para modo bridge, ajustar CoreXL y controlar inicio automático de productos CheckPoint. Las opciones mostradas varían según productos instalados y configuración actual. Muchas opciones requieren reinicio del gateway para aplicarse. En entornos de cluster es CRÍTICO configurar todos los miembros de manera idéntica para evitar inconsistencias.','[{"args":"(menú interactivo)","description":"Herramienta de configuración interactiva con menú que presenta opciones según productos instalados. Opciones principales: 1) Licenses and contracts - Gestionar licencias CheckPoint, 2) Secure Internal Communication (SIC) - Configurar/resetear SIC con Management Server, 3) Enable/Disable cluster membership - Activar o desactivar membresía en cluster (requiere reinicio), 4) Enable/Disable Per Virtual System State (VSLS) - Activar o desactivar Virtual System Load Sharing en VSX Cluster (requiere reinicio), 5) Enable/Disable ClusterXL for Bridge - Configurar ClusterXL en modo bridge, 6) Check Point CoreXL - Configurar número de instancias CoreXL (requiere reinicio), 7) Automatic start of Check Point Products - Controlar qué productos inician automáticamente al boot. IMPORTANTE: En clusters, configurar todos los miembros idénticamente"}]','vsx','R81+','cpconfig, configuración, licencias, sic, cluster, vsls, corexl, bridge mode, interactivo, setup','expert','config','firewall',0,'high','[]',0,'2025-12-31 11:45:55','2025-12-31 11:45:55');
INSERT INTO checkpoint_commands VALUES(11,'fwaccel','Comando principal para control y administración de SecureXL, el motor de aceleración de tráfico IPv4 en CheckPoint que mejora dramáticamente el rendimiento del firewall procesando conexiones establecidas en el kernel sin pasar por el firewall inspector. Permite activar/desactivar la aceleración, configurar parámetros de rendimiento, monitorear conexiones aceleradas, gestionar estadísticas, controlar protecciones DoS y SYN Defender, configurar debugging, administrar templates de conexiones y visualizar tablas internas. SecureXL acelera tráfico HTTP, HTTPS, SSH, DNS y otros protocolos una vez que la primera conexión es inspeccionada y aprobada por el firewall.','[{"args":"stat","description":"Muestra el estado actual de SecureXL incluyendo: si está habilitado (enabled) o deshabilitado (disabled), número de instancias SecureXL activas, cantidad de conexiones aceleradas vs no aceleradas, templates activos, protecciones activas (IPS, Application Control, URL Filtering), estado de funcionalidades específicas y path de paquetes (accelerated, F2Fed to firewall). Comando principal para verificar salud y operación de SecureXL. Opciones: -s para resumen corto, -p para mostrar por instancia SecureXL en entornos multi-core"},{"args":"stats","description":"Muestra estadísticas detalladas de aceleración incluyendo: paquetes acelerados vs no acelerados, throughput en pps y Mbps, drop counters por razón (policy drop, connection drop, SYN Defender drops), conexiones por segundo creadas/eliminadas, hits en templates, errores de fragmentación, estadísticas de NAT acelerado, contadores de VPN offload. Usar -s para mostrar delta desde última ejecución. Crítico para troubleshooting de performance y entender por qué tráfico no se acelera"},{"args":"conns","description":"Lista todas las conexiones procesadas por SecureXL con detalles: IPs origen/destino, puertos, protocolo, interfaces, flags de estado (F=forwarded to FW, acelerada, encriptada VPN, con NAT, con QoS, unidireccional/bidireccional), identidad de usuario, instancia SecureXL. Opciones: -f <filtros> para filtrar por tipo conexión (A=con accounting, C=VPN encriptada, N=con NAT, Q=con QoS, U=unidireccional), -s para resumen de total conexiones, -m <número> para limitar cantidad mostrada. ADVERTENCIA: Con muchas conexiones consume mucha memoria y CPU (sk118716)"},{"args":"on","description":"Activa la aceleración SecureXL on-the-fly (al vuelo) si fue previamente deshabilitada. El cambio es temporal y NO sobrevive reinicio. Todas las conexiones existentes se re-evalúan y las que califiquen comienzan a acelerarse. Útil para reactivar después de troubleshooting o testing. Para cambio permanente modificar $FWDIR/boot/modules/fwkern.conf y reiniciar"},{"args":"off","description":"Desactiva la aceleración SecureXL on-the-fly forzando todo el tráfico a pasar por el firewall inspector tradicional. El cambio es temporal y NO sobrevive reinicio. Reduce dramáticamente el throughput pero permite troubleshooting detallado, análisis de paquetes completo y verificar si un problema es causado por SecureXL. Las conexiones aceleradas se transfieren al firewall. Opciones: -s para estadísticas finales antes de desactivar"},{"args":"templates","description":"Muestra los templates (plantillas) de conexión generados por SecureXL. Cada template representa un patrón de tráfico permitido que puede acelerarse sin inspección completa. Incluye: direcciones IP, puertos, protocolo, acción (accept/drop), interfaces, información NAT, referencias a rules del policy. Templates se crean después de que el firewall inspecciona primera conexión. Ver templates ayuda entender qué tráfico se acelera y troubleshoot por qué cierto tráfico no se acelera"},{"args":"dos","description":"Controla Rate Limiting para mitigación DoS en SecureXL. Permite configurar límites de paquetes por segundo (pps) para diferentes tipos de tráfico problemático: SYN floods, UDP floods, ICMP floods, IP fragments. Opciones: -s para mostrar configuración actual y estadísticas de drops por rate limiting, -p <protocolo> para configurar límites específicos. En VSX debe ejecutarse en contexto del Virtual System apropiado. Protege el gateway de ataques de volumen sin afectar tráfico legítimo"},{"args":"synatk","description":"Controla Accelerated SYN Defender, protección contra ataques SYN flood que opera en SecureXL. Monitorea rate de conexiones TCP por destino y activa protección cuando excede threshold configurado. Opciones: stat para ver estado y estadísticas actuales, config para modificar parámetros (threshold, timeout, aggressive mode), clear para resetear estadísticas. Más eficiente que SYN Defender tradicional del firewall porque opera en kernel. Solo protege tráfico que pasa por SecureXL"},{"args":"cfg","description":"Configura parámetros internos de aceleración SecureXL (solo IPv4). Opciones: -a <interface> para excluir interface específica de aceleración, -a reset para acelerar todas las interfaces, -c <número> para límite máximo de conexiones antes de deshabilitar templates, -l <número> para límite máximo de entries en templates database, -m <segundos> para timeout de entries en templates, -p on/off para offload de templates, -i on/off para ignorar API version mismatch. IMPORTANTE: Cambios NO sobreviven reinicio y deben configurarse en todos los miembros del cluster idénticamente"},{"args":"feature","description":"Habilita o deshabilita funcionalidades específicas de SecureXL on-the-fly. Permite control granular de qué características están activas: sync de conexiones en cluster, streaming signatures de IPS, specific features como GTP inspection, urlf (URL Filtering), appi (Application Identification). Sintaxis: -s <feature> on/off para activar/desactivar. Útil para troubleshooting - deshabilitar feature específica para verificar si causa problema. Cambios temporales que NO sobreviven reinicio"},{"args":"dbg","description":"Controla debug de SecureXL para troubleshooting avanzado. Permite activar flags de debug por módulo (default, pkt, vpn, api, db, tmpl, dos, synatk, etc.). Sintaxis: -m <módulo> + <flags> para activar, - <flags> para desactivar, all para activar todos, reset para resetear, list para ver flags activos. Opción -f para filtrar debug por 5-tuple específico (src IP, src port, dst IP, dst port, protocol). Debug genera logs en /var/log/messages. CRÍTICO para diagnosticar por qué conexiones no se aceleran o troubleshoot drops"},{"args":"ranges","description":"Muestra los rangos de direcciones IP cargados en SecureXL que afectan decisiones de aceleración. Incluye: rangos de direcciones para objetos de red, rangos NAT, rangos para VPN domains. SecureXL usa estos rangos para determinar rápidamente si paquete requiere procesamiento especial. Útil para troubleshooting cuando ciertos destinos no se aceleran correctamente o verificar que configuración de network objects se aplicó en SecureXL"},{"args":"tab","description":"Muestra contenido de tablas internas de SecureXL para troubleshooting profundo. Opciones: -t <tabla> para especificar tabla a mostrar. Tablas disponibles incluyen connection table, templates table, dynamic objects table, NAT table, etc. Salida muy técnica con información raw del kernel. Principalmente usado por CheckPoint Support o para debugging muy avanzado de problemas de aceleración o corrupción de tablas"},{"args":"ver","description":"Muestra versión de SecureXL instalada y versión del Firewall. Incluye: build number de SecureXL, versión del kernel SecureXL, versión de CheckPoint Firewall, compatibilidad de API. Útil para verificar versión antes de aplicar hotfixes, comparar versiones entre miembros de cluster, o cuando se reporta bug relacionado con SecureXL a CheckPoint Support"}]','securexl','R81+','securexl, aceleración, performance, rendimiento, templates, conexiones, dos, syn defender, throughput, offload, kernel','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:54:55','2025-12-31 11:54:55');
INSERT INTO checkpoint_commands VALUES(12,'pdp','Comando principal para control y monitoreo del proceso pdpd (Policy Decision Point) en Identity Awareness. El PDP es el Security Gateway responsable de recolectar y compartir identidades de usuarios y computadoras. Permite monitorear sesiones activas, configurar autenticación y autorización, gestionar Identity Brokers para compartir identidades entre gateways, controlar Identity Collectors, manejar RADIUS accounting, gestionar roles de acceso, configurar nested groups de LDAP, actualizar membresías de grupos, y realizar debugging avanzado. Es componente clave del sistema Identity Awareness que controla acceso de usuarios y protección de red basada en identidad.','[{"args":"monitor","description":"Monitorea el estado de sesiones conectadas al PDP con múltiples filtros disponibles: por IP, usuario, computadora, grupos, tipo de cliente (AD Query, Identity Agent, portal, unknown), versión de cliente, roles, redes, managed assets. Permite ver si sesión fue publicada a PEP gateways. Opciones: all (todas las sesiones), summary (resumen), ip <IP> (por dirección), user <nombre> (por usuario), machine <nombre> (por computadora), groups <grupo> (por grupo), client_type (por tipo autenticación), cv_ge/cv_le (por versión cliente)"},{"args":"debug","description":"Controla debug del PDP en archivo $FWDIR/log/pdpd.elg. Opciones: on/off para activar/desactivar, set <topic> <severity> para filtrar (topics: all o específicos de Support; severities: all, critical, events, important, surprise), reset para resetear opciones, rotate para rotar logs, stat para ver estado actual, spaces <0-5> para indentación, memory para ver consumo memoria, ccc on/off para logs CCC. IMPORTANTE: debug afecta performance del daemon pdpd, desactivar después de troubleshooting. Best practice: pdp debug set all all"},{"args":"control","description":"Provee comandos de control del PDP. Opciones: revoke_ip <IP> para hacer logout de sesión asociada a IP específica, sync para forzar sincronización iniciada entre PDPs y PEPs asegurando que todos tengan información actualizada de sesiones conectadas. Al ejecutar sync, PDP informa a PEPs relacionados sobre información actualizada de todas las sesiones, resultando en que PDP y PEPs contengan la misma información de sesión más reciente"},{"args":"status","description":"Muestra información de estado del PDP incluyendo: hora de inicio (start time), hora de última configuración (configuration time) y otros datos de estado relevantes del proceso pdpd. Útil para verificar cuándo fue iniciado el servicio y cuándo se aplicó la última configuración"},{"args":"connections","description":"Muestra conexiones del PDP con: PEP gateways (Policy Enforcement Points), Terminal Servers y Identity Collectors. Opciones: pep (muestra estado de conexión de todos los PEPs que el PDP actual debe actualizar), ts (lista de Terminal Servers conectados), idc (lista de Identity Collectors conectados). Útil para troubleshooting de problemas de comunicación entre componentes de Identity Awareness"},{"args":"broker","description":"Controla PDP Identity Broker que gestiona compartición de identidades entre PDPs Publisher y Subscriber. Opciones: debug set/unset para logs de Publishers/Subscribers/transporte, discard para timeout de descarte de sesiones durante desconexión, reconnect para forzar reconexión inmediata a Subscriber ignorando keep-alive, status para ver estado de PDPs remotos con -e para info extendida, sync para sincronizar identidades con Publishers/Subscribers o programar sincronización schedule. Crítico para ambientes distribuidos multi-gateway"}]','identity_awareness','R81+','pdp, identity awareness, autenticación, usuarios, sesiones, active directory, ldap, radius, identity collector, roles, grupos, monitoring','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:59:22','2025-12-31 11:59:22');
INSERT INTO checkpoint_commands VALUES(13,'pep','Comando para control y monitoreo del proceso pepd (Policy Enforcement Point) en Identity Awareness. El PEP es el Security Gateway responsable de hacer cumplir (enforce) restricciones de acceso de red basándose en datos de identidad que recolecta del PDP. Permite visualizar sesiones conocidas por el PEP, verificar comunicación con PDPs, consultar estado de publicación de identidades, troubleshoot problemas de conciliación de sesiones, configurar almacenamiento de información extendida y gestionar tareas del proceso. El PEP toma decisiones de enforcement basadas en identity data del PDP y es componente fundamental para aplicar políticas de seguridad basadas en usuario.','[{"args":"show","description":"Muestra información sobre PEP incluyendo: sesiones que PEP conoce con filtros múltiples (user query permite filtrar por cid/cmp/mchn/mgrp/pdp/role/ugrp/uid/usr usando AND lógico entre filtros), estado de conciliación de sesiones (conciliation_clashes con opciones all/clear/ip), información de red (network con pdp/registration), canal de comunicación PEP-PDP (pdp con all/id), tiempo de inicio de daemon pepd y última recepción de policy (stat), topología de direcciones PDP y PEP (topology_map). Comando principal para troubleshooting de Identity Awareness en gateway enforcement"},{"args":"debug","description":"Controla debug del PEP en archivo $FWDIR/log/pepd.elg. Opciones: on/off para activar/desactivar, set <topic> <severity> para filtrar logs (topics: all o específicos de Support; severities: all, critical, events, important, surprise), reset para resetear configuración debug, rotate para rotar archivos log incrementando índice (pepd.elg -> pepd.elg.0 -> pepd.elg.1), stat para mostrar estado debug actual, spaces 0-5 para indentación en logs, memory para mostrar consumo memoria del daemon pepd. IMPORTANTE: debug afecta performance, desactivar tras troubleshooting. Best practice: pep debug set all all"},{"args":"control","description":"Provee comandos de control del PEP. Opciones: extended_info_storage enable/disable controla si PEP almacena información extendida de identidades para debug, portal_dual_stack enable/disable controla soporte para portal dual stack IPv4 e IPv6, tasks_manager status muestra estado de tareas PEP (running, previous, pending). Útil para configuración y monitoreo operacional del Policy Enforcement Point"},{"args":"tracker","description":"Durante debug de PEP, añade el tópico de debug TRACKER a los logs PEP (habilitado por defecto). Muy útil para monitorear compartición de identidades PDP-a-PEP y otra comunicación en ambientes distribuidos. Opciones: on para habilitar logging de eventos TRACKER en log PEP, off para deshabilitar logging de eventos TRACKER. Se puede configurar manualmente añadiendo tópico TRACKER al debug PEP. Crítico para troubleshooting de sincronización de identidades en arquitecturas multi-gateway"}]','identity_awareness','R81+','pep, identity awareness, enforcement, policy, sesiones, usuarios, pdp, sincronización, identidades, debugging','expert','query','firewall',1,'medium','[]',0,'2025-12-31 11:59:52','2025-12-31 11:59:52');
INSERT INTO checkpoint_commands VALUES(14,'adlog','Comando para control y monitoreo del proceso ADLOG responsable de adquisición de identidades de usuarios y computadoras desde Active Directory. El adlog corre en Security Gateway cuando AD Query está habilitado (sirve a Identity Awareness blade que hace enforcement y logging de identidades) o en Log Server para logging de identidades. Permite controlar estados de usuarios, consultar base de datos de identidades capturadas, gestionar Multi-User Hosts, administrar service accounts, verificar conectividad con domain controllers, troubleshoot mediante debug y obtener estadísticas de eventos procesados. Herramienta fundamental para monitoreo y troubleshooting de adquisición de identidades basada en Active Directory.','[{"args":"control","description":"Envía comandos de control al AD Query. Opciones: muh (gestiona Multi-User Hosts con show/mark/unmark para IPs), reconf (reconfigura AD Query reseteando configuración de policy a la definida en SmartConsole), srv_accounts (gestiona service accounts que son cuentas de servicios no usuarios reales, con show/clear/find/unmark; service accounts son sospechosos si login más de cierto número de veces), stop (detiene AD Query y gateway deja de adquirir identidades). Crítico para administración operacional de adquisición de identidades desde Active Directory"},{"args":"dc","description":"Muestra estado de conexión al domain controller de Active Directory. Permite verificar conectividad entre Security Gateway y AD DC. Sintaxis: adlog a dc (cuando adlog corre en Security Gateway para Identity Awareness) o adlog l dc (cuando adlog corre en Log Server para Identity Logging). Útil para troubleshooting rápido de problemas de comunicación con Active Directory"},{"args":"debug","description":"Habilita y deshabilita salida de debug del adlog. Output de debug va a: $FWDIR/log/pdpd.elg (Identity Awareness en Security Gateway) o $FWDIR/log/fwd.elg (Identity Logging en Log Server). Opciones: on activa debug, off desactiva debug, mode muestra estado actual (on/off), extended activa debug con tópicos extendidos adicionales. Crítico para troubleshooting de problemas de adquisición de identidades desde eventos de Active Directory"},{"args":"query","description":"Muestra base de datos de identidades adquiridas por AD Query según filtro especificado. Permite consultar identidades capturadas desde Active Directory. Opciones: all (sin filtro, muestra base completa), ip <IP> (filtra identidades relacionadas a IP específica), machine <nombre> (filtra por nombre computadora), string <texto> (filtra por cadena texto), user <username> (filtra por usuario específico). Fundamental para verificar qué identidades ha capturado el gateway y troubleshoot problemas de mapeo IP-usuario"},{"args":"statistics","description":"Muestra estadísticas sobre NT Event logs recibidos por adlog para cada dirección IP y total general. También muestra número de direcciones IP identificadas. Permite entender volumen de eventos procesados desde Active Directory y cuántas IPs únicas tienen identidades asignadas. Útil para monitoreo de salud del AD Query y capacidad de procesamiento de eventos"}]','identity_awareness','R81+','adlog, ad query, active directory, identidades, usuarios, domain controller, eventos, multi-user hosts, service accounts, logging','expert','query','firewall',1,'medium','[]',0,'2025-12-31 12:00:22','2025-12-31 12:00:22');
INSERT INTO checkpoint_commands VALUES(15,'test_ad_connectivity','Utilidad para ejecutar pruebas de conectividad desde Security Gateway hacia domain controller de Active Directory. Verifica conectividad LDAP (Lightweight Directory Access Protocol) y WMI (Windows Management Instrumentation) que son protocolos esenciales para Identity Awareness. Permite diagnosticar problemas de comunicación con AD antes de configurar Identity Awareness. Soporta IPv4 e IPv6, LDAP y LDAPS (SSL), configuración de timeouts, y testing selectivo de solo LDAP o solo WMI. Parámetros pueden especificarse en línea de comandos o en archivo de configuración $FWDIR/conf/test_ad_connectivity.conf. Salida se guarda en archivo especificado en $FWDIR/tmp/ y también genera log en $FWDIR/log/test_ad_connectivity.elg. Crítico para troubleshooting de prerequisitos de Identity Awareness.','[{"args":"-i <IP> -d <domain> -u <user> -c <password> -o <output>","description":"Ejecuta pruebas de conectividad LDAP y WMI desde Security Gateway hacia domain controller de AD especificado por IPv4. Parámetros obligatorios: -i IP del DC, -d nombre dominio AD, -u username administrador AD, password (con -c texto claro, -p ofuscado o -a prompt), -o nombre archivo salida en $FWDIR/tmp/. Opcionales: -b LDAP search base, -D user DN, -f AD fingerprint para LDAPS, -l solo test LDAP, -w solo test WMI, -s LDAP sobre SSL, -r puerto (389 LDAP/636 LDAPS), -L timeout LDAP, -t timeout total. Salida muestra status: SUCCESS_LDAP_WMI, LDAP_SUCCESS, WMI_SUCCESS con timestamp"},{"args":"-I <IPv6> -d <domain> -u <user> -c <password> -o <output>","description":"Ejecuta pruebas de conectividad LDAP y WMI desde Security Gateway hacia domain controller de AD especificado por IPv6. Funcionalidad idéntica a versión IPv4 pero usando dirección IPv6 del domain controller. Parámetros y opciones iguales excepto -I en lugar de -i. Permite testing de conectividad AD en ambientes dual-stack o IPv6-only"},{"args":"-h","description":"Muestra ayuda integrada del comando mostrando sintaxis, parámetros disponibles y ejemplos de uso. Útil para referencia rápida de opciones sin consultar documentación"}]','identity_awareness','R81+','test_ad_connectivity, active directory, ldap, wmi, conectividad, domain controller, troubleshooting, identity awareness, testing','expert','utility','firewall',0,'low','[]',0,'2025-12-31 12:00:46','2025-12-31 12:00:46');
INSERT INTO checkpoint_commands VALUES(16,'vpn','Comando principal para gestión y diagnóstico de VPN en CheckPoint. Permite configurar y monitorear túneles VPN Site-to-Site y Remote Access, controlar procesos VPN (vpnd daemon), gestionar certificados y CRLs, habilitar debugging de IKE y VPND, visualizar Security Associations (SAs) tanto IKE como IPsec, controlar compresión/descompresión, gestionar topologías VPN, trabajar con DNS Lookup Layer y Route Lookup Layer, y administrar clientes SSL Network Extender. Es la herramienta central para troubleshooting de conectividad VPN, análisis de negociaciones fallidas y verificación de estado de túneles.','[{"args":"check_ttm <Path to TTM file>","description":"Valida la sintaxis de un archivo TTM (Topology Trans Template) especificado. Útil para verificar archivos de topología VPN antes de aplicarlos. Retorna si el archivo pasó la verificación o muestra errores de sintaxis."},{"args":"compreset","description":"Reinicia a cero todos los contadores estadísticos de compresión y descompresión de túneles VPN. Útil antes de iniciar pruebas de rendimiento para obtener métricas limpias."},{"args":"compstat","description":"Muestra estadísticas completas de compresión/descompresión incluyendo: bytes antes y después de comprimir, overhead de compresión, paquetes comprimidos vs no comprimidos, errores de compresión/descompresión, ratio de compresión puro y efectivo. Esencial para analizar eficiencia de compresión en túneles VPN."},{"args":"crl_zap","description":"Borra todas las Certificate Revocation Lists (CRLs) almacenadas en caché. Útil cuando se sospecha que CRLs obsoletas están causando problemas de validación de certificados. Retorna 0 si exitoso."},{"args":"crlview [-d] -obj <Network Object Name> -cert <Certificate Object Name>","description":"Recupera y muestra CRL desde puntos de distribución (LDAP/HTTP). Opción -d para debug mode. Puede especificar CA mediante -obj y certificado mediante -cert, o usar -f para archivo local. Opción -view muestra CRL previamente recuperada. Retorna 0 si exitoso."},{"args":"crlview -f <Certificate File>","description":"Recupera CRL desde archivo de certificado especificado. Extrae distribution point del certificado, recupera CRL y la muestra en stdout."},{"args":"crlview -view","description":"Muestra contenido de CRL previamente recuperada desde caché sin contactar distribution points."},{"args":"debug on [<Debug_Topic>=<Debug_Level>]","description":"Activa debug de alto nivel del daemon VPN (vpnd). La información se escribe en $FWDIR/log/vpnd.elg*. Puede especificar tópicos y niveles específicos (1-5) proporcionados por Check Point Support. Best practice: usar vpn debug trunc ALL=5 para inicio completo."},{"args":"debug off","description":"Desactiva completamente el debug de VPN. Best practice para detener debug: vpn debug off o vpn debug truncoff."},{"args":"debug ikeon [-s <Size_in_MB>]","description":"Activa debug de IKE. Información se escribe en $FWDIR/log/ike.elg*. Permite especificar tamaño del archivo para rotación de logs. Útil para troubleshooting de negociaciones IKE Phase 1 y Phase 2."},{"args":"debug ikeoff","description":"Desactiva el debug de IKE. Command: vpn debug ikeoff."},{"args":"debug trunc [<Debug_Topic>=<Debug_Level>]","description":"Realiza 4 acciones: 1) Rota archivo vpnd.elg, 2) Trunca archivo ike.elg, 3) Inicia debug de VPND daemon, 4) Inicia debug de IKE. Best practice: vpn debug trunc ALL=5 para debugging completo desde inicio limpio."},{"args":"debug truncon [<Debug_Topic>=<Debug_Level>]","description":"Alias de debug trunc. Realiza mismas 4 acciones: rotación vpnd.elg, truncar ike.elg, iniciar VPND debug e IKE debug."},{"args":"debug truncoff","description":"Detiene el debug del daemon VPND. Alternativas: vpn debug truncoff o vpn debug off."},{"args":"debug timeon [<Seconds>]","description":"Habilita timestamps en logs de debug, imprimiendo uno cada N segundos (default 10). Útil para correlacionar eventos temporalmente durante troubleshooting."},{"args":"debug timeoff","description":"Deshabilita los timestamps periódicos en archivos de log de debug."},{"args":"debug ikefail [-s <Size_in_MB>]","description":"Activa logging específico de negociaciones IKE fallidas. Permite especificar tamaño de archivo ike.elg para rotación. Enfocado solo en fallos para reducir ruido en logs."},{"args":"debug mon","description":"Habilita IKE Monitor que captura paquetes IKE en formato snoop en $FWDIR/log/ikemonitor.snoop. WARNING: archivo puede contener contraseñas X-Auth en texto claro, proteger adecuadamente."},{"args":"debug moff","description":"Deshabilita el IKE Monitor y detiene la captura de paquetes."},{"args":"debug say \"String\"","description":"Inserta un string personalizado (máx 255 caracteres) en archivo vpnd.elg. Útil para marcar eventos durante troubleshooting. Ejemplo: vpn debug say BEGIN TEST. Requiere debug activo previamente."},{"args":"debug tunnel [<Debug_Level>]","description":"Versión especializada de debug que: 1) Rota vpnd.elg, 2) Trunca ike.elg, 3) Activa debug con tópicos tunnel e ikev2, 4) Si nivel es 2-5 también activa CRLCache, 5) Inicia debug IKE. Optimizado para troubleshooting de túneles."},{"args":"dll dump <File>","description":"Guarda información del DNS Lookup Layer (nombres DNS y direcciones IP) en archivo especificado. Útil para diagnosticar resolución DNS en contexto VPN."},{"args":"dll resolve <HostName>","description":"Resuelve hostname especificado usando DNS Lookup Layer. Guarda último hostname en $FWDIR/tmp/vpnd_cmd.tmp. Útil para verificar resolución DNS desde perspectiva VPN."},{"args":"drv off","description":"Detiene el módulo kernel de VPN. PRECAUCIÓN: esto desactiva todo el procesamiento VPN en el firewall."},{"args":"drv on","description":"Inicia el módulo kernel de VPN. Necesario para que VPN funcione."},{"args":"drv stat","description":"Muestra estado actual del módulo kernel VPN (activo o inactivo). Ejemplo output: VPN-1 module active."},{"args":"dump_psk","description":"Muestra hash SHA256 de las pre-shared-keys de los peers configurados. No muestra las PSKs en texto claro, solo sus hashes para verificación."},{"args":"ipafile_check <File> [{err | warn | detail}] [verify_group_names]","description":"Verifica archivo candidato para $FWDIR/conf/ipassignment.conf (asignación de IPs en Office Mode). Niveles: err=solo errores, warn=advertencias, detail=todos los detalles. Opción verify_group_names examina nombres de grupos."},{"args":"ipafile_users_capacity get","description":"Muestra capacidad actual configurada en ipassignment.conf (cantidad de usuarios que pueden tener IP assignments). Default: 1024 entradas."},{"args":"ipafile_users_capacity set <128-32768>","description":"Configura nueva capacidad de usuarios para ipassignment.conf. Rango: 128-32768. Configura cantidad de memoria reservada para almacenar usernames en Office Mode."},{"args":"macutil <username>","description":"Genera y muestra dirección MAC asociada a username en Remote Access VPN con Office Mode usando DHCP. La IP asignada se mapea a esta MAC generada. Formato output: MAC-ADDRESS, username."},{"args":"mep_refresh","description":"Inicia re-decisión de MEP (Multi Entry Point). Usado en configuración backup stickiness para intentar failback al Security Gateway primario si está disponible."},{"args":"neo_proto {off | on}","description":"Controla protocolo de cliente NEO. IMPORTANTE: Este comando es solo para uso interno de Check Point. Off=deshabilita, On=habilita."},{"args":"nssm_topology -url <url> -dn <dn> -name <name> -pass <password> [-action {bypass | drop}] [-print_xml]","description":"Genera y sube topología en formato NSSM a servidor NSSM. Parámetros: URL del servidor, Distinguished Name SSL, credenciales. Action define comportamiento del cliente Symbian para tráfico fuera de VPN domain (default: bypass). -print_xml escribe topología a archivo XML."},{"args":"overlap_encdom [communities | traditional]","description":"Muestra todos los dominios de encriptación VPN que se solapan. Alerta si: mismo VPN domain en múltiples gateways, o interfaces con misma IP/netmask. communities=solo solapamientos dentro de misma VPN community o entre communities. traditional=todos los solapamientos (default)."},{"args":"rim_cleanup","description":"Limpia rutas RIM (Route Injection Module). Útil para resolver problemas de enrutamiento relacionados con VPN."},{"args":"rll dump <File>","description":"Guarda información del Route Lookup Layer a archivo: ISP Redundancy Default Routes (Next Hop, Interface, Metric), Route Shadow (Interface, Metric, IP/Mask, Next Hop), Monitored IP Addresses. Útil para troubleshooting de enrutamiento VPN."},{"args":"rll sync","description":"Sincroniza la tabla de routing con el Route Lookup Layer. Útil cuando hay inconsistencias entre routing real y VPN routing."},{"args":"set_slim_server","description":"DEPRECATED. Eliminar archivo $FWDIR/conf/slim.conf y configurar SSL Network Extender desde Management Server. Mientras exista slim.conf, sobrescribe configuración del Management."},{"args":"set_snx_encdom_groups {off | on}","description":"Controla feature de encryption domain por grupo de usuario para SSL Network Extender. Off=deshabilita, On=habilita."},{"args":"set_trac {disable | enable}","description":"Controla servidor TRAC (Topology and Resource Access Control). Disable=deshabilita, Enable=habilita. Requiere Install Policy para que cambio tome efecto."},{"args":"shell","description":"Lanza VPN Command Line Interface interactiva. Menú con opciones para: manipular interfaces de túnel (deprecated en Gaia), mostrar datos internos, manipular túneles (IKE/IPsec SAs), y mostrar licencias SCM. Comando quit para salir. IPv6: usar vpn6 shell."},{"args":"show_tcpt","description":"Muestra usuarios conectados en Visitor Mode (modo visitante de VPN)."},{"args":"sw_topology -dir <directory> -name <name> -profile <profile> [-filename <filename>] [-d]","description":"NOTA: R81 NO soporta UTM-1 Edge ni Safe@Office. Comando legacy para descargar topología de estos dispositivos. Información mantenida solo por documentación de sintaxis existente hasta remoción completa. -d para debug mode."},{"args":"tu","description":"Alias de tunnelutil. Lanza TunnelUtil, herramienta para control de túneles VPN. Permite listar, mostrar y eliminar Security Associations (SAs) de IKE e IPsec. Ver subcomandos: del, list, mstats, tlist, conn."},{"args":"tunnelutil","description":"Lanza TunnelUtil, herramienta para control de túneles VPN. Permite listar, mostrar y eliminar Security Associations (SAs) de IKE e IPsec. Alias: vpn tu. Ver subcomandos: del, list, mstats, tlist, conn."},{"args":"ver [-k] [-f <filename>]","description":"Muestra versión mayor y build number del módulo kernel VPN. -k adicional muestra kernel build number. -f guarda información a archivo de texto especificado. Ejemplo output: Check Point VPN-1(TM) R81 - Build 123."}]','vpn','R81+','vpn, tunnel, ipsec, ike, certificados, ssl, remote access, site to site, encriptación, debugging, security associations, túneles seguros, negociación, crl, compression, topology, vpnd, daemon','expert','query','firewall',0,'medium','[]',0,'2026-01-01 13:05:04','2026-01-01 13:05:04');
INSERT INTO checkpoint_commands VALUES(17,'vpn tu','TunnelUtil - Herramienta avanzada para gestión de túneles VPN. Permite listar, visualizar y eliminar Security Associations (SAs) de IKE e IPsec de forma granular. Soporta filtrado por peer, usuario, tipo de SA. Incluye estadísticas de distribución MultiCore (mstats) y análisis de volumen de tráfico por túnel (tlist). Esencial para troubleshooting de túneles específicos, análisis de balanceo de carga VPN en CoreXL, y gestión masiva de SAs. Soporta tanto IPv4 como IPv6 (vpn6 tu). Puede usarse de forma interactiva (menú) o con comandos directos.','[{"args":"help","description":"Muestra comandos avanzados disponibles en el menú actual de TunnelUtil."},{"args":"del all","description":"Elimina todas las IPsec SAs y todas las IKE SAs para todos los VPN peers y usuarios. Equivalente a opción (0) en menú interactivo. También disponible en vpn shell: tunnels > delete > all > IKE y tunnels > delete > all > IPsec."},{"args":"del ipsec all","description":"Elimina todas las IPsec SAs para todos los peers y usuarios. Equivalente a opción (9) en menú interactivo. También en vpn shell: tunnels > delete > all > IPsec."},{"args":"del ipsec <IP Address>","description":"Elimina todas las IPsec SAs para el VPN peer especificado por IP. Equivalente a opción (5) Delete all IPsec SAs for a given peer (GW). También en vpn shell: tunnels > delete > IPsec > peer <Internal Peer IP>."},{"args":"del ipsec <IPv4 Address> <Username>","description":"Elimina todas las IPsec SAs para el peer IPv4 y usuario especificados. Equivalente a opción (6) Delete all IPsec SAs for a given User (Client). También en vpn shell: tunnels > delete > IPsec > user <Username>. NO soporta IPv6."},{"args":"del <IP Address>","description":"Elimina todas las IPsec SAs y todas las IKE SAs para el VPN peer especificado. Equivalente a opción (7) Delete all IPsec+IKE SAs for a given peer (GW)."},{"args":"del <IP Address> <Username>","description":"Elimina todas las IPsec SAs y todas las IKE SAs para el peer y usuario especificados. Equivalente a opción (8) Delete all IPsec+IKE SAs for a given User (Client)."},{"args":"list ike","description":"Muestra todas las IKE SAs. Equivalente a opción (1) List all IKE SAs en menú interactivo. También en vpn shell: show > tunnels > IKE > all o tunnels > show > IKE > all."},{"args":"list ipsec","description":"Muestra todas las IPsec SAs. Equivalente a opción (2) List all IPsec SAs. También en vpn shell: show > tunnels > IPsec > all o tunnels > show > IPsec > all."},{"args":"list peer_ike <IP Address>","description":"Muestra todas las IKE SAs para el VPN peer especificado. Equivalente a opción (3) List all IKE SAs for a given peer (GW). También en vpn shell: show > tunnels > IKE > peer <IP> o tunnels > show > IKE > peer <IP>."},{"args":"list peer_ipsec <IP Address>","description":"Muestra todas las IPsec SAs para el VPN peer especificado. Equivalente a opción (4) List all IPsec SAs for a given peer (GW). También en vpn shell: show > tunnels > IPsec > peer <IP> o tunnels > show > IPsec > peer <IP>."},{"args":"list tunnels","description":"Muestra información sobre túneles VPN. Ver también vpn tu tlist para opciones adicionales."},{"args":"mstats","description":"Muestra distribución de tráfico VPN entre instancias CoreXL Firewall. Output: tabla con Instance#, # of inSPIs, # of outSPIs por cada instancia y totales. Esencial para diagnóstico de balanceo de carga VPN en entornos MultiCore. IPv6: usar vpn6 tu mstats."},{"args":"tlist [-h|-help]","description":"Muestra ayuda de uso de tlist (Tunnel List volume statistics)."},{"args":"tlist clear","description":"Limpia las estadísticas de volumen de Tunnel List (resetea contadores)."},{"args":"tlist start","description":"Activa las estadísticas de volumen de Tunnel List."},{"args":"tlist state","description":"Muestra estado actual de Tunnel List volume statistics (activado/desactivado)."},{"args":"tlist stop","description":"Desactiva las estadísticas de volumen de Tunnel List."},{"args":"tlist -b","description":"Ordena por total de bytes (encrypted + decrypted)."},{"args":"tlist -d","description":"Ordena por bytes inbound (decrypted)."},{"args":"tlist -e","description":"Ordena por bytes outbound (encrypted)."},{"args":"tlist -i","description":"Combina filas por instancia CoreXL Firewall con tráfico acumulado. Orden default: descendente por total bytes."},{"args":"tlist -m","description":"Ordena por MSPI (Master SPI)."},{"args":"tlist -n","description":"Ordena por nombre del VPN peer."},{"args":"tlist -p <IP Address>","description":"Muestra túneles solo para VPN peer con IP especificada."},{"args":"tlist -r","description":"Ordena en orden reverso (inverso)."},{"args":"tlist -s","description":"Ordena por SPI (Security Parameter Index)."},{"args":"tlist -t","description":"Combina filas por VPN peer con tráfico acumulado. Orden default: descendente por total bytes."},{"args":"tlist -v","description":"Modo verbose, imprime mensaje de header para cada opción. Opciones pueden combinarse: -vtbr o -v -t -b -r."}]','vpn','R81+','tunnel, tunnelutil, ipsec, ike, security associations, sa, delete tunnel, list tunnel, spi, mspi, corexl, multicore, balanceo, vpn peers, remote access','expert','query','firewall',0,'medium','[]',0,'2026-01-01 13:05:45','2026-01-01 13:05:45');
INSERT INTO checkpoint_commands VALUES(18,'mcc','Multi-Certificate CA - Herramienta para gestión de certificados y Certificate Authorities en Security Management Server o Domain Management Server. Permite visualizar CAs y certificados, añadir nuevos certificados adicionales a CAs existentes, eliminar certificados adicionales, promover certificados adicionales a principal (add2main), y crear copias del certificado principal como adicional (main2add). Esencial para rotación de certificados CA, troubleshooting de validación de certificados, y gestión de múltiples certificados por CA. Requiere que proceso cpca esté activo. La mayoría de comandos requieren cierre previo de SmartConsole, GuiDBEdit y dbedit para evitar locks de base de datos. En Multi-Domain: ejecutar en contexto del Domain Management Server apropiado usando mdsenv.','[{"args":"-h","description":"Muestra ayuda de uso integrada (built-in usage) del comando mcc."},{"args":"lca","description":"Lista todas las Certificate Authorities (CAs) definidas en la base de datos del Management Server, mostrando el número de certificados CA adicionales para cada CA. Único subcomando que NO requiere cerrar SmartConsole/GuiDBEdit/dbedit. En Multi-Domain Server: ejecutar en contexto del Domain Management Server con mdsenv."},{"args":"show <CA Name>","description":"Muestra detalles completos del certificado principal (main certificate) de la CA especificada. Incluye: PubKey Modulus y Exponent, versión X509, refCount, Serial Number, Issuer, Subject, validez (Not valid before/after), algoritmo de firma, tamaño de clave pública, extensiones (Key Usage, Basic Constraints). En MDS: ejecutar con mdsenv."},{"args":"show <CA Name> <Certificate Index Number>","description":"Muestra detalles completos del certificado adicional con índice especificado de la CA. Mismo formato de output que show para certificado principal. En MDS: ejecutar con mdsenv."},{"args":"add <CA Name> <Certificate File>","description":"Añade certificado almacenado en formato DER del archivo especificado como certificado adicional a la CA. El nuevo certificado recibe índice numérico mayor en uno que el índice más alto existente. IMPORTANTE: Antes de ejecutar, cerrar todos los clientes SmartConsole, GuiDBEdit y dbedit para prevenir lock de base de datos. Requiere proceso cpca activo. En MDS: ejecutar con mdsenv."},{"args":"add2main <CA Name> <Certificate Index Number>","description":"Copia el certificado adicional del índice especificado a la posición principal (main), sobrescribiendo el certificado principal previo. Útil para promover certificado adicional a principal durante rotación de certificados. IMPORTANTE: Cerrar SmartConsole/GuiDBEdit/dbedit antes de ejecutar. En MDS: usar mdsenv."},{"args":"main2add <CA Name>","description":"Copia el certificado principal de la CA especificada a posición adicional. El certificado copiado recibe índice numérico mayor en uno que el más alto existente. Útil para backup del certificado principal antes de rotación. IMPORTANTE: Cerrar SmartConsole/GuiDBEdit/dbedit antes. En MDS: usar mdsenv."},{"args":"del <CA Name> <Certificate Index Number>","description":"Elimina el certificado adicional del índice especificado de la CA. Los índices mayores se reducen en uno automáticamente. IMPORTANTE: Cerrar SmartConsole/GuiDBEdit/dbedit antes de ejecutar para prevenir lock de base de datos. En MDS: ejecutar con mdsenv."}]','vpn','R81+','certificate, certificado, ca, certificate authority, pki, x509, rotation, certificado adicional, main certificate, multi-certificate, cpca, management server','expert','config','management',0,'high','[]',0,'2026-01-01 13:06:14','2026-01-01 13:06:14');
INSERT INTO checkpoint_commands VALUES(19,'vpn6','Versión IPv6 del comando vpn. Proporciona funcionalidad equivalente a vpn pero operando sobre túneles, Security Associations y configuraciones IPv6. Principalmente usado para: vpn6 shell (CLI interactiva IPv6), vpn6 tu mstats (estadísticas MultiCore para túneles IPv6), y vpn6 tu tlist (análisis de volumen de tráfico IPv6). Esencial en entornos con VPN dual-stack o pure IPv6. Soporta mismas capacidades de troubleshooting que vpn pero para addressing y túneles IPv6.','[{"args":"shell","description":"Lanza VPN Command Line Interface interactiva para IPv6. Menú idéntico a vpn shell pero operando sobre túneles y SAs IPv6. Opciones: manipular interfaces de túnel, mostrar datos internos, manipular túneles IPv6 (IKE/IPsec SAs), mostrar licencias SCM."},{"args":"tu mstats","description":"Muestra distribución de túneles VPN IPv6 entre instancias CoreXL Firewall. Output: tabla con Instance#, # of inSPIs, # of outSPIs por cada instancia y totales. Esencial para diagnóstico de balanceo IPv6 en MultiCore."},{"args":"tu tlist [opciones]","description":"Muestra información sobre túneles VPN IPv6. Soporta mismas opciones que vpn tu tlist: -b (bytes totales), -d (bytes inbound), -e (bytes outbound), -i (por instancia CoreXL), -m (por MSPI), -n (por nombre peer), -p <IPv6> (peer específico), -r (orden reverso), -s (por SPI), -t (por peer acumulado), -v (verbose). También: clear, start, state, stop."}]','vpn','R81+','vpn, ipv6, tunnel, ipsec, ike, security associations, dual-stack, tunnelutil, corexl, multicore','expert','query','firewall',0,'low','[]',0,'2026-01-01 13:06:40','2026-01-01 13:06:40');
INSERT INTO checkpoint_commands VALUES(20,'vpn shell','VPN Command Line Interface interactiva. Proporciona menú jerárquico para navegar y ejecutar operaciones VPN sin necesidad de recordar sintaxis exacta de comandos. Funcionalidad principal: visualizar y eliminar Security Associations (IKE/IPsec) por peer o usuario, mostrar datos internos de VPN, verificar licencias SCM. Navegación: ''?'' para ayuda, ''..'' para subir nivel, ''quit'' para salir. Ideal para administradores que prefieren interfaz de menú sobre comandos directos. Para IPv6 usar ''vpn6 shell''. Nota: comandos de interface están deprecated en Gaia, usar Gaia Portal/Clish en su lugar.','[{"args":"?","description":"Muestra comandos avanzados disponibles en el nivel de menú actual."},{"args":"..","description":"Sube un nivel en el menú jerárquico."},{"args":"quit","description":"Sale del VPN shell (solo disponible en nivel principal del menú)."},{"args":"interface","description":"DEPRECATED en Gaia OS. Comandos para manipular interfaces de túnel. Usar Gaia Portal o Gaia Clish en su lugar. Consultar R81 Gaia Administration Guide."},{"args":"show","description":"Muestra datos internos de VPN. Submenú con opciones: show > interface (deprecated), show > tunnels (Security Associations)."},{"args":"show > tunnels > IKE > all","description":"Muestra todas las IKE SAs. Equivalente a: opción (1) en vpn tu menú, comando vpn tu list ike, y tunnels > show > IKE > all."},{"args":"show > tunnels > IKE > peer <IP>","description":"Muestra todas las IKE SAs para VPN peer especificado. Equivalente a: opción (3) en vpn tu, comando vpn tu list peer_ike <IP>, y tunnels > show > IKE > peer <IP>."},{"args":"show > tunnels > IPsec > all","description":"Muestra todas las IPsec SAs. Equivalente a: opción (2) en vpn tu, comando vpn tu list ipsec, y tunnels > show > IPsec > all."},{"args":"show > tunnels > IPsec > peer <IP>","description":"Muestra todas las IPsec SAs para VPN peer especificado. Equivalente a: opción (4) en vpn tu, comando vpn tu list peer_ipsec <IP>, y tunnels > show > IPsec > peer <IP>."},{"args":"tunnels","description":"Muestra y elimina Security Associations (SAs). Submenú con opciones: tunnels > show (ver SAs), tunnels > delete (eliminar SAs)."},{"args":"tunnels > show > IKE > all","description":"Muestra todas las IKE SAs. Equivalente a opción (1) List all IKE SAs en vpn tu y comando vpn tu list ike."},{"args":"tunnels > show > IKE > peer <IP>","description":"Muestra IKE SAs para peer específico. Equivalente a opción (3) en vpn tu y comando vpn tu list peer_ike <IP>."},{"args":"tunnels > show > IPsec > all","description":"Muestra todas las IPsec SAs. Equivalente a opción (2) en vpn tu y comando vpn tu list ipsec."},{"args":"tunnels > show > IPsec > peer <IP>","description":"Muestra IPsec SAs para peer. Equivalente a opción (4) en vpn tu y comando vpn tu list peer_ipsec <IP>."},{"args":"tunnels > delete > IKE > peer <IP>","description":"Elimina todas las IKE SAs para VPN peer especificado."},{"args":"tunnels > delete > IKE > user <Username>","description":"Elimina todas las IKE SAs para usuario especificado."},{"args":"tunnels > delete > IKE > all","description":"Elimina todas las IKE SAs para todos los peers y usuarios."},{"args":"tunnels > delete > IPsec > peer <IP>","description":"Elimina todas las IPsec SAs para peer especificado. Equivalente a opción (5) en vpn tu y comando vpn tu del ipsec <IP>."},{"args":"tunnels > delete > IPsec > user <Username>","description":"Elimina IPsec SAs para usuario. Equivalente a opción (6) en vpn tu y comando vpn tu del ipsec <IPv4> <Username>."},{"args":"tunnels > delete > IPsec > all","description":"Elimina todas las IPsec SAs para todos peers y usuarios. Equivalente a opción (9) en vpn tu y vpn tu del ipsec all."},{"args":"tunnels > delete > all > IKE","description":"Elimina todas las IKE SAs para todos peers y usuarios."},{"args":"tunnels > delete > all > IPsec","description":"Elimina todas las IPsec SAs para todos peers y usuarios. Equivalente a opción (9) y vpn tu del ipsec all."},{"args":"license","description":"Muestra licencias SCM (SecureClient Mobile). Submenú: license > scm > status (estado actual), license > scm > list (lista de dispositivos licenciados)."}]','vpn','R81+','vpn, shell, interactive, menu, cli, security associations, ike, ipsec, delete tunnel, scm licenses, navegación jerárquica','expert','query','firewall',0,'medium','[]',0,'2026-01-01 13:07:11','2026-01-01 13:07:11');
INSERT INTO checkpoint_commands VALUES(21,'admin_wizard','Ejecuta el wizard de administración para probar conectividad a sitios web, servicios de Exchange Server o servidores LDAP en Mobile Access Gateway. Herramienta de troubleshooting que valida accesibilidad, protocolos (HTTP/HTTPS), métodos de autenticación (Basic/NTLM), y servicios ActiveSync, EWS y OWA. Guarda logs detallados en múltiples archivos bajo $CVPNDIR/log/ para análisis posterior. Esencial para diagnosticar problemas de conectividad desde el Mobile Access Gateway hacia recursos internos antes de publicarlos a usuarios finales.','[{"args":"cancel","description":"Termina (kill) el wizard de administración que ya está ejecutándose. Útil si un wizard anterior quedó colgado."},{"args":"estimation","description":"Estima cuántos segundos tardará la ejecución del wizard. Útil para planificar tiempo de troubleshooting."},{"args":"exchange_wizard <Exchange Server Address> <User Name> <Password> [<Options>]","description":"Prueba respuesta desde Exchange server: encuentra protocolo (HTTP/HTTPS) y método de autenticación (Basic/NTLM), verifica accesibilidad de ActiveSync y EWS para usuarios, y para OWA retorna URL de Outlook Web Access. Parámetros: dirección IP/hostname del Exchange, username, password. Opciones: -t {as|ews|owa|all} para servicios a probar (default: all), -d <DNS Servers>, -x <Proxy Servers>, -c <Username>:<Password> para autenticación proxy, -n para solo NTLM, -m <Domain Name>, -s <ActiveSync Path> (default: /Microsoft-ServerActiveSync), -e <EWS Path> (default: /EWS/Exchange.asmx), -f <File Name> para guardar resultados, -r para enviar request con proxy/DNS/HTTP configurado, -v para verbose HTTP requests en $CVPNDIR/log/trace_log/, -p para validar certificado SSL."},{"args":"ldap <LDAP server>","description":"Prueba conectividad al servidor LDAP especificado por IP o hostname. Verifica que Mobile Access puede alcanzar el LDAP para autenticación de usuarios."},{"args":"wizard <Web Site Address>","description":"Prueba conectividad a URL especificada. Verifica accesibilidad HTTP/HTTPS desde Mobile Access Gateway hacia sitios web internos a publicar."}]','mobile-access','R81+','mobile access, wizard, connectivity test, exchange, ldap, activesync, ews, owa, troubleshooting, testing, http, https, ntlm, basic auth','expert','query','firewall',0,'low','[]',0,'2026-01-01 13:12:19','2026-01-01 13:12:19');
INSERT INTO checkpoint_commands VALUES(22,'cvpnd_admin','Cambia el comportamiento del proceso Mobile Access cvpnd. Controla Application Monitor (monitoreo de servidores internos), gestiona debug y TraceLogger, limpia tablas kernel y caché de portal, actualiza servicios según policy, verifica licencias MOB/MOBMAIL, y gestiona revocación de certificados. TraceLogger captura tráfico completo autenticado pero tiene impacto MAYOR en performance y seguridad (puede exponer passwords). Essential para troubleshooting avanzado, verificación de licencias, y gestión de servicios Mobile Access.','[{"args":"appMonitor status","description":"Muestra estado del Application Monitor feature, las aplicaciones monitoreadas y su estado. Application Monitor es componente que monitorea servidores internos para rastrear uptime, creando alertas de sistema si encuentra problemas."},{"args":"appMonitor restart","description":"Reinicia el Application Monitor."},{"args":"appMonitor start","description":"Inicia el Application Monitor."},{"args":"appMonitor stop","description":"Detiene el Application Monitor."},{"args":"clear_kernel_tables","description":"Limpia todas las tablas kernel de Mobile Access. Útil para resetear estado cuando hay inconsistencias."},{"args":"clear_portal_cache","description":"Limpia la caché de aplicaciones presentadas en Mobile Access Portal para todas las sesiones abiertas. Fuerza regeneración del portal."},{"args":"debug set TDERROR_ALL_ALL=5","description":"Habilita TODA la salida de debug del proceso cvpnd en ejecución. Output en $CVPNDIR/log/cvpnd.elg. WARNING: Habilitar todos los debug topics puede impactar performance. Debug topics son proporcionados por Check Point Support."},{"args":"debug off","description":"Deshabilita toda la salida de debug de cvpnd."},{"args":"debug trace on","description":"Habilita TraceLogger feature para TODOS los usuarios. Genera capturas completas de tráfico autenticado Mobile Access entrante/saliente. Output en $CVPNDIR/log/trace_log/. IMPORTANTE: (1) Efecto MAYOR en performance porque todo tráfico se guarda como archivos, (2) Usa MUCHO espacio en disco, archivos más antiguos se eliminan automáticamente con coste de performance, (3) Preocupación de SEGURIDAD: contraseñas de usuarios enviadas a recursos internos pueden aparecer en capturas."},{"args":"debug trace users=<Username>","description":"Habilita TraceLogger feature para username específico. Mismas advertencias que debug trace on pero limitado a un usuario."},{"args":"ics_update","description":"Actualiza servicios de Mobile Access después de publicar nueva actualización ICS (Endpoint Security on Demand)."},{"args":"isEnabled","description":"Verifica si Mobile Access está habilitado por policy."},{"args":"license all","description":"Muestra información sobre licencias MOB y MOBMAIL (cantidad y estado)."},{"args":"license mob","description":"Muestra información sobre licencia MOB (Mobile Access)."},{"args":"license mobmail","description":"Muestra información sobre licencia MOBMAIL (Mobile Access Mail)."},{"args":"policy","description":"Actualiza servicios de Mobile Access según policy actual. Para servicios Apache: cada proceso httpd espera hasta que su request actual termine, luego sale."},{"args":"policy graceful","description":"Actualiza servicios Mobile Access gracefully. Para Apache: cada httpd espera hasta que request actual termine, luego sale."},{"args":"policy hard","description":"Actualiza servicios Mobile Access de forma forzada. Para Apache: todos los procesos httpd salen inmediatamente, terminando todos los requests HTTP actuales."},{"args":"revoke <Certificate Serial Number>","description":"Notifica sobre revocación de certificado con número de serie especificado. Invalida certificado en Mobile Access."}]','mobile-access','R81+','mobile access, cvpnd, debug, trace logger, application monitor, license, policy update, certificate revoke, troubleshooting, performance','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:12:52','2026-01-01 13:12:52');
INSERT INTO checkpoint_commands VALUES(23,'cvpnd_settings','Modifica archivo de configuración local de Mobile Access Gateway $CVPNDIR/conf/cvpnd.C. Permite obtener y establecer valores de atributos para configurar proceso cvpnd, incluyendo configuraciones de DynamicID SMS resend, autenticación Kerberos, y gestión de Kerberos realms. IMPORTANTE: Cambios NO se guardan durante upgrade de Mobile Access Gateway - mantener backup de cvpnd.C después de cambios manuales. WARNING: Errores de sintaxis en nombres de atributos o valores pueden impedir que proceso cvpnd inicie. Usar con precaución y documentar cambios.','[{"args":"-h","description":"Muestra ayuda integrada con explicación completa de parámetros."},{"args":"get <Attribute-Name>","description":"Obtiene el valor de un atributo existente o valores de una lista del archivo de configuración."},{"args":"set <Attribute-Name> [<Attribute-Value>]","description":"Establece el valor de un atributo. Si el atributo no existe en el archivo de configuración, lo añade. Si no se especifica valor, vacía el atributo."},{"args":"add <Attribute-Name> [<Attribute-Value>]","description":"Añade un nuevo atributo. Si el atributo ya existe en el archivo de configuración, NO lo cambia."},{"args":"listAdd <Attribute-Name> [<Attribute-Value>]","description":"Añade el atributo especificado a una lista."},{"args":"listRemove <Attribute-Name> [<Attribute-Value>]","description":"Elimina el atributo especificado de una lista."},{"args":"internal <Attribute-Name> [<Attribute-Value>]","description":"Especifica que el comando debe cambiar el archivo $CVPNDIR/conf/cvpnd_internal_settings.C en lugar de $CVPNDIR/conf/cvpnd.C."},{"args":"set smsMaxResendRetries <Number>","description":"Configura número de intentos de reenvío SMS para DynamicID."},{"args":"get smsMaxResendRetries","description":"Obtiene número actual de intentos de reenvío SMS para DynamicID."},{"args":"set useKerberos {true | false}","description":"Habilita (true) o deshabilita (false) autenticación Kerberos en Mobile Access."},{"args":"get useKerberos","description":"Obtiene estado actual de autenticación Kerberos (true/false)."},{"args":"listAdd kerberosRealms <Your AD Name>","description":"Añade nombre de Active Directory a la lista de Kerberos realms."},{"args":"listRemove kerberosRealms <Your AD Name>","description":"Elimina nombre de Active Directory de la lista de Kerberos realms."}]','mobile-access','R81+','mobile access, cvpnd, configuration, settings, kerberos, dynamicid, sms, active directory, config file','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:13:12','2026-01-01 13:13:12');
INSERT INTO checkpoint_commands VALUES(24,'cvpn_ver','Muestra la versión del Mobile Access Software Blade instalada. Output típico: Check Point Mobile Access R81 - Build 123. Best Practice: usar fw ver -k para obtener todos los detalles de versión incluyendo kernel. Comando simple y rápido para verificar versión de Mobile Access durante troubleshooting o validación post-upgrade.','[]','mobile-access','R81+','mobile access, version, build, software blade, cvpn','expert','query','firewall',1,'low','[]',0,'2026-01-01 13:13:24','2026-01-01 13:13:24');
INSERT INTO checkpoint_commands VALUES(25,'cvpnrestart','Reinicia todos los servicios del blade Mobile Access. WARNING: Aunque este comando NO termina sesiones, CIERRA todas las conexiones TCP. Los usuarios finales pueden perder su trabajo en progreso. Usar con precaución en entornos de producción. Opcional: incluir --with-pinger para reiniciar también el servicio Pinger de push mail (ActiveSync/OWA). Útil después de cambios de configuración o cuando servicios Mobile Access están en estado inconsistente.','[{"args":"--with-pinger","description":"Reinicia también el servicio Pinger, responsable de notificaciones push mail para ActiveSync y Outlook Web Access. Usar cuando hay problemas específicamente con push notifications."}]','mobile-access','R81+','mobile access, restart, services, cvpn, pinger, activesync, owa, push mail','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:13:36','2026-01-01 13:13:36');
INSERT INTO checkpoint_commands VALUES(26,'cvpnstart','Inicia todos los servicios del blade Mobile Access después de haberlos detenido con cvpnstop. Restaura funcionalidad completa de Mobile Access Gateway. Usar después de mantenimiento, cambios de configuración manual, o troubleshooting que requirió detener servicios. Comando complementario a cvpnstop para gestión de servicios Mobile Access.','[]','mobile-access','R81+','mobile access, start, services, cvpn, iniciar','expert','config','firewall',0,'medium','[]',0,'2026-01-01 13:13:45','2026-01-01 13:13:45');
INSERT INTO checkpoint_commands VALUES(27,'cvpnstop','Detiene todos los servicios del blade Mobile Access. WARNING: Aunque NO termina sesiones, CIERRA todas las conexiones TCP. Los usuarios finales pueden perder su trabajo en progreso. Usar con extrema precaución en producción. Útil para mantenimiento programado, cambios de configuración críticos, o troubleshooting que requiere servicios detenidos. Debe seguirse de cvpnstart para restaurar funcionalidad Mobile Access.','[]','mobile-access','R81+','mobile access, stop, services, cvpn, detener, shutdown','expert','config','firewall',0,'critical','[]',0,'2026-01-01 13:13:54','2026-01-01 13:13:54');
INSERT INTO checkpoint_commands VALUES(28,'deleteUserSettings','Elimina todas las configuraciones persistentes (favoritos, cookies, credenciales) de uno o más usuarios finales en Mobile Access. Útil para: resetear configuración corrupta de usuario, limpiar credenciales almacenadas, troubleshooting de problemas específicos de usuario, o cumplimiento de políticas de limpieza de datos. Soporta usuarios internos (usar username simple) y usuarios LDAP (usar DN completo). Modo silencioso (-s) disponible para scripts automatizados.','[{"args":"-s","description":"Ejecuta en modo silencioso sin output a la pantalla del usuario final."},{"args":"<Username>","description":"Especifica username cuyos settings eliminar. Para usuario interno: usar su username. Para usuario LDAP: usar DN completo según configuración LDAP (ejemplo: CN=user1,OU=users,DC=example,DC=com). Puede especificar múltiples usernames separados por espacios."}]','mobile-access','R81+','mobile access, user settings, delete, cookies, credentials, favorites, ldap, troubleshooting','expert','config','firewall',0,'medium','[]',0,'2026-01-01 13:14:06','2026-01-01 13:14:06');
INSERT INTO checkpoint_commands VALUES(29,'fwpush','Envía interrupciones de comando al proceso fwpushd en Mobile Access Gateway para gestionar notificaciones push. Permite: controlar debug de push notifications daemon, eliminar tokens específicos, obtener info de cola push, enviar notificaciones on-demand (iPhone/Android), y desuscribir usuarios de push notifications. NOTA: Los usuarios reciben push notifications SOLO mientras están logged in. Para obtener tokens/UIDs usar UserSettingsUtil show_exchange_registered_users. Esencial para troubleshooting de ActiveSync/OWA push mail y gestión de dispositivos móviles.','[{"args":"debug {off | on | reset | set all all | stat}","description":"Controla debug del daemon Mobile Access Push Notifications (fwpushd). Opciones: off=deshabilitar, on=habilitar, reset=resetear, set all all=habilitar todo, stat=mostrar estado. Para más información ver sk109039."},{"args":"del -token <Token>","description":"Elimina el token especificado para todos los usuarios. Token es el Push Token obtenido de UserSettingsUtil show_exchange_registered_users."},{"args":"del -uid <User-UID>","description":"Elimina todos los tokens para el usuario especificado. User-UID es el User Settings id de UserSettingsUtil."},{"args":"info","description":"Obtiene datos sobre notificaciones en la cola push: número de items en colas, segundos que el item más antiguo/nuevo lleva en cola, segundos que un batch espera, segundos hasta envío del siguiente batch, número de errores de batch y timeouts de authentication request."},{"args":"print","description":"Muestra la cola de notificaciones push (push notifications queue) y los batches pendientes."},{"args":"send -token <Token> -os {iPhone | Android} -msg \"<Notification Message>\"","description":"Envía notificación push on-demand desde línea de comandos usando token específico. Requiere especificar OS (iPhone/Android) y mensaje. IMPORTANTE: Antes de usar, verificar que usuario está: (A) registrado en Exchange Server, (B) conectado."},{"args":"send -user <Username> -msg \"<Notification Message>\"","description":"Envía notificación push on-demand por username (CN del usuario). IMPORTANTE: verificar usuario registrado y conectado antes de enviar."},{"args":"send -uid <User-UID> -msg \"<Notification Message>\"","description":"Envía notificación push on-demand por User Settings ID. IMPORTANTE: verificar usuario registrado y conectado antes de enviar."},{"args":"unsub <Token>","description":"Desuscribe todos los usuarios del token especificado de notificaciones push."},{"args":"unsub -user <Username>","description":"Desuscribe el usuario especificado de todos los tokens de notificaciones push."},{"args":"unsub -uid <User-UID>","description":"Desuscribe el usuario especificado (por UID) de todos los tokens de notificaciones push."},{"args":"unsub -all","description":"Desuscribe TODOS los usuarios de TODOS los tokens de notificaciones push. Usar con precaución."}]','mobile-access','R81+','mobile access, push notifications, fwpushd, activesync, owa, exchange, iphone, android, tokens, troubleshooting','expert','config','firewall',0,'medium','[]',0,'2026-01-01 13:14:34','2026-01-01 13:14:34');
INSERT INTO checkpoint_commands VALUES(30,'ics_updates_script','Inicia manualmente actualización de Endpoint Security on Demand (ESOD) en Mobile Access Gateway. Script ubicado en $CVPNDIR/bin/ics_updates_script. Normalmente NO es necesario ejecutar este comando manualmente - las actualizaciones ESOD se inician desde SmartConsole: Manage & Settings > Mobile Access > Configure in SmartDashboard > Endpoint Security on Demand > Endpoint Compliance Updates > Update Database Now. IMPORTANTE: Asegurarse de ejecutar solo UNA instancia de este comando a la vez para evitar conflictos. Útil para actualizaciones offline o troubleshooting de proceso de actualización.','[{"args":"<Path to Local ICS Updates Package>","description":"Especifica ruta completa al paquete local de actualizaciones ICS. NO especificar el nombre del paquete, solo la ruta al directorio que lo contiene."}]','mobile-access','R81+','mobile access, endpoint security, esod, ics updates, compliance, update, smartconsole','expert','config','firewall',0,'medium','[]',0,'2026-01-01 13:14:51','2026-01-01 13:14:51');
INSERT INTO checkpoint_commands VALUES(31,'listusers','Muestra lista de usuarios finales conectados al Mobile Access Gateway junto con sus direcciones IP de origen. Output formato tabla: UserName | IP. Útil para: verificar usuarios actualmente conectados, identificar direcciones IP de usuarios para troubleshooting, monitoreo de sesiones activas, y auditoría de accesos. Comando simple sin parámetros para rápida visibilidad de usuarios conectados en tiempo real.','[]','mobile-access','R81+','mobile access, users, connected, sessions, monitoring, ip address','expert','query','firewall',1,'low','[]',0,'2026-01-01 13:15:00','2026-01-01 13:15:00');
INSERT INTO checkpoint_commands VALUES(32,'rehash_ca_bundle','Importa todos los archivos de Certificate Authority (CA) desde directorio $CVPNDIR/var/ssl/ca-bundle/ al bundle de CAs confiables de Mobile Access. El bundle de CAs confiables se usa cuando Mobile Access Gateway accede a servidor interno (como OWA) mediante HTTPS. Si certificado SSL del servidor interno no es confiado por Mobile Access Gateway, el gateway responde según configuración de feature Internal Web Server Verification (default: Monitor). Para aceptar certificados de servidor específico, añadir su CA del certificado al CA bundle y ejecutar este comando. Genera hashes simbólicos para cada CA importada.','[]','mobile-access','R81+','mobile access, certificate authority, ca bundle, ssl, https, trust, owa, internal server','expert','config','firewall',0,'low','[]',0,'2026-01-01 13:15:14','2026-01-01 13:15:14');
INSERT INTO checkpoint_commands VALUES(33,'UserSettingsUtil','Muestra detalles de usuarios conectados al Mobile Access Gateway. Proporciona información crítica: User Name (Distinguished Name completo para usuarios LDAP), User Settings id (para usar como <User-UID> en comandos fwpush), Push Token (para comandos fwpush con parámetro <Token>), y Device id. Soporta consulta de todos los usuarios o usuario específico. Esencial para obtener valores correctos antes de ejecutar comandos fwpush (send, del, unsub). Diferencia entre usuarios internos (username simple) y LDAP (DN completo).','[{"args":"show_exchange_registered_users","description":"Muestra todos los usuarios conectados a Mobile Access Gateway con detalles completos: User Name (DN completo para LDAP), User Settings id, Push Token, Device id. Output incluye toda la información necesaria para comandos fwpush."},{"args":"show_exchange_registered_users <Username>","description":"Muestra detalles del usuario específico conectado a Mobile Access. Para usuario interno: usar username simple. Para usuario LDAP: usar DN completo según configuración LDAP (ejemplo: CN=user1,OU=users,DC=example,DC=com)."}]','mobile-access','R81+','mobile access, user settings, exchange, push token, device id, ldap, fwpush, connected users','expert','query','firewall',1,'low','[]',0,'2026-01-01 13:15:36','2026-01-01 13:15:36');
INSERT INTO checkpoint_commands VALUES(34,'dlpcmd','Controla el Data Loss Prevention Engine en Security Gateway. Permite gestionar emails en cuarentena: visualizar lista completa, contar cantidad, verificar tamaño total, enviar (release) o eliminar (discard) emails específicos por GUID con justificación y auditoría. También controla DLP RAM Disk: habilitar/deshabilitar, configurar tamaño, y verificar estado. Acciones de release/discard se registran en Audit Logs de SmartConsole para compliance. CRÍTICO: Operaciones ramdisk (excepto status) requieren cpstop/cpstart completo. Esencial para administración de cuarentena DLP y optimización de performance mediante RAM Disk.','[{"args":"-s","description":"Modo silencioso - no imprime mensajes de fallo en pantalla. Útil para scripts automatizados."},{"args":"action_by_admin 1 {Public GUID} [\"Justification\"] [\"Administrator Name\"]","description":"Envía (Release/libera) el email en cuarentena especificado por su GUID público. GUID debe estar encerrado en llaves {}. Opcionalmente especificar justificación y nombre de administrador. Esta acción se registra en Audit Logs de SmartConsole (ver sk117753)."},{"args":"action_by_admin 2 {Public GUID} [\"Justification\"] [\"Administrator Name\"]","description":"Elimina (Discard/descarta) el email en cuarentena especificado por su GUID público. GUID debe estar encerrado en llaves {}. Opcionalmente especificar justificación y nombre de administrador. Esta acción se registra en Audit Logs de SmartConsole."},{"args":"getquarantined","description":"Muestra lista completa de todos los emails en cuarentena con detalles: Mail GUID, fecha de llegada (Arrival date), fecha de expiración (exp date), y remitente (sender). Esencial para identificar GUIDs necesarios para action_by_admin."},{"args":"getquarantinedcount","description":"Muestra el número total de emails en cuarentena. Útil para monitoreo rápido de volumen de cuarentena."},{"args":"getquarantinedsize","description":"Muestra el tamaño total (en bytes/MB) de todos los emails en cuarentena. Útil para gestión de capacidad de almacenamiento."},{"args":"ramdisk off","description":"Deshabilita el DLP RAM Disk. IMPORTANTE: Requiere reinicio de todos los servicios (cpstop y cpstart)."},{"args":"ramdisk on","description":"Habilita el DLP RAM Disk. IMPORTANTE: Requiere reinicio de todos los servicios (cpstop y cpstart)."},{"args":"ramdisk size <Size in MBytes>","description":"Configura el tamaño del DLP RAM Disk en megabytes. IMPORTANTE: Requiere reinicio de todos los servicios (cpstop y cpstart)."},{"args":"ramdisk status","description":"Muestra información del DLP RAM Disk (estado, tamaño configurado, uso actual). Única operación ramdisk que NO requiere reinicio de servicios."}]','dlp','R81+','dlp, data loss prevention, quarantine, cuarentena, email, ramdisk, release, discard, audit logs, compliance, security gateway','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:17:44','2026-01-01 13:17:44');
INSERT INTO checkpoint_commands VALUES(35,'ips','Muestra información y controla el IPS Software Blade en Security Gateway. Permite habilitar/deshabilitar IPS on-the-fly sin reinstalar policy, controlar modo Bypass bajo carga (CPU/Memory thresholds), recolectar debug, refrescar repositorio de capturas de paquetes, ver estado y estadísticas de performance. IMPORTANTE: Cambios de configuración NO son persistentes - se pierden al reinstalar policy o reiniciar gateway. En Cluster: configurar todos los miembros igual. En Maestro/Chassis: ejecutar en Security Group aplicable. Esencial para troubleshooting de protecciones IPS y optimización de performance.','[{"args":"bypass","description":"Controla el modo IPS Bypass. Ver ips bypass para opciones completas."},{"args":"debug","description":"Recolecta debug de IPS. Ver ips debug para opciones completas."},{"args":"off","description":"Deshabilita IPS Software Blade on-the-fly (sin reinstalar policy). Opción -n elimina templates existentes para aplicación inmediata. Sin -n, toma efecto completo en pocos minutos."},{"args":"on","description":"Habilita IPS Software Blade on-the-fly (sin reinstalar policy). Opción -n elimina templates existentes para aplicación inmediata. Sin -n, toma efecto completo en pocos minutos."},{"args":"refreshcap","description":"Refresca el repositorio de packet captures de IPS. Designa el siguiente paquete de cada protección IPS como primer paquete, reemplazando el anterior en repositorio."},{"args":"stat","description":"Muestra información IPS: estado (Enabled/Disabled), versión de actualización IPS, Global Detect (On/Off), Bypass Under Load (On/Off), y perfiles activos."},{"args":"stats","description":"Genera reporte con estadísticas de IPS y Pattern Matcher. Ver ips stats para opciones completas."}]','ips','R81+','ips, intrusion prevention, threat prevention, bypass, debug, performance, pattern matcher, protections, statistics','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:18:57','2026-01-01 13:18:57');
INSERT INTO checkpoint_commands VALUES(36,'ips bypass','Controla el modo IPS Bypass bajo carga (Bypass Under Load). Cuando CPU y/o utilización de memoria alcanzan threshold alto configurado, IPS Software Blade se deshabilita automáticamente para proteger disponibilidad del gateway. Cuando CPU/memoria bajan a threshold bajo, IPS se rehabilita automáticamente. Permite configurar thresholds independientes para CPU y memoria (porcentaje 0-100), habilitar/deshabilitar feature, y verificar estado actual. Mecanismo de protección crítico para evitar degradación severa de performance en gateways bajo carga extrema, balanceando seguridad vs disponibilidad.','[{"args":"off","description":"Deshabilita el modo IPS Bypass. IPS seguirá activo independientemente de CPU/Memory utilization."},{"args":"on","description":"Habilita el modo IPS Bypass. IPS se deshabilitará automáticamente cuando CPU/Memory alcancen threshold alto, y se rehabilitará cuando bajen a threshold bajo."},{"args":"set cpu low <0-100>","description":"Configura threshold bajo de CPU (porcentaje 0-100). Cuando CPU baja a este nivel, IPS se rehabilita automáticamente si estaba en bypass."},{"args":"set cpu high <0-100>","description":"Configura threshold alto de CPU (porcentaje 0-100). Cuando CPU alcanza este nivel, IPS se deshabilita automáticamente (entra en bypass mode)."},{"args":"set mem low <0-100>","description":"Configura threshold bajo de memoria (porcentaje 0-100). Cuando memoria baja a este nivel, IPS se rehabilita automáticamente si estaba en bypass."},{"args":"set mem high <0-100>","description":"Configura threshold alto de memoria (porcentaje 0-100). Cuando memoria alcanza este nivel, IPS se deshabilita automáticamente (entra en bypass mode)."},{"args":"stat","description":"Muestra estado de IPS Bypass Under Load: modo bypass (on/off), thresholds de CPU (alto/bajo), thresholds de memoria (alto/bajo)."}]','ips','R81+','ips, bypass, cpu, memory, performance, load, threshold, auto-disable, availability','expert','config','firewall',0,'high','[]',0,'2026-01-01 13:19:13','2026-01-01 13:19:13');
INSERT INTO checkpoint_commands VALUES(37,'ips debug','Recolecta información de debug de IPS. Permite especificar filtros INSPECT para capturar paquetes específicos y define archivo de salida obligatorio para almacenar logs de debug. Útil para troubleshooting avanzado de protecciones IPS, análisis de detecciones, y diagnóstico de problemas de performance. Para información sobre kernel debug, consultar R81 Quantum Security Gateway Guide - Chapter Kernel Debug on Security Gateway. Soporta filtros complejos tipo fw monitor para análisis granular de tráfico inspeccionado por IPS.','[{"args":"-e <Filter>","description":"Especifica filtro INSPECT para capturar paquetes. Para más información ver comando fw monitor en sk30583: What is FW Monitor?"},{"args":"-o <Output File>","description":"Especifica la ruta y nombre del archivo de salida de debug. Obligatorio."}]','ips','R81+','ips, debug, troubleshooting, fw monitor, inspect filter, packet capture, logs','expert','query','firewall',0,'medium','[]',0,'2026-01-01 13:20:36','2026-01-01 13:20:36');
INSERT INTO checkpoint_commands VALUES(38,'ips off','Deshabilita el IPS Software Blade on-the-fly (sin reinstalar policy). Con flag -n elimina templates existentes para aplicación inmediata a todas las conexiones, de lo contrario toma efecto completo en pocos minutos cuando expiran templates actuales. IMPORTANTE: Este cambio NO es persistente - se revierte al reinstalar policy o reiniciar gateway. Para habilitar nuevamente usar comando ips on. Útil para troubleshooting temporal, mantenimiento, o cuando se requiere deshabilitar IPS urgentemente sin afectar otras blades de seguridad.','[{"args":"","description":"Deshabilita IPS Software Blade on-the-fly sin reinstalar policy. Sin opciones adicionales, la configuración toma efecto completo en pocos minutos."},{"args":"-n","description":"Deshabilita IPS y elimina templates existentes (clearing table cphwd_tmpl) para aplicación inmediata a conexiones existentes. Recomendado para aplicación instantánea."}]','ips','R81+','ips, disable, off, templates, troubleshooting, maintenance, temporary','expert','config','firewall',0,'critical','[]',0,'2026-01-01 13:20:49','2026-01-01 13:20:49');
INSERT INTO checkpoint_commands VALUES(39,'ips on','Habilita el IPS Software Blade on-the-fly (sin reinstalar policy), especialmente después de haberlo deshabilitado con comando ips off. Con flag -n elimina templates existentes para aplicación inmediata a todas las conexiones, de lo contrario toma efecto completo en pocos minutos. IMPORTANTE: Este cambio NO es persistente - configuración definitiva debe hacerse en SmartConsole e instalar policy. Útil para rehabilitar IPS rápidamente después de troubleshooting o mantenimiento temporal sin necesidad de reinstalación completa de policy.','[{"args":"","description":"Habilita IPS Software Blade on-the-fly sin reinstalar policy. Sin opciones adicionales, la configuración toma efecto completo en pocos minutos."},{"args":"-n","description":"Habilita IPS y elimina templates existentes (clearing table cphwd_tmpl) para aplicación inmediata a conexiones existentes. Recomendado para aplicación instantánea."}]','ips','R81+','ips, enable, on, templates, restore, temporary','expert','config','firewall',0,'medium','[]',0,'2026-01-01 13:20:59','2026-01-01 13:20:59');
INSERT INTO checkpoint_commands VALUES(40,'ips refreshcap','Refresca el repositorio de capturas de paquetes (packet capture repository) de IPS. Después de instalar nueva policy, IPS captura el primer paquete de cada protección IPS y lo guarda en repositorio. Este comando designa el siguiente paquete de cada protección como nuevo ''primer paquete'', reemplazando el anterior en repositorio. Útil para: actualizar samples después de cambios de policy, obtener captures más recientes de ataques, limpiar captures obsoletas, o cuando se necesitan nuevos ejemplos de detecciones para análisis. Las nuevas capturas aparecen adjuntas en logs o en Packet Capture Repository tras próxima detección de cada ataque.','[]','ips','R81+','ips, packet capture, repository, refresh, samples, analysis, detections','expert','config','firewall',0,'low','[]',0,'2026-01-01 13:21:11','2026-01-01 13:21:11');
INSERT INTO checkpoint_commands VALUES(41,'ips stat','Muestra información de estado de IPS: estado actual (Enabled/Disabled), versión de IPS Update instalada, estado de Global Detect (On/Off), estado de Bypass Under Load (On/Off), y perfiles IPS activos. Comando de diagnóstico rápido esencial para verificar configuración operativa de IPS, validar versión de signatures actualizada, confirmar que protecciones están activas, y verificar si bypass mode está habilitado. Salida concisa ideal para checks de estado durante troubleshooting o validación post-cambios.','[]','ips','R81+','ips, status, version, global detect, bypass, profiles, diagnostics','expert','query','firewall',1,'low','[]',0,'2026-01-01 13:21:24','2026-01-01 13:21:24');
INSERT INTO checkpoint_commands VALUES(42,'ips stats','Genera reporte completo con estadísticas de IPS y Pattern Matcher para identificar qué protecciones o componentes IPS causan problemas de performance. Output en $FWDIR/ips/statistics_results/: ips.dbg (raw report completo), ips_stat_output_file.csv (estadísticas IPS), pm_output_file.csv (Pattern Matcher), tier1_output_file.csv y tier2_output_file.csv (Pattern Matcher por tiers). Ayuda a administradores y protection writers a analizar consumo de CPU por protección (ver sk43733). IMPORTANTE: En VSX Gateway usar modo Manual (-g). Soporta análisis remoto desde Management Server y recolección local en Standalone. Esencial para tuning de performance IPS.','[{"args":"-h","description":"Muestra ayuda integrada con explicación completa de parámetros."},{"args":"","description":"Solo Standalone. Recolecta estadísticas IPS y Pattern Matcher en equipo Standalone durante 20 segundos (default)."},{"args":"<Seconds>","description":"Solo Standalone. Recolecta estadísticas durante número especificado de segundos."},{"args":"-g <Seconds>","description":"Modo Manual en Security Gateway actual. OBLIGATORIO en VSX Gateway. Recolecta estadísticas durante segundos especificados. Output: /ips_tar.tgz (root partition). Para análisis copiar archivo a root partition en Management Server."},{"args":"<IP Address of Gateway>","description":"Recolecta estadísticas para Security Gateway con IP principal especificada durante 20 segundos (default)."},{"args":"<IP Address of Gateway> <Seconds>","description":"Recolecta estadísticas para Security Gateway con IP especificada durante número de segundos especificado."},{"args":"<IP Address of Gateway> -m","description":"Solo en Management Server. Ejecuta análisis sobre archivo /ips_tar.tgz previamente recolectado del Security Gateway con IP especificada."}]','ips','R81+','ips, statistics, performance, pattern matcher, cpu, analysis, tuning, protections, vsx','expert','query','firewall',0,'low','[]',0,'2026-01-01 13:21:43','2026-01-01 13:21:43');
INSERT INTO checkpoint_commands VALUES(43,'api','Controla el servidor API de administración de CheckPoint que permite la automatización y gestión programática del Management Server. Gestiona el inicio, parada y estado del servicio API Server que procesa peticiones REST para configuración remota, integración con sistemas de terceros (ticketing, virtualización, SIEM), scripts de automatización y acceso desde mgmt_cli o SmartConsole. Es esencial para entornos automatizados y DevOps.','[{"args":"restart","description":"Reinicia el servicio API Server del Management Server. Debe ejecutarse después de cambios en configuración de acceso API, permisos de administradores o configuración de Trusted Clients. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server usando ''mdsenv <Domain>''. Retorna ''API started successfully'' si el reinicio es exitoso. Útil para aplicar cambios de configuración sin reiniciar todo el servidor"},{"args":"status","description":"Muestra el estado actual del API Server incluyendo: estado general (Started/Stopped), estado de disponibilidad del servidor, readiness test (si puede recibir conexiones), estado de procesos individuales del API, PID de cada proceso. Retorna ''Overall API Status: Started'' y ''API readiness test SUCCESSFUL'' cuando está operativo. Puede mostrar proceso API como ''Stopped'' si hay más de 200 Trusted Clients configurados con acceso GUI. Útil para verificar que el API está listo para recibir peticiones antes de ejecutar scripts de automatización"},{"args":"start","description":"Inicia el servicio API Server en el Management Server si estaba detenido. Habilita la capacidad de recibir peticiones API desde mgmt_cli, SmartConsole o web services según la configuración de acceso definida. Requiere que Automatic start esté configurado o se ejecute manualmente después de cada reinicio del servidor"},{"args":"stop","description":"Detiene el servicio API Server completamente. Bloquea todas las conexiones API entrantes desde mgmt_cli, SmartConsole y web services. Útil para mantenimiento del Management Server o cuando se necesita asegurar que no hay cambios automáticos durante operaciones críticas. Requiere reinicio manual posterior con ''api start'' o ''api restart''"}]','management_api','R81+','api, management api, servidor api, automation, rest api, mgmt_cli, web services, smartconsole integration, devops, orchestration, scripting, remote management, api server control, service management','expert','config','management',1,'medium','[]',0,'2026-01-01 13:47:56','2026-01-01 13:47:56');
INSERT INTO checkpoint_commands VALUES(44,'contract_util','Gestiona los Service Contracts de CheckPoint que determinan elegibilidad para upgrades, actualizaciones y soporte. Permite verificar si un Security Gateway o Management Server puede actualizar a versiones mayores/menores o Hotfix Accumulators, descargar contratos desde User Center o archivos locales, distribuir información de contratos desde Management Server a Gateways gestionados, verificar licencias cubiertas por el contrato y actualizar información de contratos automáticamente. Esencial para planificación de actualizaciones y gestión de ciclo de vida de la infraestructura CheckPoint.','[{"args":"check hfa","description":"Verifica si el Security Gateway es elegible para actualizar a un Hotfix Accumulator superior según el Service Contract activo. Retorna código de estado indicando si puede actualizar. Usar antes de iniciar proceso de actualización de HFA para confirmar cobertura del contrato"},{"args":"check maj_upgrade","description":"Verifica elegibilidad para actualización a versión Major superior (ejemplo: de R80.40 a R81). Comprueba si el Service Contract cubre este tipo de upgrade. Esencial antes de planificar migraciones de versión mayor"},{"args":"check min_upgrade","description":"Verifica elegibilidad para actualización a versión Minor superior (ejemplo: de R81.10 a R81.20). Comprueba cobertura en el Service Contract para upgrades menores"},{"args":"check upgrade","description":"Verifica elegibilidad general para cualquier tipo de actualización (Major, Minor o HFA). Chequeo rápido de estado de contrato y capacidad de upgrade"},{"args":"verify","description":"Similar a ''check'' pero interpreta códigos de retorno y muestra mensajes significativos en texto claro explicando si puede actualizar y por qué. Más amigable que ''check'' para troubleshooting manual. No requiere interpretar códigos de error numéricos"},{"args":"cpmacro /<path_to>/cp.macro","description":"Sobrescribe el archivo cp.macro actual con el archivo especificado solo si el nuevo es más reciente. El archivo cp.macro contiene información de productos y versiones CheckPoint. Retorna código: -1 (fallo), 0 (sobrescrito exitosamente porque el nuevo es más nuevo), 1 (no sobrescrito porque el actual ya es más nuevo). Útil para actualizar información de producto manualmente"},{"args":"download local <Service_Contract_File>","description":"Descarga/instala Service Contract desde archivo local previamente descargado del User Center. Equivalente a ''cplic contract put''. Opciones adicionales: hfa, maj_upgrade, min_upgrade, upgrade para especificar tipo de información a descargar. Útil en entornos sin acceso directo a Internet"},{"args":"download uc <Username> <Password>","description":"Descarga Service Contracts automáticamente desde User Center usando credenciales. Opciones: -i para modo interactivo (pide credenciales), proxy settings para entornos con proxy. Puede especificar tipo: hfa, maj_upgrade, min_upgrade, upgrade. Actualiza contratos directamente desde CheckPoint User Center"},{"args":"mgmt","description":"Distribuye información de Service Contract desde el Management Server a todos los Security Gateways gestionados. Ejecutar en Management Server después de actualizar contratos para sincronizar información a todos los gateways del dominio"},{"args":"print hfa","description":"Muestra todas las licencias instaladas e indica si están cubiertas por el Service Contract para upgrades de Hotfix Accumulator. Opción -d muestra tabla formateada con headers y más detalles. Identifica licencias no reconocidas por el contrato"},{"args":"print maj_upgrade","description":"Muestra licencias instaladas y cobertura del Service Contract para actualizaciones Major. Útil para planificar migración a nueva versión mayor y verificar qué blades/features están cubiertos"},{"args":"print min_upgrade","description":"Muestra licencias y cobertura para actualizaciones Minor. Verifica qué licencias permiten upgrade a versión menor superior"},{"args":"print upgrade","description":"Vista general de todas las licencias y su elegibilidad para cualquier tipo de upgrade según el contrato activo"},{"args":"summary hfa","description":"Muestra resumen post-instalación y elegibilidad para Hotfix Accumulators. Vista consolidada del estado de actualización HFA"},{"args":"summary maj_upgrade","description":"Resumen de elegibilidad para actualizaciones Major version. Muestra si el sistema puede migrar a versión mayor"},{"args":"summary min_upgrade","description":"Resumen de elegibilidad para actualizaciones Minor version"},{"args":"summary upgrade","description":"Resumen general post-instalación mostrando elegibilidad para todo tipo de actualizaciones"},{"args":"update","description":"Actualiza automáticamente los Service Contracts desde User Center usando credenciales configuradas en la base de datos de management. Opciones: -proxy <server>:<port> para especificar proxy, -ca_path <path> para especificar certificados CA. Actualiza solo contratos asociados a licencias preinstaladas. Útil para mantener información de contratos actualizada automáticamente"}]','licensing','R81+','service contract, licencias, upgrade eligibility, user center, actualizaciones, hotfix accumulator, major version, minor version, contrato de servicio, soporte, lifecycle management, update planning, license verification, cp.macro','expert','query','management',1,'low','[]',0,'2026-01-01 13:48:38','2026-01-01 13:48:38');
INSERT INTO checkpoint_commands VALUES(45,'cp_conf','Configura y reconfigura instalaciones de productos CheckPoint en Management Server. Permite gestionar administradores del sistema, configurar arranque automático de servicios, inicializar Certificate Authority interna (ICA), configurar clientes GUI autorizados (Trusted Clients para SmartConsole), gestionar licencias y ver fingerprints de certificados. Cada opción corresponde a secciones del menú cpconfig. Es la herramienta principal de configuración inicial y mantenimiento del Management Server.','[{"args":"-h","description":"Muestra el uso completo del comando con todas las opciones disponibles según el tipo de dispositivo (Management Server o Security Gateway)"},{"args":"admin add <UserName> <Password> {a|w|r}","description":"Añade un administrador del sistema CheckPoint al Management Server especificando: username, password y nivel de permisos. Permisos: ''a'' (all - lectura, escritura y gestión de otros admins), ''w'' (write - lectura y escritura sin gestión de admins), ''r'' (read-only - solo lectura). Solo se puede definir un admin en cpconfig, para más admins usar SmartConsole. Útil para configuración inicial o recuperación de acceso"},{"args":"admin add -gaia {a|w|r}","description":"Añade al usuario administrador de Gaia ''admin'' como administrador CheckPoint con permisos especificados (a/w/r). Integra el admin del sistema operativo Gaia con permisos de administración CheckPoint"},{"args":"admin del <UserName1> <UserName2> ...","description":"Elimina uno o más administradores del sistema especificados por sus usernames. Permite eliminar múltiples admins en un solo comando"},{"args":"admin get","description":"Lista todos los administradores del sistema CheckPoint configurados actualmente en el Management Server mostrando sus usernames y niveles de permiso"},{"args":"admin get -gaia","description":"Muestra los permisos de administración CheckPoint asignados al usuario ''admin'' de Gaia"},{"args":"auto get","description":"Muestra qué servicios y productos CheckPoint están configurados para arrancar automáticamente durante el boot del sistema. Lista procesos configurados para autostart"},{"args":"auto set","description":"Configura qué servicios CheckPoint deben iniciar automáticamente al arrancar el servidor. Permite habilitar/deshabilitar autostart de componentes específicos"},{"args":"ca init","description":"Inicializa la Internal Certificate Authority (ICA) del Management Server. Genera certificados raíz y estructura PKI interna. Ejecutar solo durante setup inicial o al recrear la CA. Proceso destructivo si ya existe ICA previa"},{"args":"ca FQDN <Fully_Qualified_Domain_Name>","description":"Configura el Fully Qualified Domain Name (FQDN) de la Certificate Authority interna. El FQDN debe ser resolvible y accesible por todos los componentes que validarán certificados emitidos por esta CA"},{"args":"client add <IP_Address>","description":"Añade una dirección IP a la lista de Trusted Clients que pueden conectar con SmartConsole al Management Server. Permite acceso GUI desde esa IP específica. Esencial para controlar qué estaciones pueden administrar el sistema"},{"args":"client del <IP_Address>","description":"Elimina una IP de la lista de Trusted Clients bloqueando futuras conexiones SmartConsole desde esa dirección. Útil para revocar acceso de estaciones comprometidas o no autorizadas"},{"args":"client get","description":"Lista todas las direcciones IP configuradas como Trusted Clients autorizados para conectar con SmartConsole. Muestra la lista completa de IPs con permiso de acceso GUI"},{"args":"finger get","description":"Muestra el fingerprint (huella digital) del certificado de la Internal Certificate Authority. Este fingerprint se usa para verificar identidad del servidor durante establecimiento de SIC (Secure Internal Communication) con gateways. Crítico para primera conexión de gateways al management"},{"args":"lic get","description":"Muestra las licencias CheckPoint instaladas actualmente en el Management Server incluyendo features habilitados, fechas de expiración y estado"},{"args":"lic set","description":"Permite instalar o modificar licencias CheckPoint en el Management Server. Proceso interactivo para añadir nuevas licencias o actualizar existentes"}]','management_configuration','R81+','configuration, management server, cpconfig, administrators, auto start, certificate authority, ica, trusted clients, gui clients, smartconsole, licensing, fingerprint, initial setup, reconfiguration','expert','config','management',0,'medium','[]',0,'2026-01-01 13:49:13','2026-01-01 13:49:13');
INSERT INTO checkpoint_commands VALUES(46,'cp_log_export','Exporta logs de CheckPoint vía syslog a servidores remotos para integración con SIEM, sistemas de monitoreo centralizados o plataformas de análisis de logs. Permite configurar múltiples exporters simultáneos, cada uno con su destino, protocolo, filtros y formato específico. Soporta reexportación de logs históricos, gestión de gaps en exportación y configuración granular de qué logs enviar. Solo ejecutable en modo Expert y en Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Esencial para compliance, auditoría y correlación de eventos de seguridad.','[{"args":"add name <n> target-server <TargetServer> target-port <Port> protocol {udp|tcp}","description":"Configura un nuevo Check Point Log Exporter para enviar logs vía syslog a un servidor remoto. Especifica nombre del exporter, servidor destino, puerto y protocolo (UDP o TCP). Argumentos opcionales permiten filtrado de logs, formato y otras configuraciones. Esencial para integración con SIEM o sistemas de logging centralizados"},{"args":"delete name <n>","description":"Elimina un Log Exporter existente especificado por su nombre. Detiene el envío de logs y elimina la configuración permanentemente"},{"args":"reconf [name <n>]","description":"Aplica la configuración de Log Exporter a todos los exporters existentes o a uno específico si se indica el nombre. Usa después de cambios en configuración para aplicar cambios sin reiniciar"},{"args":"reexport name <n> --apply-now","description":"Resetea la posición actual del log y reexporta todos los logs desde el inicio basado en la configuración. Útil para reenviar logs históricos después de problemas de conectividad o configuración errónea"},{"args":"reexport name <n> start-position <Position> --apply-now","description":"Reexporta logs desde una posición específica del último log exportado. Permite recuperar logs desde un punto conocido sin reexportar todo el historial"},{"args":"reexport name <n> start-position <Start> end-position <End> --apply-now","description":"Reexporta logs de un rango específico entre posición de inicio y fin. Útil para rellenar gaps en logs exportados causados por caídas del servicio o problemas de red"},{"args":"restart name <n>","description":"Reinicia el proceso de un Log Exporter específico. Aplica cambios de configuración y reinicia el envío de logs sin afectar otros exporters"},{"args":"set name <n>","description":"Actualiza la configuración de un Log Exporter existente. Permite modificar servidor destino, puerto, protocolo, filtros y otras opciones sin eliminar y recrear el exporter"},{"args":"show","description":"Muestra la configuración actual de todos los Log Exporters incluyendo servidor destino, puerto, protocolo, filtros aplicados y estado. Argumentos opcionales permiten filtrar salida"},{"args":"start name <n>","description":"Inicia un proceso de Log Exporter existente que estaba detenido. Comienza el envío de logs al servidor configurado"},{"args":"status","description":"Muestra resumen del estado de todos los Log Exporters incluyendo si están activos, última posición de log exportado, errores de conexión y estadísticas. Argumentos opcionales permiten detallar exporter específico"}]','logging','R81+','log export, syslog, logging, siem integration, log forwarding, log exporter, remote logging, centralized logging, audit logs, compliance, log monitoring, tcp syslog, udp syslog','expert','config','management',0,'low','[]',0,'2026-01-01 13:49:44','2026-01-01 13:49:44');
INSERT INTO checkpoint_commands VALUES(47,'cpca_client','Ejecuta operaciones sobre la Internal Certificate Authority (ICA) del Management Server. Permite crear certificados, revocar certificados existentes, gestionar la CRL (Certificate Revocation List), configurar parámetros de firma, listar certificados emitidos, obtener claves públicas y administrar todo el ciclo de vida de certificados PKI internos. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Esencial para gestión de VPNs, autenticación de gateways y servicios que requieren certificados firmados internamente.','[{"args":"create_cert","description":"Crea un nuevo certificado firmado por la Internal Certificate Authority (ICA). Permite especificar DN (Distinguished Name), validez, tipo de certificado y otros parámetros. Útil para generar certificados para VPNs, gateways o servicios internos"},{"args":"double_sign","description":"Firma doblemente un certificado usando la ICA. Permite compatibilidad con sistemas que requieren múltiples firmas o certificados intermedios"},{"args":"get_crldp","description":"Obtiene la CRL Distribution Point (punto de distribución de lista de revocación de certificados) configurada en la ICA. Muestra la URL donde los clientes pueden verificar certificados revocados"},{"args":"get_pubkey","description":"Obtiene la clave pública de la Internal Certificate Authority. Permite verificar certificados emitidos y establecer confianza con la CA"},{"args":"init_certs","description":"Inicializa el sistema de certificados de la ICA. Regenera certificados base y estructura PKI. Ejecutar con precaución ya que puede invalidar certificados existentes"},{"args":"lscert","description":"Lista todos los certificados emitidos por la ICA mostrando DN, fecha de emisión, validez, estado (activo/revocado) y número de serie. Útil para auditoría de certificados"},{"args":"revoke_cert","description":"Revoca un certificado existente emitido por la ICA. El certificado se marca como inválido y se añade a la CRL. Requiere especificar número de serie o DN del certificado"},{"args":"revoke_non_exist_cert","description":"Revoca un certificado que no existe en la base de datos de la ICA pero debe marcarse como revocado preventivamente. Útil para revocar certificados perdidos o comprometidos"},{"args":"search","description":"Busca certificados en la base de datos de la ICA por DN, número de serie, estado o fecha. Permite filtrado avanzado para auditoría y troubleshooting"},{"args":"set_cert_validity","description":"Configura el período de validez predeterminado para nuevos certificados emitidos por la ICA. Especifica días, meses o años de validez"},{"args":"set_mgmt_tool","description":"Configura la herramienta de gestión para operaciones de la ICA. Define qué interfaz usar para administrar certificados"},{"args":"set_sign_hash","description":"Configura el algoritmo de hash usado para firmar certificados (SHA-256, SHA-384, SHA-512). Importante para compatibilidad y seguridad de certificados emitidos"}]','certificate_management','R81+','certificate authority, ica, pki, certificates, ssl, tls, certificate revocation, crl, public key, certificate signing, vpn certificates, gateway authentication, certificate lifecycle','expert','config','management',0,'high','[]',0,'2026-01-01 13:50:24','2026-01-01 13:50:24');
INSERT INTO checkpoint_commands VALUES(48,'cpca_create','Crea una nueva base de datos de Internal Certificate Authority (ICA) en el Management Server desde cero. Genera la estructura PKI completa incluyendo certificado raíz de la CA, claves privadas, base de datos de certificados y configuración inicial. Este comando es destructivo - elimina cualquier ICA existente y todos los certificados previamente emitidos quedarán inválidos. Debe ejecutarse solo durante configuración inicial del Management Server o cuando se requiere recrear completamente la infraestructura PKI. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Crítico para establecer confianza entre componentes CheckPoint.','[{"args":"-dn <CA_DN>","description":"Crea una nueva base de datos de Internal Certificate Authority especificando el Distinguished Name (DN) de la CA. El DN debe seguir formato X.500 (ejemplo: CN=MyCA,O=MyOrg,C=US). Proceso destructivo que elimina la ICA existente y crea una completamente nueva. Todos los certificados emitidos por la CA anterior quedarán inválidos. Usar solo durante setup inicial o cuando se necesita recrear completamente la PKI interna"},{"args":"-d -dn <CA_DN>","description":"Ejecuta la creación de la ICA en modo debug mostrando información detallada del proceso. El modo debug debe usarse solo para troubleshooting. Se recomienda redirigir output a archivo para análisis posterior"}]','certificate_management','R81+','certificate authority, ica creation, pki initialization, ca database, root certificate, certificate infrastructure, ca setup, initial configuration, destructive operation','expert','config','management',0,'critical','[]',0,'2026-01-01 13:50:48','2026-01-01 13:50:48');
INSERT INTO checkpoint_commands VALUES(49,'cpconfig','Inicia la Check Point Configuration Tool, una utilidad interactiva basada en menú que permite configurar ajustes específicos de productos CheckPoint instalados. Proporciona interfaz amigable para tareas de configuración que de otra forma requerirían múltiples comandos CLI individuales. Incluye opciones para gestionar administradores, licencias, Certificate Authority, Secure Internal Communication, SNMP, interfaces de red, servicios y configuraciones específicas de blades de seguridad. Las opciones mostradas varían según productos instalados y tipo de servidor (Management/Gateway). No soportado en Multi-Domain Server - usar mdsconfig. Herramienta esencial para configuración inicial y cambios de configuración guiados.','[{"args":"","description":"Inicia la herramienta de configuración interactiva de CheckPoint que presenta un menú con opciones para configurar productos instalados. Las opciones disponibles dependen de los productos y blades instalados. Permite configurar: administradores, licencias, certificados, SNMP, Secure Internal Communication (SIC), interfaces, servicios y otras configuraciones específicas de producto. En Multi-Domain Server usar mdsconfig en su lugar"}]','management_configuration','R81+','configuration tool, interactive configuration, setup wizard, cpconfig menu, initial setup, product configuration, guided configuration, system settings','expert','config','management',0,'medium','[]',0,'2026-01-01 13:51:03','2026-01-01 13:51:03');
INSERT INTO checkpoint_commands VALUES(50,'cpinfo','Utilidad de recopilación de datos de diagnóstico que captura un snapshot completo del estado del sistema CheckPoint en el momento de ejecución. Recolecta información exhaustiva del sistema operativo, configuración de CheckPoint, logs, estados de procesos, rendimiento, configuración de red, políticas y troubleshooting data. Genera archivo comprimido (.tgz) que contiene toda la información necesaria para análisis de problemas. Es obligatorio ejecutar cpinfo y proporcionar el archivo resultante cuando se abre caso con CheckPoint Support. El archivo puede ser muy grande (varios GB) dependiendo del tamaño de logs y configuración. Más información en sk92739. Herramienta fundamental para diagnóstico y soporte técnico.','[{"args":"","description":"Recopila datos de diagnóstico completos del sistema CheckPoint en el momento de ejecución. Genera archivo comprimido que contiene: logs del sistema, configuraciones, estado de procesos, información de licencias, versiones de software, tabla de ruteo, interfaces de red, uso de CPU y memoria, kernel parameters, políticas instaladas, conexiones activas y mucho más. El archivo generado es obligatorio cuando se contacta CheckPoint Support. El proceso puede tardar varios minutos y genera archivo grande. Uso de recursos intensivo durante ejecución"}]','diagnostics','R81+','diagnostics, troubleshooting, support, debug info, system information, log collection, cpinfo file, technical support, diagnostic data, system snapshot','expert','query','management',0,'low','[]',0,'2026-01-01 13:51:19','2026-01-01 13:51:19');
INSERT INTO checkpoint_commands VALUES(51,'cplic','Gestiona licencias de CheckPoint en Management Servers y Security Gateways. Permite instalar, eliminar, visualizar y gestionar licencias locales y remotas. Soporta tres tipos de operaciones: comandos de licenciamiento local (ejecutados localmente en cualquier equipo CheckPoint), comandos de licenciamiento remoto (ejecutados en Management Server para gestionar licencias de Gateways gestionados) y comandos de repositorio de licencias (gestionan licencias almacenadas en Management Server). Ejecutable tanto en Gaia Clish como en Expert mode. Incluye funciones para importar/exportar base de datos de licencias, gestionar Service Contracts, actualizar herramientas de licensing y migrar licencias entre versiones. Esencial para gestión de entitlements y cumplimiento de licensing.','[{"args":"print","description":"Muestra todas las licencias instaladas localmente en el Management Server o Gateway incluyendo: features habilitados, blades activos, fechas de expiración, número de usuarios/IPs permitidos, tipo de licencia (evaluation/commercial), SKU y estado. Ejecutable en Clish o Expert mode"},{"args":"get","description":"Obtiene y muestra licencias instaladas con formato detallado. Similar a ''print'' pero con información adicional de metadata y formato estructurado"},{"args":"put","description":"Instala una nueva licencia en el sistema local desde archivo. Requiere ruta al archivo de licencia descargado del User Center. Reemplaza o añade licencias según configuración"},{"args":"del","description":"Elimina una licencia específica del sistema local. Requiere identificador de licencia. Usar con precaución ya que puede deshabilitar funcionalidades"},{"args":"db_rm","description":"Elimina completamente la base de datos de licencias local y reinicia el sistema de licensing. Operación destructiva que requiere reinstalación de todas las licencias después"},{"args":"upgrade_tools get","description":"Obtiene herramientas de upgrade de licencias desde el repositorio. Parte del proceso de migración de licencias entre versiones de CheckPoint"},{"args":"upgrade_import","description":"Importa licencias upgrades durante migración de versión mayor. Convierte licencias de versiones antiguas al formato nuevo"},{"args":"contract put","description":"Instala archivo de Service Contract local que determina elegibilidad para upgrades. Equivalente a ''contract_util download local''"},{"args":"contract get","description":"Muestra información del Service Contract actualmente instalado incluyendo cobertura de upgrades y fecha de expiración del soporte"},{"args":"db_get -f <file>","description":"Exporta la base de datos completa de licencias a archivo para backup o migración. Permite restaurar licencias en otro servidor"},{"args":"db_set -f <file>","description":"Importa base de datos de licencias desde archivo previamente exportado. Útil para restaurar licencias después de reinstalación o migrar a nuevo hardware"}]','licensing','R81+','licensing, license management, cplic, license installation, license repository, service contract, license migration, blades licensing, features, entitlements, sku, license database','expert','config','management',1,'medium','[]',0,'2026-01-01 13:51:48','2026-01-01 13:51:48');
INSERT INTO checkpoint_commands VALUES(52,'cpstart','Inicia manualmente todos los procesos y aplicaciones de CheckPoint en el sistema. Activa todos los servicios configurados incluyendo firewall, VPN, IPS, Anti-Bot, Application Control, URL Filtering, logging, management services y cualquier blade habilitado. El comando ejecuta secuencia de inicio respetando dependencias entre servicios para asegurar arranque correcto. Muestra output detallado del progreso de inicio de cada componente. Utilizado típicamente después de cpstop, tras cambios de configuración que requieren reinicio de servicios, o después de boot del sistema cuando autostart está deshabilitado. Puede ejecutarse en Management Servers y Security Gateways. Comando fundamental para control de servicios CheckPoint.','[{"args":"","description":"Inicia manualmente todos los procesos y aplicaciones de CheckPoint incluyendo: Security Gateway daemons, Management Server services, VPN processes, logging services, monitoring services y todos los blades habilitados. El inicio es secuencial respetando dependencias entre servicios. Muestra progreso y estado de cada servicio iniciado. Puede tardar varios minutos en completarse. Requiere que los servicios estén previamente detenidos o tras reinicio del servidor"}]','service_control','R81+','start services, service control, daemon start, process start, checkpoint services, service startup, firewall start, vpn start, management start','expert','config','management',1,'medium','[]',0,'2026-01-01 13:52:20','2026-01-01 13:52:20');
INSERT INTO checkpoint_commands VALUES(53,'cpstop','Detiene manualmente todos los procesos y aplicaciones de CheckPoint en el sistema de forma controlada y secuencial. Para todos los servicios incluyendo firewall (dejando el sistema sin protección), VPN, IPS, Anti-Bot, management services, logging y todos los blades habilitados. La secuencia de parada respeta dependencias entre servicios para asegurar cierre limpio y prevenir corrupción de datos o estados inconsistentes. Durante cpstop el tráfico de red NO es inspeccionado ni filtrado. Utilizado antes de: mantenimiento del sistema, instalación de hotfixes o upgrades, cambios críticos de configuración, troubleshooting que requiere servicios detenidos, o shutdown del servidor. Debe ejecutarse con precaución en producción. Seguir siempre con cpstart cuando se complete la tarea.','[{"args":"","description":"Detiene manualmente todos los procesos y aplicaciones de CheckPoint de forma ordenada incluyendo: firewall, VPN, IPS, logging, management services y todos los blades activos. La parada es secuencial respetando dependencias para evitar corrupción de datos. Durante la ejecución el tráfico NO será inspeccionado. Muestra progreso de parada de cada servicio. Usado antes de mantenimiento, upgrades, cambios críticos de configuración o troubleshooting. ATENCIÓN: Deja el sistema sin protección - usar con precaución"}]','service_control','R81+','stop services, service control, daemon stop, process stop, checkpoint shutdown, service shutdown, firewall stop, maintenance mode, service halt','expert','config','management',0,'critical','[]',0,'2026-01-01 13:52:36','2026-01-01 13:52:36');
INSERT INTO checkpoint_commands VALUES(54,'cpstat','Muestra estado y estadísticas en tiempo real de aplicaciones y servicios CheckPoint. Proporciona métricas detalladas de performance, throughput, uso de recursos, estado de servicios y contadores operacionales. Soporta monitoreo de múltiples componentes: firewall, VPN, High Availability, Policy Server, logging, IPS, Anti-Bot y sistema operativo. Puede ejecutarse en modo single-shot (una vez) o polling continuo para monitoreo prolongado. Permite consulta remota de gateways gestionados desde Management Server. Usa protocolo SNMP internamente para recolectar métricas del AMON (Application Monitoring) server en puerto 18192. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Herramienta fundamental para troubleshooting de performance, capacity planning y monitoreo operacional.','[{"args":"fw","description":"Muestra estadísticas del firewall incluyendo: paquetes aceptados/rechazados/descartados, conexiones activas, uso de tabla de conexiones, throughput, paquetes por segundo, hits en reglas de política y contadores de performance. Esencial para monitoreo de tráfico"},{"args":"polsrv","description":"Muestra estado del Policy Server incluyendo políticas instaladas, última actualización, número de reglas, objetos cargados en memoria y uso de recursos"},{"args":"fwd","description":"Muestra estadísticas del daemon de forwarding incluyendo throughput, paquetes procesados, conexiones establecidas, NAT translations activas y uso de CPU"},{"args":"vpn","description":"Muestra estadísticas de VPN incluyendo: túneles activos, IKE negotiations, encrypted packets, throughput de encriptación, Phase 1/2 SAs activas, errores de autenticación"},{"args":"ha","description":"Muestra estado de High Availability en clusters mostrando: estado de miembros (Active/Standby), sincronización, pnotes, critical devices, últimos failovers"},{"args":"os","description":"Muestra estadísticas del sistema operativo incluyendo: CPU usage por core, memoria RAM (usada/libre/cached), swap, disk I/O, network interfaces throughput, procesos activos"},{"args":"ifconfig","description":"Muestra configuración y estadísticas de interfaces de red incluyendo: IPs configuradas, estado (up/down), bytes TX/RX, errores, drops, collisions"},{"args":"mg","description":"Muestra estadísticas del Management Server incluyendo: sesiones de SmartConsole activas, usuarios conectados, procesos de management, uso de base de datos"},{"args":"-o <interval> -c <count>","description":"Ejecuta cpstat en modo de polling continuo cada <interval> segundos, repitiendo <count> veces. Útil para monitoreo en tiempo real y captura de métricas históricas"},{"args":"-o <interval> -e <period>","description":"Ejecuta cpstat continuamente cada <interval> segundos durante <period> segundos total. Permite monitoreo prolongado automático"},{"args":"-h <host>","description":"Ejecuta cpstat contra un host remoto especificado (Gateway gestionado). Permite monitoreo centralizado desde Management Server"},{"args":"-f <flavor>","description":"Especifica el flavor (tipo) de checkpoint a monitorear cuando hay múltiples instancias (VSX, Multi-Domain)"}]','monitoring','R81+','statistics, monitoring, performance metrics, cpstat, throughput, connections, resource usage, real-time monitoring, amon, snmp, firewall stats, vpn stats, cluster stats','expert','query','management',1,'low','[]',0,'2026-01-01 13:53:09','2026-01-01 13:53:09');
INSERT INTO checkpoint_commands VALUES(55,'cpview','Utilidad interactiva basada en texto que muestra datos estadísticos en tiempo real del sistema CheckPoint. Presenta información visual continua actualizada automáticamente sobre: CPU usage por core, memoria RAM y swap, espacio en disco, throughput de red, conexiones activas, tabla de conexiones, estadísticas de firewall, VPN, IPS, Anti-Bot, Application Control y otros blades habilitados (solo en Security Gateway). La interfaz tiene tres secciones: header (información general del sistema), vistas de blades (estadísticas específicas por blade) y footer (comandos de navegación). Permite navegar entre diferentes vistas usando teclas, hacer zoom en métricas específicas y exportar datos. En Security Gateways es fundamental para monitoreo de performance en tiempo real. Más información en sk101878. Herramienta de monitoreo visual más amigable que cpstat.','[{"args":"--help","description":"Muestra ayuda de uso de CPView con explicación de navegación y vistas disponibles"}]','monitoring','R81+','cpview, monitoring, real-time stats, interactive monitoring, visual monitoring, performance dashboard, system statistics, blade statistics, live monitoring','expert','query','management',0,'low','[]',0,'2026-01-01 13:53:53','2026-01-01 13:53:53');
INSERT INTO checkpoint_commands VALUES(56,'cpwd_admin','Gestiona el Check Point WatchDog (cpwd), proceso supervisor que invoca y monitorea procesos críticos de CheckPoint en el sistema local, reiniciándolos automáticamente si fallan. WatchDog supervisa daemons críticos como fwm, fwd, cpd, DAService y otros dependiendo de productos y blades instalados. Soporta dos tipos de monitoreo: Active (ping regular al proceso, restart si no responde) y Passive (restart solo si proceso termina anormalmente). El cpwd_admin permite ver estado de procesos monitoreados, configurar tipo de monitoreo, iniciar/parar/reiniciar procesos específicos y ajustar parámetros de supervisión. WatchDog escribe logs en $CPDIR/log/cpwd.elg. Herramienta fundamental para mantener disponibilidad y auto-recuperación de servicios CheckPoint críticos.','[{"args":"list","description":"Lista todos los procesos críticos monitoreados por Check Point WatchDog mostrando: nombre del proceso, PID, estado (running/stopped), tipo de monitoreo (Active/Passive), cantidad de reinicios, último evento. Muestra columna MON indicando si el monitoreo es activo (ping regular) o pasivo (solo restart si termina). Esencial para verificar salud de servicios CheckPoint"},{"args":"config set <process> {active|passive}","description":"Configura el tipo de monitoreo de un proceso específico. Active: WatchDog hace ping regular al proceso y lo reinicia si no responde. Passive: WatchDog solo reinicia el proceso si termina anormalmente. Permite ajustar nivel de supervisión según necesidad"},{"args":"del <process>","description":"Elimina un proceso de la lista de monitoreados por WatchDog. El proceso ya no será supervisado ni reiniciado automáticamente. Usar con precaución"},{"args":"start <process>","description":"Inicia un proceso específico monitoreado por WatchDog. WatchDog invoca el proceso y comienza su supervisión"},{"args":"stop <process>","description":"Detiene un proceso específico monitoreado por WatchDog de forma controlada. WatchDog deja de supervisar el proceso temporalmente"},{"args":"restart <process>","description":"Reinicia un proceso específico monitoreado por WatchDog. Detiene y vuelve a iniciar el proceso de forma controlada"},{"args":"config show","description":"Muestra la configuración completa de WatchDog incluyendo todos los procesos monitoreados, sus parámetros de monitoreo, intervalos de ping, acciones de restart y configuraciones específicas"}]','service_control','R81+','watchdog, cpwd, process monitoring, daemon monitoring, auto restart, service supervision, process management, high availability, auto recovery, critical processes','expert','config','management',1,'medium','[]',0,'2026-01-01 13:54:14','2026-01-01 13:54:14');
INSERT INTO checkpoint_commands VALUES(57,'dbedit','Edita directamente la base de datos de management ($FWDIR/conf/objects_5_0.C) en Security Management Server o Domain Management Server. Herramienta de bajo nivel extremadamente poderosa y peligrosa que permite modificar objetos, reglas, políticas y configuraciones directamente en la base de datos sin validaciones de SmartConsole. IMPORTANTE: NO ejecutar este comando a menos que sea explícitamente instruido por CheckPoint Support o R&D - uso incorrecto puede corromper completamente la base de datos y dejar el sistema inutilizable. Requiere conocimiento profundo de estructura de base de datos CheckPoint. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Soporta modo interactivo o ejecución de scripts. Más información en sk13301. Usar siempre con extrema precaución y después de backup completo.','[{"args":"-help","description":"Muestra ayuda completa del comando con todos los parámetros y opciones disponibles"},{"args":"-local","description":"Conecta a la base de datos local del Management Server. Modo predeterminado cuando se ejecuta directamente en el servidor"},{"args":"-s <Management_Server>","description":"Conecta a base de datos de un Management Server remoto especificado. Permite edición remota desde otro sistema"},{"args":"-u <Username> -p <Password>","description":"Autentica con credenciales de usuario especificadas. Requiere permisos de administrador de base de datos"},{"args":"-c <Certificate>","description":"Autentica usando certificado en lugar de usuario/password. Método preferido para scripts automatizados"},{"args":"-f <File_Name>","description":"Ejecuta comandos dbedit desde archivo de script. Permite automatización de cambios en base de datos. Opción ignore_script_failure continúa si hay errores. Opción -continue_updating mantiene cambios parciales"},{"args":"-r \"<Reason_Text>\"","description":"Especifica razón para abrir sesión de edición. Se registra en logs de auditoría. Obligatorio en entornos con compliance estricto"},{"args":"-d <Database_Name>","description":"Especifica nombre de base de datos a editar si hay múltiples bases. Por defecto usa objects_5_0.C"},{"args":"-globallock","description":"Obtiene lock global de la base de datos previniendo que otros administradores hagan cambios simultáneos. Usa con precaución"},{"args":"-readonly","description":"Abre la base de datos en modo solo lectura. Permite consultas sin riesgo de modificaciones accidentales"},{"args":"-session","description":"Trabaja con la sesión actual de SmartConsole en lugar de la base de datos guardada. Permite ver cambios no publicados"}]','database_management','R81+','database edit, dbedit, management database, objects database, low-level edit, database corruption risk, advanced troubleshooting, emergency recovery','expert','config','management',0,'critical','[]',0,'2026-01-01 13:55:04','2026-01-01 13:55:04');
INSERT INTO checkpoint_commands VALUES(58,'fwm','Realiza operaciones de management y muestra información del sistema de gestión CheckPoint. Comando de bajo nivel que expone funciones del daemon fwm (FireWall Management) responsable de gestionar políticas, objetos, comunicación con gateways y operaciones administrativas. Incluye funciones para: cargar base de datos, exportar certificados, descargar archivos de gateways remotos, capturar tráfico, gestionar VPN/IKE, instalar políticas y exportar logs. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server. Para instrucciones de debug ver sk97638. Herramienta avanzada para administradores experimentados que necesitan operaciones de management a nivel de sistema. Requiere conocimiento profundo de arquitectura CheckPoint.','[{"args":"dbload","description":"Carga la base de datos de management en memoria. Permite refrescar objetos y políticas después de cambios manuales en archivos de configuración"},{"args":"exportcert","description":"Exporta certificados del Management Server para distribución o backup. Permite extraer certificados de la ICA en formato PEM o DER"},{"args":"fetchfile","description":"Descarga archivos desde gateways gestionados al Management Server. Útil para recolectar logs, configuraciones o archivos de troubleshooting remotamente"},{"args":"fingerprint","description":"Muestra el fingerprint (huella digital) del certificado del Management Server usado para SIC. Equivalente a ''cp_conf finger get''"},{"args":"getpcap","description":"Captura tráfico de red en formato PCAP desde gateways gestionados remotamente. Permite troubleshooting de conectividad sin acceso directo al gateway"},{"args":"ikecrypt","description":"Gestiona encriptación IKE para VPNs. Permite configurar algoritmos de encriptación y parámetros de IKE negotiations"},{"args":"load","description":"Instala política en Security Gateways gestionados. Envía políticas compiladas desde Management Server a gateways. Equivalente a ''Install Policy'' en SmartConsole pero vía CLI"},{"args":"logexport","description":"Exporta logs del Management Server en diferentes formatos (texto, CSV, PDF). Permite extracción de logs para análisis externo, compliance o archivado"},{"args":"-d <comando>","description":"Ejecuta cualquier subcomando de fwm en modo debug mostrando información detallada del proceso. Usar solo para troubleshooting según instrucciones en sk97638"}]','management_operations','R81+','fwm, management operations, policy installation, certificate export, remote file fetch, pcap capture, log export, database load, advanced management','expert','config','management',0,'high','[]',0,'2026-01-01 13:55:30','2026-01-01 13:55:30');
INSERT INTO checkpoint_commands VALUES(59,'mgmt_cli','Herramienta de línea de comandos para interactuar directamente con la Management API de CheckPoint. Permite automatización completa de tareas administrativas mediante scripts: crear/modificar/eliminar objetos (hosts, networks, services, grupos), gestionar reglas de políticas, instalar políticas en gateways, configurar VPNs, gestionar usuarios, exportar/importar configuraciones y ejecutar cualquier operación disponible en SmartConsole. Funciona mediante sesiones: primero login, luego operaciones, publish para guardar cambios y logout al finalizar. Soporta output en JSON para integración con scripts. Incluido en Gaia OS y disponible como mgmt_cli.exe en Windows desde instalación de SmartConsole. Fundamental para DevOps, automatización, integración con sistemas de terceros (ticketing, CMDB, orchestration) y gestión programática del Management Server. Ver documentación completa en https://&lt;Management_IP&gt;/api_docs.','[{"args":"login user <user> password <pass>","description":"Inicia sesión en el Management API y retorna session ID para comandos subsecuentes. El session ID debe usarse en todos los comandos siguientes con ''-s <session_id>''. Sin login exitoso no se pueden ejecutar operaciones API"},{"args":"add host name <name> ip-address <ip>","description":"Crea un nuevo objeto host en la base de datos de management especificando nombre e IP. Permite crear objetos vía API. Requiere publish para guardar permanentemente"},{"args":"set host name <name> ip-address <new_ip>","description":"Modifica un objeto host existente cambiando su IP u otros parámetros. Permite actualización de objetos vía API"},{"args":"delete host name <name>","description":"Elimina un objeto host de la base de datos. Requiere publish para aplicar cambio permanentemente"},{"args":"show host name <name>","description":"Muestra detalles completos de un objeto host especificado incluyendo todos sus atributos y metadata"},{"args":"show hosts limit <n> offset <m>","description":"Lista objetos hosts con paginación. Limit especifica cuántos objetos retornar, offset especifica desde qué posición empezar. Útil para listar muchos objetos"},{"args":"install-policy policy-package <name> target <gateway>","description":"Instala política en gateway especificado. Equivalente a ''Install Policy'' en SmartConsole pero vía API. Permite automatización de instalaciones"},{"args":"publish","description":"Publica cambios realizados en la sesión actual haciéndolos permanentes en la base de datos. Sin publish los cambios se pierden al cerrar sesión. SIEMPRE ejecutar publish después de cambios"},{"args":"discard","description":"Descarta todos los cambios no publicados realizados en la sesión actual. Revierte a estado anterior a los cambios"},{"args":"logout","description":"Cierra la sesión API y libera recursos. Descarta cambios no publicados. SIEMPRE ejecutar logout al finalizar"},{"args":"-f json","description":"Formato de output en JSON. Permite parsing automático de respuestas en scripts. Otras opciones: -f text (texto plano)"},{"args":"-r true","description":"Modo root context en Multi-Domain Server. Permite operaciones a nivel de MDS en lugar de dominio específico"},{"args":"--domain <domain_name>","description":"Especifica dominio objetivo en Multi-Domain Server. Ejecuta operaciones en ese dominio específico"}]','management_api','R81+','management api, mgmt_cli, api automation, rest api, scripting, devops, object management, policy management, automation tool, api client, json api','expert','config','management',0,'high','[]',0,'2026-01-01 13:55:58','2026-01-01 13:55:58');
INSERT INTO checkpoint_commands VALUES(60,'cppkg','Gestiona el repositorio de paquetes de software SmartUpdate en el Security Management Server. Permite añadir, eliminar, listar y administrar paquetes de software CheckPoint que posteriormente pueden ser desplegados en Security Gateways gestionados. El repositorio almacena hotfixes, service packs, upgrades de versión y paquetes de instalación. IMPORTANTE: La instalación de paquetes con SmartUpdate NO está soportada en Security Gateways con Gaia OS - usar procedimientos nativos de Gaia. Solo ejecutable en modo Expert. En Multi-Domain Server debe ejecutarse en contexto del MDS (run mdsenv). Usado principalmente para mantener repositorio centralizado de software para distribución controlada a gateways legacy.','[{"args":"add","description":"Añade paquetes de software al repositorio SmartUpdate en el Management Server. Permite subir paquetes de instalación, hotfixes, upgrades para posterior distribución a gateways"},{"args":"del","description":"Elimina paquetes de software del repositorio SmartUpdate. Libera espacio eliminando versiones antiguas o paquetes no utilizados"},{"args":"delete","description":"Alias de ''del''. Elimina paquetes del repositorio"},{"args":"get","description":"Muestra información de paquetes específicos en el repositorio incluyendo versión, tamaño, fecha y compatibilidad"},{"args":"getroot","description":"Muestra la ruta raíz actual del repositorio de paquetes SmartUpdate donde se almacenan los archivos"},{"args":"print","description":"Lista todos los paquetes disponibles en el repositorio SmartUpdate mostrando nombre, versión, tipo y tamaño"},{"args":"setroot","description":"Configura la ruta raíz del repositorio SmartUpdate. Permite cambiar ubicación de almacenamiento de paquetes a otro directorio o volumen"}]','software_management','R81+','smartupdate, software repository, package management, hotfix repository, upgrade packages, software distribution, package repository','expert','config','management',0,'medium','[]',0,'2026-01-01 13:57:02','2026-01-01 13:57:02');
INSERT INTO checkpoint_commands VALUES(61,'cpprod_util','Utilidad para trabajar con el Check Point Registry ($CPDIR/registry/HKLM_registry.data) sin necesidad de editar manualmente el archivo. Permite consultar y modificar qué productos y features de CheckPoint están habilitados en el sistema. El registro CheckPoint almacena configuración de blades, licencias activas, features habilitados y parámetros de productos. Útil para verificar qué componentes están activos, habilitar/deshabilitar features específicas o troubleshooting de problemas de configuración de productos. PRECAUCIÓN: Modificar valores en el registro puede causar mal funcionamiento del sistema - usar solo bajo instrucción de CheckPoint Support. Alternativa más segura que edición manual del archivo de registro.','[{"args":"CPPROD_GetValue \"<Product>\" \"<Parameter>\" {0|1}","description":"Obtiene el valor de un parámetro específico de un producto CheckPoint desde el registro. Muestra si una feature o blade está habilitado (1) o deshabilitado (0). Permite consultar estado de productos sin editar manualmente el archivo de registro"},{"args":"CPPROD_SetValue \"<Product>\" \"<Parameter>\" {1|4} \"<Value>\" {0|1}","description":"Establece el valor de un parámetro de producto en el registro CheckPoint. Permite habilitar (1) o deshabilitar (0) productos y features. Tipo 1 para valores string, tipo 4 para valores numéricos. ATENCIÓN: Modificar registro puede causar comportamiento inesperado - usar solo bajo instrucciones de Support"},{"args":"-dump","description":"Vuelca todo el contenido del registro CheckPoint mostrando todos los productos, parámetros y valores configurados. Útil para auditoría completa de configuración de productos"}]','system_configuration','R81+','registry, product configuration, feature enablement, blade configuration, product registry, system registry, feature toggle','expert','config','management',0,'high','[]',0,'2026-01-01 13:57:20','2026-01-01 13:57:20');
INSERT INTO checkpoint_commands VALUES(62,'cprid','Gestiona el Check Point Remote Installation Daemon (cprid), servicio responsable de permitir instalación y upgrade remotos de productos CheckPoint en Security Gateways gestionados. El daemon cprid debe estar corriendo tanto en Management Server como en gateways objetivo para que funcionen operaciones de SmartUpdate y cprinstall. Requiere SIC trust establecido entre Management Server y Gateway. Solo ejecutable en modo Expert. En Multi-Domain Server debe ejecutarse en contexto del MDS (run mdsenv). Fundamental para distribución remota de software, hotfixes y upgrades a gateways sin acceso directo a cada sistema.','[{"args":"start","description":"Inicia el daemon Check Point Remote Installation Daemon (cprid) que permite instalación y upgrade remotos de productos CheckPoint en gateways gestionados. Comando: cpridstart"},{"args":"stop","description":"Detiene el daemon cprid. Previene instalaciones remotas mientras el daemon está detenido. Comando: cpridstop"}]','remote_installation','R81+','remote installation, cprid daemon, software deployment, remote upgrade, smartupdate daemon, installation daemon','expert','config','management',1,'medium','[]',0,'2026-01-01 14:00:58','2026-01-01 14:00:58');
INSERT INTO checkpoint_commands VALUES(66,'cpstart','Inicia manualmente todos los procesos y aplicaciones CheckPoint en el sistema local. Ejecuta el arranque ordenado de servicios: primero procesos fundamentales (cpwd, fwd), luego servicios core (cpd, fwm en Management, fw en Gateway), después blades de seguridad y finalmente servicios auxiliares. Respeta dependencias entre servicios y espera a que cada proceso esté completamente operativo antes de iniciar el siguiente. Esencial para recuperación después de cpstop, mantenimiento del sistema o troubleshooting de servicios específicos. NO inicia cprid daemon (usar comando cprid separadamente). Verifica logs en $CPDIR/log/ y /var/log/messages para confirmar inicio exitoso.','[{"args":"","description":"Sin argumentos inicia todos los servicios CheckPoint en orden: (1) CPWatchDog (cpwd) que supervisa otros procesos, (2) daemons fundamentales (fwd para logs, cpd para SmartConsole connectivity), (3) en Management: fwm (policy management), en Gateway: fw (packet filtering), (4) blades activos según licencias (IPS, Application Control, URL Filtering, etc), (5) servicios adicionales (VPN, clustering, UserAuth). Retorna mensaje por cada servicio indicando éxito/fallo. Proceso completo toma 1-3 minutos típicamente. Verificar con ''cpwd_admin list'' que todos los procesos están ''Alive''"}]','service_management','R81+','start services, service management, process startup, daemon start, cpwd, fwm, fwd, cpd, service recovery, system startup, checkpoint processes, maintenance, troubleshooting, service control','expert','config','firewall',0,'high','[]',0,'2026-01-01 18:29:52','2026-01-01 18:29:52');
INSERT INTO checkpoint_commands VALUES(67,'cpstop','Detiene manualmente todos los procesos y aplicaciones CheckPoint en el sistema local de forma ordenada. Ejecuta shutdown controlado: primero detiene blades de seguridad y servicios auxiliares, luego procesos core (fw en Gateway, fwm en Management), después daemons fundamentales (cpd, fwd) y finalmente CPWatchDog. Permite cierre limpio de conexiones, flush de buffers a disco, guardado de estado y liberación ordenada de recursos. CRÍTICO: En Security Gateway detiene inspección de tráfico completamente - todo el tráfico será bloqueado. En cluster HA causa failover al peer. Usar solo para mantenimiento planificado, troubleshooting o antes de shutdown del servidor. NO detiene cprid daemon (usar comando cprid separadamente).','[{"args":"","description":"Sin argumentos detiene todos los servicios CheckPoint en orden inverso al startup: (1) servicios auxiliares y blades, (2) en Gateway: fw (DETIENE INSPECCIÓN - tráfico bloqueado), en Management: fwm, (3) cpd y fwd, (4) CPWatchDog (cpwd). En clusters causa failover inmediato. Retorna mensaje por cada servicio detenido. Proceso toma 30-90 segundos típicamente. Verificar con ''cpwd_admin list'' o ''ps -ef | grep cp'' que procesos están detenidos. ADVERTENCIA: En producción usar solo en ventanas de mantenimiento autorizadas"}]','service_management','R81+','stop services, service management, process shutdown, daemon stop, maintenance mode, service control, graceful shutdown, checkpoint processes, troubleshooting, emergency stop, firewall down, planned outage','expert','config','firewall',0,'critical','[]',0,'2026-01-01 18:29:53','2026-01-01 18:29:53');
INSERT INTO checkpoint_commands VALUES(68,'cpwd_admin','Utilidad de gestión del CheckPoint WatchDog (cpwd), el proceso supervisor que monitorea y reinicia automáticamente procesos críticos de CheckPoint si fallan. WatchDog supervisa servicios fundamentales (fwm, fwd, cpd, DAService, etc) mediante dos tipos de monitoreo: Pasivo (reinicia solo si proceso termina anormalmente, indicado con ''N'' en MON) y Activo (verifica periódicamente que proceso está vivo y funcionando correctamente, no solo ejecutándose, indicado con ''Y'' en MON). Lista de procesos monitoreados depende de productos instalados y Software Blades activos. cpwd_admin permite ver estado de procesos supervisados, configurar parámetros de monitoreo, iniciar/detener procesos individuales, y gestionar el comportamiento del WatchDog. Logs en $CPDIR/log/cpwd.elg.','[{"args":"list","description":"Muestra estado de todos los procesos monitoreados por WatchDog en formato tabla con columnas: PID (process ID), STAT (status: Alive/Dead/Initializing), START (número de veces iniciado), COMMAND (nombre del proceso), MON (tipo de monitoreo: Y=activo, N=pasivo), ACTION (acción configurada si falla). Salida típica incluye: fwm, fwd, cpd, DAService, vpnd, fwd, pepd, etc según productos instalados. Usar para health-check rápido del sistema y verificar que servicios críticos están ''Alive''. Opción ''-l'' muestra formato largo con más detalles"},{"args":"monitor_list","description":"Lista específicamente los procesos con monitoreo ACTIVO (MON=Y). Estos procesos tienen health checks periódicos además de reinicio automático. Lista predefinida por CheckPoint y no modificable por usuarios. Útil para identificar qué servicios tienen supervisión avanzada"},{"args":"list -l","description":"Formato largo del listado de procesos con información extendida: command line completa, usuario propietario, timestamp de último inicio, intervalo de monitoreo activo, número de reinicios automáticos, thresholds de alertas. Más verboso que ''list'' estándar"},{"args":"start <process_name>","description":"Inicia manualmente un proceso específico bajo supervisión de WatchDog. Ejemplo: ''cpwd_admin start -name fwd -path $FWDIR/bin/fwd -command fwd''. WatchDog registra el proceso y comienza a monitorearlo. Útil para iniciar servicios individuales sin cpstart completo"},{"args":"stop <process_name>","description":"Detiene un proceso específico monitoreado por WatchDog. Termina el proceso limpiamente y WatchDog deja de supervisarlo temporalmente. Ejemplo: ''cpwd_admin stop -name fwd''. NO lo elimina permanentemente del monitoreo (usar ''del'' para eso)"},{"args":"start_monitor","description":"Inicia o reinicia el proceso de CheckPoint WatchDog (cpwd) mismo. El supervisor comienza a monitorear todos los procesos configurados. Ejecutar si cpwd murió o fue detenido manualmente"},{"args":"stop_monitor","description":"Detiene el proceso WatchDog completamente. CRÍTICO: Con WatchDog detenido no hay supervisión automática - si procesos CheckPoint fallan NO se reiniciarán automáticamente. Usar solo para troubleshooting específico de WatchDog o antes de mantenimiento mayor"},{"args":"exist","description":"Verifica si el proceso WatchDog (cpwd) está vivo y ejecutándose. Retorna status code: 0 si está activo, non-zero si no. Útil en scripts de monitoreo para validar que el supervisor fundamental está operativo"},{"args":"getpid <process_name>","description":"Obtiene el Process ID (PID) de un proceso monitoreado específico. Ejemplo: ''cpwd_admin getpid -name fwd''. Útil para debugging, kill manual de procesos zombies o investigación de problemas específicos"},{"args":"kill","description":"Termina (kill -9) el proceso WatchDog mismo. USO EXTREMADAMENTE PELIGROSO: detiene supervisión de todos los procesos CheckPoint abruptamente. WatchDog será reiniciado por init/systemd típicamente. Usar solo como último recurso en emergencias"},{"args":"del <process_name>","description":"Elimina temporalmente un proceso de la base de datos de procesos monitoreados por WatchDog. El proceso deja de ser supervisado hasta próximo reinicio de WatchDog o readición manual. Útil para troubleshooting cuando un servicio está en loop de crash-restart"},{"args":"detach <process_name>","description":"Desacopla temporalmente un proceso del monitoreo de WatchDog sin eliminarlo de la base de datos. WatchDog deja de supervisarlo pero recuerda su configuración. Útil para debugging de procesos problemáticos sin interferencia de auto-restart"},{"args":"flist","description":"Guarda el estado actual de todos los procesos monitoreados a un archivo $CPDIR/tmp/cpwd_list_<epoch_timestamp>.lst. Snapshot del estado para análisis posterior, comparaciones o envío a TAC. Incluye misma información que ''list'' en formato persistente"},{"args":"config","description":"Configura parámetros del CheckPoint WatchDog: intervalos de checking, thresholds de reintentos, delays entre reinicios, acciones ante fallos persistentes. Ver subcomandos con ''cpwd_admin config -h''"}]','service_management','R81+','watchdog, process monitoring, cpwd, service monitoring, daemon monitoring, process supervision, automatic restart, high availability, service recovery, process health, fwm, fwd, cpd, monitored processes, process management','expert','query','firewall',1,'medium','[]',0,'2026-01-01 18:29:54','2026-01-01 18:29:54');
INSERT INTO checkpoint_commands VALUES(69,'cprid','Gestiona el daemon CPRID (CheckPoint Remote Installation Daemon) que habilita la comunicación SIC (Secure Internal Communication) entre Management Server y Security Gateways para operaciones remotas: instalación/actualización de software, instalación de políticas, recuperación de logs, monitoreo remoto y ejecución de comandos. CPRID NO es gestionado por CPWatchDog ni afectado por cpstart/cpstop. Requiere gestión manual separada. Es crítico para la comunicación Management-Gateway - sin CPRID funcionando no se pueden instalar políticas ni gestionar gateways remotamente. Usa certificados SIC para autenticación mutua segura. En Multi-Domain Server debe ejecutarse en contexto del MDS (run mdsenv).','[{"args":"start","description":"Inicia el daemon CPRID manualmente. Habilita capacidad del gateway de recibir conexiones desde Management Server para policy push, software installation, log retrieval. Verificar con ''cprid_admin list'' que proceso está activo. Esencial después de reboot si no está configurado para autostart"},{"args":"stop","description":"Detiene el daemon CPRID. CRÍTICO: gateway deja de aceptar conexiones de management - no se pueden instalar políticas, recuperar logs ni ejecutar comandos remotos. Management Server mostrará gateway como ''unreachable''. Solo usar para troubleshooting o mantenimiento planificado"},{"args":"restart","description":"Reinicia CPRID (stop + start). Útil después de cambios en configuración SIC, problemas de conectividad con management o para resolver conexiones colgadas. Causa breve interrupción en capacidad de gestión remota"}]','service_management','R81+','cprid, remote installation daemon, SIC, secure internal communication, policy installation, remote management, gateway management, certificate authentication, daemon management, management connectivity','expert','config','firewall',0,'high','[]',0,'2026-01-01 18:31:37','2026-01-01 18:53:40');
INSERT INTO checkpoint_commands VALUES(70,'cprinstall','Herramienta del Management Server para gestión remota de software en Security Gateways gestionados: instalación/desinstalación de productos CheckPoint, actualizaciones de versiones, aplicación de hotfixes, creación y restauración de snapshots (backups de configuración), transferencia de paquetes, verificación de prerequisitos, ejecución remota de cpstart/cpstop y reboot de gateways. Centraliza operaciones de lifecycle management desde el Management Server sin necesidad de conectarse individualmente a cada gateway. Requiere CPRID activo en gateways y conectividad SIC válida. En MDS ejecutar con mdsenv en contexto de Domain Management Server.','[{"args":"install <gateway_object> <package>","description":"Instala paquete de software CheckPoint en gateway gestionado especificado. Package debe estar en repositorio del Management Server. Proceso incluye: verificación de prerequisitos, transferencia de package, instalación, validación. Gateway puede requerir reboot posterior. Monitorear progreso en SmartConsole o logs"},{"args":"snapshot <gateway_object>","description":"Crea snapshot (backup) de la configuración actual del gateway incluyendo: OS, productos CheckPoint instalados, configuración local, routing, interfaces. Snapshot se almacena en el gateway para restauración posterior con ''revert''. CRITICAL antes de upgrades mayores"},{"args":"revert <gateway_object> <snapshot_name>","description":"Restaura gateway desde snapshot previamente creado. Rollback completo a estado anterior: versiones de software, configuración, OS settings. Útil para recovery después de upgrade fallido o cambios problemáticos. Requiere reboot del gateway"},{"args":"show <gateway_object>","description":"Lista todos los snapshots disponibles en el gateway especificado mostrando: nombre, fecha de creación, versión capturada, tamaño. Permite seleccionar snapshot apropiado para restore"},{"args":"verify <gateway_object> <package>","description":"Verifica si package puede instalarse en gateway sin ejecutar instalación: valida versión de OS compatible, productos actualmente instalados son compatibles, espacio en disco suficiente, conectividad CPRID activa. Pre-check antes de instalación real"},{"args":"get <gateway_object>","description":"Obtiene y actualiza información de productos y OS instalados en gateway hacia la base de datos del Management Server. Sincroniza inventario de software. Ejecutar periódicamente o después de cambios manuales en gateway"},{"args":"cpstart <gateway_object>","description":"Ejecuta comando cpstart remotamente en el gateway gestionado. Inicia todos los servicios CheckPoint en el gateway desde el Management Server sin conectarse directamente"},{"args":"cpstop <gateway_object>","description":"Ejecuta cpstop remotamente en gateway. CRÍTICO: detiene firewall completamente - tráfico bloqueado. En cluster causa failover. Solo para mantenimiento planificado"},{"args":"boot <gateway_object>","description":"Reinicia (reboot) el gateway gestionado remotamente. Útil después de instalaciones que requieren reboot o troubleshooting. Gateway quedará inaccesible durante boot (2-5 minutos típicamente)"}]','software_management','R81+','remote installation, software management, cprinstall, gateway upgrade, hotfix installation, snapshot, backup, restore, remote reboot, lifecycle management, version upgrade, package management','expert','config','management',0,'high','[]',0,'2026-01-01 18:31:38','2026-01-01 18:31:38');
INSERT INTO checkpoint_commands VALUES(71,'fw fetchlogs','Recupera archivos de logs de seguridad ($FWDIR/log/*.log) o audit ($FWDIR/log/*.adtlog) desde un Security Gateway remoto hacia el Management Server o estación local. Permite centralizar logs para análisis forense, cumplimiento normativo o troubleshooting cuando SmartConsole no está disponible. Soporta transferencia de múltiples archivos de log simultáneamente. Útil cuando la recuperación automática de logs falla o se necesitan logs históricos no disponibles en SmartConsole. Requiere conectividad válida con el gateway y permisos adecuados.','[{"args":"-f <log_file> <gateway>","description":"Recupera archivo de log específico desde gateway. Ejemplo: ''fw fetchlogs -f fw.log gateway01''. Puede especificar múltiples archivos con múltiples flags -f. Logs se transfieren a directorio actual o ubicación especificada"},{"args":"-f <log_file1> -f <log_file2> <gateway>","description":"Recupera múltiples archivos de log en una sola operación. Eficiente para recopilar varios logs simultáneamente. Ejemplo: ''fw fetchlogs -f fw.log -f fw.adtlog gateway01''"}]','logging','R81+','fetch logs, log retrieval, remote logs, fw.log, audit logs, log download, centralized logging, log collection, forensics, compliance, log transfer, security logs','expert','query','management',0,'low','[]',0,'2026-01-01 18:33:18','2026-01-01 18:33:18');
INSERT INTO checkpoint_commands VALUES(72,'fw hastat','Muestra información de estado de equipos CheckPoint en configuración de High Availability (ClusterXL). Permite verificar rápidamente el estado del cluster, qué miembro es ACTIVE/STANDBY, ID de cada miembro, problemas con critical devices y estado general de sincronización. Comando rápido de diagnóstico de cluster complementario a cphaprob. Útil para health-check rápido de HA sin necesidad de comandos más complejos.','[{"args":"","description":"Sin argumentos muestra estado HA del cluster local: ID de cada miembro, estado (ACTIVE/STANDBY/DOWN), dirección IP única de cada miembro, estado de sincronización, problemas reportados. Output compacto para verificación rápida de estado HA"}]','clusterxl','R81+','high availability, cluster status, ha status, clusterxl, active standby, cluster health, failover status, ha monitoring, cluster state','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:33:18','2026-01-01 18:33:18');
INSERT INTO checkpoint_commands VALUES(73,'fw kill','Termina (kill) un proceso CheckPoint específico por nombre o PID. Permite detener procesos individuales sin afectar otros servicios. Útil para troubleshooting cuando un proceso está colgado, consumiendo recursos excesivos o comportamiento anormal. PRECAUCIÓN: matar procesos críticos (fw, fwm, cpd) puede causar caída de servicio. WatchDog intentará reiniciar procesos monitoreados automáticamente. Para procesos no críticos o cuando WatchDog no los reinicia usar este comando.','[{"args":"<process_name>","description":"Termina proceso por nombre. Ejemplo: ''fw kill fwd''. Busca proceso por nombre y lo termina con SIGTERM primero. WatchDog puede reiniciarlo automáticamente si está monitoreado"},{"args":"-s <signal> <process_name>","description":"Envía señal específica al proceso. Ejemplo: ''fw kill -s 9 fwd'' envía SIGKILL (kill -9) para terminación forzada. Usar SIGKILL solo cuando SIGTERM no funciona"}]','service_management','R81+','kill process, terminate process, stop daemon, process management, troubleshooting, hung process, resource cleanup, emergency stop','expert','config','firewall',0,'medium','[]',0,'2026-01-01 18:33:19','2026-01-01 18:33:19');
INSERT INTO checkpoint_commands VALUES(74,'fw log','Muestra contenido de archivos de log de CheckPoint directamente desde CLI: logs de seguridad (fw.log) o audit (fw.adtlog). Permite consultar y filtrar logs sin SmartConsole para troubleshooting rápido, análisis forense, investigación de incidentes o cuando GUI no está disponible. Soporta filtros por fecha/hora, IP origen/destino, puerto, acción (accept/drop), servicio y otros campos. Output puede ser texto plano o formato específico. Esencial para administradores CLI y scripts de análisis automatizado de logs.','[{"args":"-f","description":"Modo follow (tail -f). Muestra logs en tiempo real según se generan. Útil para monitoreo live de actividad del firewall durante troubleshooting. Presionar Ctrl+C para detener. Ejemplo: ''fw log -f''"},{"args":"-b <start_time> -e <end_time>","description":"Filtra logs por rango de tiempo. Formato de fechas: ''YYYY-MM-DD HH:MM:SS''. Ejemplo: ''fw log -b \"2024-01-15 10:00:00\" -e \"2024-01-15 11:00:00\"''. Acota resultados a ventana temporal específica"},{"args":"-s <source_ip>","description":"Filtra por IP de origen. Muestra solo logs donde source IP coincide. Ejemplo: ''fw log -s 10.1.1.50''. Combinable con otros filtros"},{"args":"-d <destination_ip>","description":"Filtra por IP de destino. Ejemplo: ''fw log -d 8.8.8.8''. Investiga tráfico hacia destino específico"},{"args":"-a accept","description":"Filtra por acción: ''accept'' muestra solo conexiones permitidas. ''drop'' muestra solo bloqueadas. ''reject'' muestra rechazadas. Útil para troubleshooting de conectividad o investigar intentos bloqueados"},{"args":"-l <log_file>","description":"Especifica archivo de log a consultar. Por defecto usa fw.log (log actual). Ejemplo: ''fw log -l fw.log.1'' para log rotado anterior. ''fw log -l fw.adtlog'' para audit log"}]','logging','R81+','view logs, log analysis, fw.log, audit log, security logs, log query, log filter, cli logging, log investigation, troubleshooting, forensics, incident response','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:33:19','2026-01-01 18:33:19');
INSERT INTO checkpoint_commands VALUES(75,'fw logswitch','Fuerza rotación manual del archivo de log activo de CheckPoint: fw.log (security) o fw.adtlog (audit). Cierra el archivo actual y crea uno nuevo, renombrando el anterior con sufijo numérico incremental (fw.log.1, fw.log.2, etc). Útil antes de transferir logs, cuando se alcanza tamaño excesivo que impacta performance, para análisis forense preservando estado exacto del log, o troubleshooting de problemas de escritura de logs. Rotación automática ocurre según configuración pero comando permite control manual.','[{"args":"","description":"Rota el log de seguridad activo (fw.log). Cierra fw.log actual, lo renombra a fw.log.1 (logs anteriores incrementan: .1 -> .2, etc) y crea nuevo fw.log vacío. Operación instantánea sin pérdida de logs"},{"args":"-audit","description":"Rota el log de audit activo (fw.adtlog) en lugar del log de seguridad. Mismo comportamiento: renombra actual a fw.adtlog.1 y crea nuevo fw.adtlog"}]','logging','R81+','log rotation, logswitch, rotate logs, fw.log, log management, log archiving, log rollover, manual rotation','expert','config','firewall',0,'low','[]',0,'2026-01-01 18:33:19','2026-01-01 18:33:19');
INSERT INTO checkpoint_commands VALUES(76,'fw lslogs','Lista todos los archivos de log disponibles en el Security Gateway o Management Server: logs de seguridad (fw.log*), audit (fw.adtlog*), logs rotados con sufijos numéricos. Muestra nombre de archivo, tamaño, fecha de creación/modificación. Útil para inventario de logs antes de fetchlogs, verificar rotaciones, identificar logs históricos disponibles, planificar limpieza de logs antiguos o calcular espacio usado por logging.','[{"args":"","description":"Sin argumentos lista todos los archivos de log en $FWDIR/log/: fw.log, fw.log.1, fw.log.2, fw.adtlog, fw.adtlog.1, etc. Muestra nombre, tamaño en bytes/KB/MB y timestamps. Vista completa de logs disponibles"}]','logging','R81+','list logs, log files, log inventory, available logs, log management, fw.log, audit logs, log rotation status','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:33:20','2026-01-01 18:33:20');
INSERT INTO checkpoint_commands VALUES(77,'fw mergefiles','Fusiona múltiples archivos de log de CheckPoint en un solo archivo consolidado. Útil para análisis centralizado de logs de múltiples gateways, correlación de eventos entre diferentes fuentes, creación de reportes unificados o cuando se necesita analizar actividad completa de infraestructura distribuida. Mantiene orden cronológico de eventos durante la fusión. Soporta logs de seguridad y audit. Archivo resultante puede importarse en SmartConsole para análisis visual o procesarse con scripts.','[{"args":"-i <input_file1> -i <input_file2> -o <output_file>","description":"Fusiona dos o más archivos de log especificados con múltiples flags -i en un archivo de salida. Eventos se ordenan cronológicamente. Ejemplo: ''fw mergefiles -i fw1.log -i fw2.log -i fw3.log -o merged.log''. Puede procesar logs de diferentes gateways"}]','logging','R81+','merge logs, consolidate logs, log fusion, unified logs, multi-gateway logs, log correlation, log aggregation, centralized analysis','expert','query','management',0,'low','[]',0,'2026-01-01 18:34:21','2026-01-01 18:34:21');
INSERT INTO checkpoint_commands VALUES(78,'fw repairlog','Repara archivos de log de CheckPoint corruptos o dañados intentando recuperar máximo de entradas válidas. Corrupción puede ocurrir por caídas abruptas de sistema, disco lleno, problemas de hardware o bugs. Comando intenta reconstruir índices, saltar secciones corruptas y recuperar registros legibles. Útil cuando SmartConsole no puede abrir log, ''fw log'' falla al leer archivo o se necesita recuperar información crítica de logs dañados para investigación forense o cumplimiento. SIEMPRE hacer backup del log antes de repair.','[{"args":"<log_file>","description":"Intenta reparar archivo de log especificado. Ejemplo: ''fw repairlog fw.log''. Crea archivo reparado con sufijo .repaired. Proceso puede tardar varios minutos en logs grandes. Verificar output con ''fw log'' después de repair"}]','logging','R81+','repair log, fix corrupted log, log recovery, damaged log, log corruption, forensics recovery, emergency log repair, log reconstruction','expert','config','firewall',0,'low','[]',0,'2026-01-01 18:34:22','2026-01-01 18:34:22');
INSERT INTO checkpoint_commands VALUES(79,'fw sam','Gestiona Suspicious Activity Monitoring (SAM) - sistema de bloqueo automático de IPs sospechosas por tiempo definido. SAM bloquea temporalmente fuentes de ataques detectados por IPS, Anti-Bot, Application Control u otras blades cuando se supera threshold de actividad maliciosa. Permite consultar reglas SAM activas, IPs actualmente bloqueadas, duración de bloqueos, razón de bloqueo y liberar manualmente IPs bloqueadas. Complementa la protección automática con gestión manual cuando se detectan falsos positivos o se necesita desbloquear legítimos temporalmente bloqueados.','[{"args":"-v","description":"Muestra todas las reglas SAM activas actualmente en el firewall: IP bloqueada, tiempo restante de bloqueo, razón/blade que originó el bloqueo (IPS/Anti-Bot/AppControl), timestamp de inicio, política SAM aplicada. Vista completa de bloqueos activos para troubleshooting o auditoria"},{"args":"-C <IP_address>","description":"Cancela/elimina manualmente bloqueo SAM de IP específica. IP queda inmediatamente desbloqueada permitiendo tráfico. Ejemplo: ''fw sam -C 10.1.1.50''. Útil cuando se detectó falso positivo o usuario legítimo fue bloqueado por error"}]','security','R81+','SAM, suspicious activity monitoring, automatic blocking, IP blocking, threat prevention, IPS blocking, anti-bot, temporary block, dynamic blocking, security automation','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:34:22','2026-01-01 18:34:22');
INSERT INTO checkpoint_commands VALUES(80,'fw sam_policy','Gestiona políticas de Suspicious Activity Monitoring (SAM) que definen comportamiento de bloqueo automático: duración de bloqueos, thresholds para activación, acciones ante reincidencia, integración con UserCheck para notificaciones. Permite añadir nuevas políticas SAM, eliminar existentes, consultar políticas configuradas y ejecutar operaciones batch desde archivo. Configuración de SAM policy determina agresividad de la protección automática. Balance entre seguridad (bloqueos más rápidos/largos) y usabilidad (evitar falsos positivos).','[{"args":"add","description":"Añade nueva política SAM con parámetros: duración de bloqueo, criterios de activación, acciones. Requiere especificar tiempo de bloqueo, blade origen (IPS/Anti-Bot/etc), threshold de eventos. Política queda activa inmediatamente"},{"args":"del","description":"Elimina política SAM existente. IP addresses ya bloqueadas bajo esta política mantienen su bloqueo hasta expirar naturalmente. Nuevos eventos ya no aplicarán esta política"},{"args":"get","description":"Consulta y muestra políticas SAM configuradas: parámetros de cada política, thresholds, duraciones, blades asociadas. Vista completa de configuración SAM activa"},{"args":"batch -f <file>","description":"Ejecuta múltiples operaciones SAM (add/del) desde archivo script. Útil para configuración masiva o estandarización de políticas SAM across múltiples gateways. Archivo contiene comandos sam_policy uno por línea"}]','security','R81+','SAM policy, blocking policy, automatic response policy, threat prevention policy, IPS automation, security policy, dynamic blocking rules, sam configuration','expert','config','firewall',0,'medium','[]',0,'2026-01-01 18:34:22','2026-01-01 18:34:22');
INSERT INTO checkpoint_commands VALUES(81,'cpprod_util','Utilidad para gestión de productos CheckPoint instalados. Permite consultar productos instalados, versiones, estados de activación, dependencias entre productos y realizar operaciones de mantenimiento sobre la instalación de software CheckPoint. Herramienta de bajo nivel para troubleshooting de instalaciones, verificación de integridad de productos y diagnóstico de problemas post-instalación o upgrade. Información técnica orientada a soporte y administradores avanzados.','[{"args":"CPPROD_GetValue <product> <attribute>","description":"Consulta valor de atributo específico de un producto instalado. Ejemplo: ''cpprod_util CPPROD_GetValue FW1 VersionName'' retorna versión del firewall. Atributos comunes: VersionName, BuildNumber, InstallDate, Status"},{"args":"CPPROD_ListProducts","description":"Lista todos los productos CheckPoint instalados en el sistema con sus nombres internos. Vista rápida de componentes instalados"}]','software_management','R81+','product utility, installed products, version information, product management, installation verification, product status, software inventory, product dependencies','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:35:51','2026-01-01 18:35:51');
INSERT INTO checkpoint_commands VALUES(82,'ldapsearch','Herramienta de consulta LDAP que permite buscar y recuperar información de directorios LDAP (Active Directory, OpenLDAP, etc). CheckPoint usa LDAP para autenticación de usuarios, Identity Awareness, poblar SmartDirectory y User Management. ldapsearch permite troubleshooting de conectividad LDAP, validar queries de Identity Awareness, verificar estructura de directorio, probar filters LDAP antes de configurar en SmartConsole y diagnosticar problemas de autenticación basada en LDAP. Comando estándar LDAP con sintaxis universal. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"-H ldap://<server> -b <base_dn> -D <bind_dn> -w <password>","description":"Query LDAP básico especificando servidor LDAP, base DN para búsqueda, credenciales de bind. Ejemplo: ''ldapsearch -H ldap://dc01.company.com -b \"dc=company,dc=com\" -D \"cn=admin,dc=company,dc=com\" -w password''. Retorna todos los objetos en base DN"},{"args":"-x -LLL \"(filter)\" attributes","description":"Búsqueda con filtro LDAP y atributos específicos. -x usa autenticación simple, -LLL output limpio sin comentarios. Ejemplo: ''ldapsearch -x -LLL \"(sAMAccountName=jdoe)\" mail cn'' busca usuario jdoe y retorna email y nombre"}]','identity_management','R81+','ldap query, active directory, ldap search, user lookup, identity awareness, directory services, ldap troubleshooting, user authentication, ldap connectivity','expert','query','management',0,'low','[]',0,'2026-01-01 18:35:51','2026-01-01 18:56:20');
INSERT INTO checkpoint_commands VALUES(83,'ldapmodify','Modifica entradas existentes en directorio LDAP o añade nuevas entradas. Permite actualizar atributos de usuarios, grupos u objetos LDAP directamente desde CLI. Útil para automatización de cambios masivos en directorio, scripts de mantenimiento o cuando GUI LDAP no está disponible. En contexto CheckPoint, permite modificar atributos usados por Identity Awareness o User Management. Requiere permisos de escritura en LDAP y conocimiento de formato LDIF. PRECAUCIÓN: modificaciones incorrectas pueden afectar autenticación y servicios dependientes de LDAP. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"-H ldap://<server> -D <bind_dn> -w <password> -f <ldif_file>","description":"Ejecuta modificaciones LDAP desde archivo LDIF. Archivo contiene operaciones de modificación en formato estándar LDIF. Permite cambios masivos automatizados. Ejemplo: ''ldapmodify -H ldap://dc01 -D \"cn=admin,dc=company,dc=com\" -w pass -f changes.ldif''"}]','identity_management','R81+','ldap modify, directory modification, update ldap, ldap administration, user management, attribute modification, ldap automation, bulk updates','expert','config','management',0,'medium','[]',0,'2026-01-01 18:35:52','2026-01-01 18:56:29');
INSERT INTO checkpoint_commands VALUES(84,'inet_alert','Envía alertas de seguridad o notificaciones desde CheckPoint hacia destinos configurados: email, SNMP trap, syslog, user-defined scripts. Permite generar alertas manuales para testing de configuración de alerting, troubleshooting de notificaciones, simulación de eventos de seguridad o integración con sistemas externos de monitoreo. Valida que cadena de alerting funciona correctamente end-to-end. Útil durante configuración inicial de alertas para verificar SMTP, SNMP managers o syslog servers reciben notificaciones.','[{"args":"-s <severity> -m <message>","description":"Envía alerta con severidad especificada (low/medium/high/critical) y mensaje customizado. Alerta se procesa según configuración de Global Properties -> Log and Alert. Ejemplo: ''inet_alert -s high -m \"Test security alert\"''. Verifica que destinos de alerting reciben notificación"}]','monitoring','R81+','send alert, alert testing, notification testing, email alert, snmp trap, syslog alert, alert configuration, monitoring test, alert troubleshooting','expert','config','firewall',0,'low','[]',0,'2026-01-01 18:35:52','2026-01-01 18:35:52');
INSERT INTO checkpoint_commands VALUES(85,'sam_alert','Envía alertas específicas relacionadas con Suspicious Activity Monitoring (SAM). Notifica sobre bloqueos SAM, IPs añadidas a blacklist dinámica, thresholds alcanzados o eventos de protección automática. Permite testing de alertas SAM sin necesidad de generar tráfico malicioso real. Valida que administradores reciben notificaciones cuando SAM bloquea amenazas, permitiendo respuesta rápida a incidentes. Integrable con SIEM o sistemas de ticketing para automatización de respuesta. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"-i <IP_address> -r <reason>","description":"Envía alerta SAM simulando bloqueo de IP especificada con razón dada. Ejemplo: ''sam_alert -i 1.2.3.4 -r \"IPS signature match\"''. Testing de notificaciones SAM sin generar ataque real"}]','security','R81+','SAM alert, security alert, blocking notification, threat alert, suspicious activity alert, automated blocking alert, incident notification','expert','config','firewall',0,'low','[]',0,'2026-01-01 18:35:53','2026-01-01 18:57:14');
INSERT INTO checkpoint_commands VALUES(86,'threshold_config','Configura y gestiona thresholds (umbrales) de alerting para diversos parámetros del sistema CheckPoint: uso de CPU, memoria, disco, conexiones concurrentes, throughput, logs por segundo, estados de tabla de conexiones. Cuando valores exceden thresholds configurados, sistema genera alertas automáticas. Permite configuración proactiva de monitoreo para detectar problemas de capacity, ataques DoS, degradación de performance o condiciones anormales antes de que causen outages. Thresholds esenciales para capacity planning y monitoreo proactivo de infraestructura crítica. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"set <parameter> <threshold_value>","description":"Configura threshold para parámetro específico. Ejemplo: ''threshold_config set cpu_usage 90'' genera alerta cuando CPU supera 90%. Parámetros comunes: cpu_usage, memory_usage, disk_usage, concurrent_connections, logs_per_second"},{"args":"get <parameter>","description":"Consulta threshold configurado actualmente para parámetro. Muestra valor límite y estado de habilitación. Ejemplo: ''threshold_config get cpu_usage''"},{"args":"list","description":"Lista todos los thresholds configurados en el sistema con sus valores actuales y estado (enabled/disabled). Vista completa de configuración de alerting proactivo"}]','monitoring','R81+','threshold configuration, alerting thresholds, monitoring limits, capacity thresholds, performance monitoring, proactive monitoring, alert triggers, resource monitoring','expert','config','firewall',0,'low','[]',0,'2026-01-01 18:35:53','2026-01-01 18:57:34');
INSERT INTO checkpoint_commands VALUES(87,'rs_db_tool','Herramienta de gestión de base de datos de Reporting and Security Analysis (R&S / SmartEvent). Permite mantenimiento de la base de datos de logs y eventos: limpieza de datos antiguos, optimización de tablas, verificación de integridad, backup/restore, reindexación para mejorar performance de queries. SmartEvent almacena logs en base de datos PostgreSQL que crece continuamente - rs_db_tool permite gestión de ciclo de vida de datos para mantener performance y controlar uso de disco. Critical en entornos con alto volumen de logs. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"purge -days <number>","description":"Elimina logs y eventos anteriores a número de días especificado de la base de datos. Libera espacio en disco. Ejemplo: ''rs_db_tool purge -days 90'' elimina datos con más de 90 días. Operación irreversible - asegurar backup previo"},{"args":"optimize","description":"Optimiza tablas de la base de datos: reindexación, VACUUM, actualización de estadísticas. Mejora performance de queries en SmartEvent especialmente después de purge masivo de datos. Puede tomar horas en DB grandes"},{"args":"verify","description":"Verifica integridad de la base de datos de SmartEvent: checkea corrupción, índices huérfanos, inconsistencias. Ejecutar periódicamente o si SmartEvent muestra errores de DB"}]','database_management','R81+','smartevent database, reporting database, log database, database maintenance, database optimization, log retention, database cleanup, performance tuning','expert','config','management',0,'medium','[]',0,'2026-01-01 18:35:53','2026-01-01 18:57:00');
INSERT INTO checkpoint_commands VALUES(88,'stattest','Herramienta de testing y diagnóstico de conectividad SNMP y recopilación de estadísticas desde aplicaciones CheckPoint. Verifica que AMON (Application Monitoring) responde correctamente, queries SNMP funcionan, OIDs están accesibles y datos se recopilan adecuadamente. Útil para troubleshooting cuando cpstat falla, SmartView no muestra datos de monitoreo o hay problemas de performance monitoring. Valida cadena completa de recopilación de métricas antes de reportar bugs o abrir casos con TAC. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"","description":"Sin argumentos ejecuta tests básicos de conectividad SNMP y AMON: verifica que servidor AMON responde, queries SNMP funcionan, OIDs están disponibles. Retorna success/failure con detalles de errores si los hay"}]','monitoring','R81+','statistics test, snmp testing, amon testing, monitoring troubleshooting, cpstat debugging, performance monitoring test, metrics validation','expert','query','firewall',1,'low','[]',0,'2026-01-01 18:35:54','2026-01-01 18:57:23');
INSERT INTO checkpoint_commands VALUES(89,'ldapcompare','Compara valor de un atributo específico de una entrada LDAP contra un valor esperado. Valida si atributo tiene valor particular sin necesidad de recuperar entrada completa. Útil para verificación rápida de configuración LDAP, validar pertenencia a grupos, confirmar valores de atributos en scripts de automatización o troubleshooting de Identity Awareness. Retorna TRUE si coincide, FALSE si no coincide. Más eficiente que ldapsearch cuando solo se necesita validar un valor específico sin recuperar datos adicionales. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"\"<DN>\" \"<attribute>:<value>\"","description":"Compara atributo de entrada LDAP contra valor. Ejemplo: ''ldapcompare \"cn=jdoe,ou=users,dc=company,dc=com\" \"memberOf:cn=admins,ou=groups,dc=company,dc=com\"'' verifica si usuario es miembro del grupo admins. Exit code 0 si coincide, 1 si no"}]','identity_management','R81+','ldap compare, attribute validation, ldap verification, value check, identity validation, group membership, attribute comparison, ldap testing','expert','query','management',0,'low','[]',0,'2026-01-01 18:36:49','2026-01-01 18:56:37');
INSERT INTO checkpoint_commands VALUES(90,'ldapmemberconvert','Convierte formato de miembros de grupos LDAP entre diferentes esquemas: RFC2307 (memberUid) y RFC2307bis (member DN). Active Directory y OpenLDAP usan formatos diferentes para representar pertenencia a grupos. Esta herramienta permite migrar entre formatos, adaptar queries de Identity Awareness a diferentes tipos de LDAP servers o troubleshooting de problemas de resolución de grupos. Esencial cuando se integra CheckPoint con directorios LDAP heterogéneos o se migra entre tipos de LDAP. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"-i <input_file> -o <output_file> -f <from_format> -t <to_format>","description":"Convierte formato de grupos entre RFC2307 y RFC2307bis. Input file contiene datos LDAP en formato origen, output recibe conversión. Formatos: rfc2307 (memberUid), rfc2307bis (member DN). Ejemplo: ''ldapmemberconvert -i groups.ldif -o converted.ldif -f rfc2307 -t rfc2307bis''"}]','identity_management','R81+','ldap conversion, group membership conversion, RFC2307, RFC2307bis, schema conversion, ldap migration, memberuid conversion, group format','expert','config','management',0,'low','[]',0,'2026-01-01 18:36:49','2026-01-01 18:56:46');
INSERT INTO checkpoint_commands VALUES(91,'ldapcmd','Herramienta genérica de administración LDAP de CheckPoint que wrappea operaciones LDAP comunes: add, modify, delete, search, compare, bind. Proporciona interfaz unificada para todas las operaciones LDAP desde CLI con sintaxis simplificada específica de CheckPoint. Facilita scripts de automatización de tareas LDAP, troubleshooting de conectividad con directorios, validación de configuración de Identity Awareness y testing de queries LDAP antes de implementar en producción. Abstrae complejidad de herramientas LDAP nativas. En Multi-Domain Server debe ejecutarse en contexto del Domain Management Server (mdsenv).','[{"args":"search -b <base_dn> -f <filter>","description":"Realiza búsqueda LDAP con sintaxis simplificada. Ejemplo: ''ldapcmd search -b \"dc=company,dc=com\" -f \"(sAMAccountName=jdoe)\"''. Wrapper de ldapsearch con sintaxis CheckPoint-friendly"},{"args":"bind -u <username> -p <password>","description":"Prueba autenticación LDAP (bind) con credenciales. Valida conectividad y credenciales contra servidor LDAP. Ejemplo: ''ldapcmd bind -u \"cn=admin,dc=company,dc=com\" -p password''. Retorna success/failure"}]','identity_management','R81+','ldap administration, ldap commands, directory management, ldap operations, identity management, ldap automation, directory administration, unified ldap tool','expert','config','management',0,'low','[]',0,'2026-01-01 18:36:50','2026-01-01 18:56:52');
INSERT INTO checkpoint_commands VALUES(92,'mdsenv','Comando fundamental de Multi-Domain Server que establece variables de entorno del shell para ejecutar comandos en el contexto de un Domain Management Server (DMS/CMA) específico o a nivel MDS global. En entornos MDS cada dominio es una instancia separada de Management Server con su propia base de datos, políticas, objetos y configuración. mdsenv permite al administrador cambiar entre contextos para ejecutar comandos administrativos en el dominio correcto. Sin argumento configura contexto MDS global para comandos multi-dominio (mdsstart, mdsstop, mdscmd). Con nombre/IP de dominio configura contexto para ese DMS específico permitiendo ejecutar comandos como fwm, cpwd_admin, fw log en ese dominio. Verificar contexto actual con ''echo $FWDIR''. Esencial para administración de infraestructuras multi-tenant.','[{"args":"","description":"Sin argumentos establece el contexto de shell a nivel Multi-Domain Server (MDS) para ejecutar comandos globales de MDS como mdsstart, mdsstop, mdsstat. Variables de entorno apuntan al MDS global. Ejemplo: ''mdsenv'' seguido de ''mdsquerydb Domains'' consulta dominios en nivel MDS"},{"args":"<Domain_Name>","description":"Establece contexto de shell para un Domain Management Server (DMS/CMA) específico por nombre. Variables de entorno ($FWDIR, $CPDIR, etc) apuntan al directorio del dominio seleccionado. Todos los comandos subsiguientes se ejecutan en contexto de ese dominio. Ejemplo: ''mdsenv MyDomain_Server'' cambia a contexto de MyDomain_Server, luego ''fwm load Standard gateway01'' instala política en ese dominio"},{"args":"<Domain_IP>","description":"Similar a usar nombre pero especifica Domain Management Server por su dirección IP. Útil cuando nombre no es único o hay problemas de resolución"}]','mds','R81+','multi-domain, mds, domain context, environment variables, domain management server, CMA context, mds context, shell context, multi-domain management, domain switching','expert','config','management',1,'low','[]',0,'2026-01-01 18:42:53','2026-01-01 18:42:53');
INSERT INTO checkpoint_commands VALUES(93,'mdsstart','Inicia el Multi-Domain Server y todos los Domain Management Servers configurados. En MDS el proceso de startup es complejo: primero arranca el MDS global (procesos fwm, cpd, fwd a nivel MDS), luego arranca cada CMA (cada uno con sus propios procesos fwm, cpd, fwd). Por defecto arranca hasta 10 CMAs simultáneamente para acelerar startup pero esto puede ajustarse con variable NUM_EXEC_SIMUL. Comando equivalente a cpstart pero para toda la infraestructura multi-dominio. Usar después de mdsstop, mantenimiento planificado o reboot del servidor. IMPORTANTE: verificar con mdsstat que todos los procesos están ''up'' después del start. En producción con muchos CMAs el startup puede tomar 10-30 minutos.','[{"args":"","description":"Sin argumentos inicia Multi-Domain Server Y todos los Domain Management Servers configurados. Proceso: (1) inicia MDS global, (2) inicia hasta 10 CMAs simultáneamente (configurable con NUM_EXEC_SIMUL), (3) espera que todos completen startup. Puede tomar varios minutos con muchos dominios. Verificar con ''mdsstat'' que todos están ''up''"},{"args":"-m","description":"Inicia SOLO el Multi-Domain Server global sin arrancar ningún Domain Management Server. Los CMAs quedan detenidos. Útil para mantenimiento del MDS sin afectar dominios o cuando se arrancarán dominios selectivamente después con mdsstart_customer"},{"args":"-s","description":"Inicia todos los Domain Management Servers SECUENCIALMENTE en lugar de paralelo. Espera que cada CMA complete startup antes de iniciar el siguiente. Más lento pero reduce carga instantánea en servidor. Usar en sistemas con muchos CMAs o recursos limitados para evitar sobrecarga durante boot"}]','mds','R81+','start mds, multi-domain start, inicio mds, arranque multi-dominio, start domains, iniciar dominios, mds startup, domain startup, service start','expert','config','management',0,'high','[]',0,'2026-01-01 18:42:54','2026-01-01 18:42:54');
INSERT INTO checkpoint_commands VALUES(94,'mdsstart_customer','Inicia un Domain Management Server (CMA) específico sin afectar otros dominios. En entornos MDS con múltiples dominios permite arranque selectivo de CMAs individuales para mantenimiento escalonado, troubleshooting de dominios específicos o recuperación tras problema en un único dominio sin reiniciar toda la infraestructura. Útil cuando un dominio tuvo problema y se detuvo con mdsstop_customer - permite reiniciarlo sin impactar otros dominios productivos. También para arrancar nuevos dominios recién creados sin reiniciar MDS completo. Comando arranca solo los procesos de ese CMA específico (fwm, cpd, fwd del dominio) dejando MDS global y otros dominios sin tocar.','[{"args":"<Domain_Name>","description":"Inicia un Domain Management Server (CMA) específico por nombre sin afectar otros dominios ni el MDS global. Arranca procesos fwm, cpd, fwd para ese CMA únicamente. Ejemplo: ''mdsstart_customer Production_Domain''. Verificar con ''mdsstat'' que el dominio está ''up''"},{"args":"<Domain_IP>","description":"Inicia CMA específico por su dirección IP en lugar de nombre. Mismo comportamiento que usar nombre"}]','mds','R81+','start domain, start cma, iniciar dominio, arranque selectivo, start specific domain, domain startup, customer start, cma start','expert','config','management',0,'high','[]',0,'2026-01-01 18:42:55','2026-01-01 18:42:55');
INSERT INTO checkpoint_commands VALUES(95,'mdsstop','Detiene el Multi-Domain Server y todos los Domain Management Servers configurados de forma ordenada. Ejecuta shutdown controlado: primero detiene CMAs (cada dominio con sus procesos), luego MDS global. IMPACTO CRÍTICO: detiene TODA la infraestructura de management multi-dominio - ningún dominio puede gestionar sus gateways, instalar políticas o recuperar logs mientras esté detenido. En producción usar SOLO durante ventanas de mantenimiento autorizadas. Equivalente a cpstop pero para toda arquitectura multi-dominio. Para detener dominio específico sin impactar otros usar mdsstop_customer. Siempre verificar con mdsstat antes de ejecutar para entender estado actual. Proceso de shutdown puede tomar varios minutos con muchos CMAs.','[{"args":"","description":"Sin argumentos detiene TODOS los Domain Management Servers Y el Multi-Domain Server global. Proceso: (1) detiene todos los CMAs (cada uno con sus procesos fwm, cpd, fwd), (2) detiene MDS global. CRÍTICO: TODA la capacidad de management de TODOS los dominios queda detenida - ningún administrador puede gestionar ningún gateway de ningún dominio. Solo usar para mantenimiento mayor planificado, upgrade del MDS o shutdown del servidor"},{"args":"-m","description":"Detiene SOLO el Multi-Domain Server global sin detener ningún Domain Management Server. Los CMAs continúan ejecutándose independientemente. Caso de uso: mantenimiento del proceso MDS global sin impactar capacidad de management de dominios individuales"},{"args":"-s","description":"Detiene todos los Domain Management Servers SECUENCIALMENTE esperando que cada uno complete shutdown antes de detener el siguiente. Más lento pero más controlado. Reduce impacto instantáneo en sistema permitiendo cierre ordenado"}]','mds','R81+','stop mds, multi-domain stop, detener mds, parada multi-dominio, stop domains, detener dominios, mds shutdown, domain shutdown, service stop','expert','config','management',0,'critical','[]',0,'2026-01-01 18:42:55','2026-01-01 18:42:55');
INSERT INTO checkpoint_commands VALUES(96,'mdsstop_customer','Detiene un Domain Management Server (CMA) específico sin afectar otros dominios. En MDS multi-tenant permite detener dominios individuales para mantenimiento, troubleshooting o isolación de problemas sin impactar otros clientes/dominios. Útil cuando un dominio tiene problema (proceso colgado, base de datos corrupta, necesita reconfiguración) - puede detenerse, resolverse el problema y reiniciarse con mdsstart_customer sin afectar producción de otros dominios. También para apagar dominios de desarrollo/test fuera de horario laboral ahorrando recursos. IMPACTO para dominio detenido: SmartConsole no puede conectar, no se pueden instalar políticas, gateways no pueden recuperar logs hacia ese management. Otros dominios NO afectados.','[{"args":"<Domain_Name>","description":"Detiene un Domain Management Server (CMA) específico por nombre sin afectar otros dominios ni MDS global. Detiene procesos fwm, cpd, fwd de ese CMA. Ejemplo: ''mdsstop_customer Test_Domain''. Dominio queda inaccesible hasta mdsstart_customer. CRÍTICO para ese dominio: administradores no pueden gestionar gateways de ese dominio mientras esté detenido"},{"args":"<Domain_IP>","description":"Detiene CMA específico por IP. Mismo comportamiento que nombre"}]','mds','R81+','stop domain, stop cma, detener dominio, parada selectiva, stop specific domain, domain shutdown, customer stop, cma stop','expert','config','management',0,'high','[]',0,'2026-01-01 18:42:56','2026-01-01 18:42:56');
INSERT INTO checkpoint_commands VALUES(97,'mdsstat','Muestra estado de procesos críticos del Multi-Domain Server y todos los Domain Management Servers en formato tabla. Chequea procesos fundamentales de cada CMA: fwm (policy management), fwd (log daemon), cpd (SmartConsole connectivity), cpca (certificate authority), fwmha (si HA habilitado). Equivalente a cpwd_admin list pero para toda arquitectura multi-dominio en vista consolidada. Esencial para health-check de MDS, verificar que todos los dominios están operativos después de mdsstart, troubleshooting de problemas por dominio, monitoreo proactivo y validación antes/después de mantenimiento. Output muestra claramente cuántos dominios están up vs down. Comando más usado para monitoreo rápido de MDS.','[{"args":"","description":"Sin argumentos muestra estado de MDS global Y todos los Domain Management Servers en tabla formateada. Columnas: Type (MDS/CMA), Name, IP, FWM (PID), FWD (PID), CPD (PID), CPCA (PID). Estados posibles: up (proceso activo con PID), down (proceso caído), pnd (pending initialization), init (inicializando), N/A (PID no disponible aún), N/R (no relevante para este MDS). Muestra resumen: X up, Y down. Verificación rápida de salud de toda infraestructura MDS"},{"args":"-m","description":"Muestra estado SOLO del Multi-Domain Server global sin chequear ningún CMA. Verificación rápida de procesos MDS principales sin overhead de chequear todos los dominios. Útil para troubleshooting específico del MDS"},{"args":"<Domain_Name>","description":"Muestra estado de un Domain Management Server específico por nombre. Solo ese CMA es chequeado. Ejemplo: ''mdsstat Production_Domain''. Verificación focalizada de un dominio sin chequear infraestructura completa"},{"args":"<Domain_IP>","description":"Muestra estado de CMA específico por IP. Mismo comportamiento que nombre"},{"args":"-h","description":"Muestra ayuda con leyenda de estados posibles y formato de output. Explica significado de cada columna y estado"}]','mds','R81+','mds status, domain status, check status, cma status, multi-domain health, process status, fwm status, cpd status, monitoring mds, health check','expert','query','management',1,'low','[]',0,'2026-01-01 18:44:30','2026-01-01 18:44:30');
INSERT INTO checkpoint_commands VALUES(98,'mdsquerydb','Herramienta avanzada de consulta de bases de datos Multi-Domain que permite a administradores ejecutar queries predefinidas para extraer información de bases de datos MDS, Domain y Global. Queries predefinidas en $MDSDIR/conf/queries.conf (NO modificar). Permite obtener inventarios de dominios, objetos globales, objetos por dominio, gateways, administradores, GUI clients sin necesidad de SmartConsole o acceso SQL directo. Esencial para scripts de automatización, reportes de infraestructura, auditorías, migraciones y troubleshooting. Output en formato texto parseable por scripts. Ejecutar en contexto apropiado con mdsenv: sin argumento para queries MDS-level, con dominio para queries domain-level.','[{"args":"Domains","description":"Lista nombres de todos los dominios configurados en el MDS. Ejecutar en contexto MDS (mdsenv sin argumentos primero). Retorna lista de CMAs. Útil para inventario de dominios"},{"args":"GlobalNetworkObjects","description":"Lista nombre y tipo de todos los objetos de red globales. Objetos globales son compartidos entre todos los dominios. Ejecutar en contexto MDS"},{"args":"DomainManagementServers","description":"Lista nombres de todos los Domain Management Servers. Alias: CMAs. Similar a Domains pero más específico"},{"args":"Administrators","description":"Lista nombres de todos los administradores configurados en el MDS global. No incluye admins específicos de cada dominio"},{"args":"MDSs","description":"Lista nombres e IPs de todos los MDS en entorno (relevante en configuraciones MDS distribuidas o HA)"},{"args":"GuiClients","description":"Lista nombres e IPs de todos los GUI clients (Trusted Clients) autorizados a conectar con SmartConsole al MDS"},{"args":"Gateways","description":"Lista nombres e IPs de gateways. Ejecutar en contexto de dominio específico (mdsenv <domain> primero). Muestra gateways de ese dominio"},{"args":"NetworkObjects","description":"Lista objetos de red. En contexto MDS: objetos de todos los dominios. En contexto dominio específico: objetos de ese dominio solamente"},{"args":"<query_key> -f <output_file>","description":"Cualquier query puede redirigirse a archivo con -f. Ejemplo: ''mdsquerydb Domains -f /tmp/domains.txt''. Output se guarda en archivo especificado en lugar de stdout. Útil para scripts y procesamiento automatizado"}]','mds','R81+','mds database query, query mds, domain query, global objects, network objects, database query, mds inventory, domain list, gateway list, administrator list','expert','query','management',1,'low','[]',0,'2026-01-01 18:44:31','2026-01-01 18:44:31');
INSERT INTO checkpoint_commands VALUES(99,'mdsconfig','Programa interactivo de configuración del Multi-Domain Server que permite configurar settings específicos de MDS mediante menú numerado. Equivalente a cpconfig pero para entorno multi-dominio con opciones específicas de MDS: configuración de Leading VIP Interfaces (interfaces físicas donde se configuran IPs virtuales de CMAs), gestión de licencias MDS, configuración de grupos de permisos, administradores del sistema MDS, GUI clients autorizados, autostart del MDS al boot. Usado principalmente durante setup inicial del MDS o cuando se necesita reconfigurar parámetros fundamentales. IMPORTANTE: actualiza schema de BD antes de importar en migraciones. No soportado en todos los parámetros en todos los contextos - algunos requieren SmartConsole.','[{"args":"","description":"Sin argumentos lanza programa interactivo Multi-Domain Server Configuration con menú de opciones numeradas. Permite configurar: (1) Leading VIP Interfaces para IPs virtuales de CMAs, (2) Licencias del MDS, (3) Random Pool para RSA keys, (4) Groups de permisos, (5) Certificate Fingerprint del ICA, (6) Administradores del sistema, (7) GUI Clients autorizados, (8) Autostart del MDS, (9) P1Shell, (10) Start Password, (11-12) IPv6 support. Interfaz similar a cpconfig pero específica de MDS. Navegar con números de menú"}]','mds','R81+','mds configuration, configure mds, mds setup, multi-domain configuration, mds settings, interactive config, initial setup, mds admin, license management mds','expert','config','management',0,'medium','[]',0,'2026-01-01 18:44:32','2026-01-01 18:44:32');
INSERT INTO checkpoint_commands VALUES(100,'mdscmd','Ejecuta comandos CheckPoint en contexto de Multi-Domain Server o Domain Management Server específico. Permite ejecutar comandos administrativos estándar de CheckPoint (fwm, cplic, cpwd_admin, etc) en el contexto apropiado sin necesidad de cambiar manualmente el entorno con mdsenv repetidamente. Útil para automatización y scripting en entornos MDS donde se necesita ejecutar mismo comando en múltiples dominios o comandos en dominios específicos sin alterar contexto del shell actual. Simplifica operaciones batch across dominios. Wrapper conveniente para operaciones multi-dominio.','[{"args":"<command>","description":"Ejecuta comando CheckPoint especificado en contexto MDS o dominio actual configurado con mdsenv. Permite ejecutar comandos estándar (cplic, fwm, etc) sin cambiar manualmente contexto. Ejemplo: ''mdsenv MyDomain; mdscmd cplic print'' ejecuta cplic en MyDomain"},{"args":"-d <domain> <command>","description":"Ejecuta comando en dominio específico sin cambiar contexto global del shell. Ejemplo: ''mdscmd -d Production fwm load Standard gw01''. Evita necesidad de mdsenv previo. Útil en scripts que operan en múltiples dominios"}]','mds','R81+','mds command, domain command, execute on domain, mds operations, domain operations, batch operations, multi-domain automation','expert','config','management',0,'medium','[]',0,'2026-01-01 18:44:32','2026-01-01 18:44:32');
INSERT INTO checkpoint_commands VALUES(101,'mds_backup','Realiza backup de Multi-Domain Server incluyendo base de datos MDS global, todos los Domain Management Servers, objetos globales, políticas, configuraciones y opcionalmente logs. Backup puede ser completo (todo el MDS) o selectivo (dominios específicos). CRÍTICO para disaster recovery - backup regular de MDS es esencial ya que contiene configuraciones de múltiples clientes/dominios. Backup completo captura: objetos globales, configuración de cada CMA, bases de datos de objetos por dominio, políticas instaladas, administradores, licencias. Restauración con mds_restore. IMPORTANTE: para backup consistente idealmente MDS debe estar detenido pero existen opciones para backup online. Planificar backups regulares especialmente antes de upgrades mayores o cambios críticos.','[{"args":"","description":"Sin argumentos realiza backup completo del MDS: base de datos MDS global, configuraciones de todos los CMAs, objetos globales, políticas de todos los dominios, logs (opcional). Backup se guarda en ubicación por defecto. Proceso puede tomar horas dependiendo de cantidad de dominios y tamaño de datos. IMPORTANTE: MDS debe estar detenido (mdsstop) o usar opciones que permitan backup online"},{"args":"-d <domain_name>","description":"Realiza backup de un Domain Management Server específico solamente sin incluir MDS global ni otros dominios. Backup selectivo para recuperación granular. Ejemplo: ''mds_backup -d Production_Domain''"},{"args":"-o <output_path>","description":"Especifica ruta de destino para archivo de backup. Ejemplo: ''mds_backup -o /backup/mds_backup_20240115.tgz''. Permite organizar backups por fecha/motivo"}]','mds','R81+','mds backup, domain backup, backup mds, backup cma, multi-domain backup, disaster recovery, backup all domains, full backup, domain snapshot','expert','config','management',0,'high','[]',0,'2026-01-01 18:44:33','2026-01-01 18:44:33');
INSERT INTO checkpoint_commands VALUES(102,'mds_restore','Restaura Multi-Domain Server desde backup creado con mds_backup. Puede restaurar MDS completo (global + todos los CMAs) o dominios específicos selectivamente. PROCESO EXTREMADAMENTE CRÍTICO Y DESTRUCTIVO: elimina configuración actual y la reemplaza con estado del backup. Usar SOLO para disaster recovery, recuperación de corrupción mayor o rollback planificado después de cambio fallido. MDS debe estar completamente detenido (mdsstop) antes de restore. Proceso puede tomar horas en MDS grandes. VALIDAR backup antes de restore: verificar fecha, integridad, contenido esperado. Después de restore ejecutar mdsstart y verificar con mdsstat que todos los dominios están operativos. Cambios posteriores al backup SE PIERDEN. Planificar ventana de mantenimiento adecuada.','[{"args":"<backup_file>","description":"Restaura MDS completo desde archivo de backup especificado. Ejemplo: ''mds_restore /backup/mds_backup_20240115.tgz''. DESTRUCTIVO: reemplaza configuración actual completa con contenido del backup. MDS debe estar detenido (mdsstop). Todos los CMAs serán restaurados al estado del backup"},{"args":"-d <domain_name> <backup_file>","description":"Restaura SOLO un Domain Management Server específico desde backup sin afectar MDS global ni otros dominios. Recuperación selectiva de dominio específico. DESTRUCTIVO para ese dominio: configuración actual del dominio se pierde"}]','mds','R81+','mds restore, domain restore, restore mds, restore cma, disaster recovery, restore backup, recovery, rollback, restore domains','expert','config','management',0,'critical','[]',0,'2026-01-01 18:44:33','2026-01-01 18:44:33');
INSERT INTO checkpoint_commands VALUES(103,'mcd','Cambia el directorio de trabajo actual a un directorio especificado dentro de $FWDIR en el contexto de un Domain Management Server. En MDS cada dominio tiene su propia estructura de directorios bajo /opt/CPmds-R81/customers/<domain>/CPsuite-R81/fw1/. mcd permite navegar fácilmente dentro de esta estructura sin escribir paths completos. Debe usarse después de mdsenv para establecer contexto del dominio apropiado. Útil para acceder rápidamente a directorios comunes como conf (configuración), log (logs), bin (binarios), database (base de datos) dentro del dominio actual. Simplifica navegación en entorno MDS donde cada dominio tiene jerarquía de directorios propia.','[{"args":"<directory_name>","description":"Cambia directorio actual a subdirectorio especificado dentro de $FWDIR del Domain Management Server en contexto actual. Debe ejecutarse después de mdsenv para establecer contexto de dominio. Ejemplo: ''mdsenv MyDomain; mcd conf'' cambia a $FWDIR/conf del dominio MyDomain. Navega dentro de estructura de directorios del CMA sin necesidad de paths completos"}]','mds','R81+','change directory, mds navigation, domain directory, fwdir navigation, cma directory, directory change, mds filesystem','expert','config','management',1,'low','[]',0,'2026-01-01 18:45:38','2026-01-01 18:45:38');
INSERT INTO checkpoint_commands VALUES(104,'cma_migrate','Importa y migra base de datos de management exportada desde Domain Management Server R7.x a Domain Management Server R81 en Multi-Domain Server. Proceso crítico de migración/upgrade de dominios individuales. Actualiza automáticamente schema de base de datos de versión antigua a R81. Ejecuta verificación pre-upgrade: analiza BD origen buscando problemas que impedirían migración exitosa (objetos corruptos, inconsistencias, configuraciones inválidas). Si verificación falla muestra errores que DEBEN corregirse en sistema origen R7.x antes de reintentar. Solo después de verificación exitosa procede con importación. Usado en procesos de upgrade de infraestructura MDS legacy a versiones modernas. Ver procedimiento completo en R81 Installation and Upgrade Guide. PLANIFICAR ventana de mantenimiento adecuada - proceso puede tomar tiempo considerable.','[{"args":"<exported_file>.tgz <target_fwdir_path>","description":"Importa base de datos exportada desde Domain Management Server R7.x al Domain Management Server R81 objetivo. Primer argumento: path completo al archivo .tgz exportado del R7.x. Segundo argumento: path al $FWDIR del nuevo CMA destino (ej: /opt/CPmds-R81/customers/MyDomain/CPsuite-R81/fw1/). Proceso actualiza schema de BD antes de importar. Ejecuta pre-upgrade verification: si encuentra errores DEBE corregirlos en origen R7.x antes de reintentar. Ejemplo: ''cma_migrate /var/log/orig_R7x_db.tgz /opt/CPmds-R81/customers/NewDomain/CPsuite-R81/fw1/''"}]','mds','R81+','cma migration, domain migration, upgrade domain, migrate database, r7x migration, domain upgrade, database import, schema update, migration tool','expert','config','management',0,'high','[]',0,'2026-01-01 18:45:39','2026-01-01 18:45:39');
INSERT INTO checkpoint_commands VALUES(105,'migrate_global_policies','Transfiere y actualiza base de datos de configuración global desde un Multi-Domain Server a otro MDS. Configuración global incluye: objetos globales (networks, services compartidos entre dominios), políticas globales, VPN communities globales, configuración de global assignment. Proceso de migración/upgrade de infraestructura MDS completa. DESTRUCTIVO: reemplaza TODAS configuraciones globales existentes - previas se respaldan con .pre_migrate. RESTRICCIONES: (1) MDS destino debe estar limpio sin configuraciones globales, (2) NO soporta export desde R80.X para import en R80.X - solo para upgrades, (3) Si migra solo global sin CMAs debe deshabilitar gateways habilitados para uso global. IMPORTANTE en consolidaciones de MDS, migraciones datacenter o upgrades mayores de plataforma MDS.','[{"args":"<path_to_exported_global_db>","description":"Transfiere y actualiza configuración global desde un MDS origen a MDS destino. Argumento: path completo al archivo .tgz de configuración global exportado del MDS origen (originalmente en $MDSDIR/conf/). Proceso reemplaza TODAS las configuraciones globales existentes. Configuraciones previas se guardan con extensión .pre_migrate como backup. RESTRICCIÓN: MDS destino NO debe tener configuraciones globales ya definidas. Ejemplo: ''migrate_global_policies /var/log/exported_global_db.22Jul2019.tgz''"}]','mds','R81+','global policy migration, global configuration migration, mds migration, global objects migration, upgrade global policies, transfer global config, multi-domain migration','expert','config','management',0,'high','[]',0,'2026-01-01 18:45:39','2026-01-01 18:45:39');
INSERT INTO checkpoint_commands VALUES(106,'cpmiquerybin','Herramienta avanzada de consulta de base de datos que se conecta a base de datos especificada (MDS global o dominio específico), ejecuta query definido por usuario y muestra resultados. Resultados pueden ser: colección de Security Gateway sets o lista tab-delimited de campos específicos de cada objeto recuperado. Base de datos por defecto basada en variables de entorno del shell - usar mdsenv para establecer contexto apropiado antes de ejecutar. Permite queries complejos tipo SQL sobre objetos CheckPoint: networks, hosts, services, rules, etc. Documentación completa con sintaxis de queries, ejemplos y lista de atributos en sk65181. MISSING_ATTR aparece cuando se usa atributo inexistente en objetos del resultado. Esencial para scripts avanzados, reportes customizados, auditorías y extracción de datos específicos de configuración.','[{"args":"network_objects <database> <table> <query>","description":"Consulta objetos de red con query definido. Database: contexto (domain/global). Table: tabla a consultar (network_objects, services, etc). Query: criterio de búsqueda. Retorna colección de objetos que coinciden. Ejemplo: ''cpmiquerybin network_objects domain network_objects \"type=''host''\"''"},{"args":"attr_list <database> <table> <query> -a <attributes>","description":"Consulta con lista específica de atributos a retornar. -a especifica atributos separados por coma. Output: lista tab-delimited de campos solicitados por cada objeto. Ejemplo: ''cpmiquerybin attr_list domain network_objects \"type=''network''\" -a name,ipaddr,netmask''. Retorna solo nombre, IP y máscara de redes"}]','mds','R81+','database query, cpmiquerybin, query objects, query policies, database search, object search, advanced query, mds query, domain query, sql-like query','expert','query','management',1,'low','[]',0,'2026-01-01 18:45:40','2026-01-01 18:45:40');
